"use strict";(self.webpackChunkblogsaurus=self.webpackChunkblogsaurus||[]).push([[1477],{30010:n=>{n.exports=JSON.parse('{"blogPosts":[{"id":"flutter-til-26","metadata":{"permalink":"/blog/flutter-til-26","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024-02-06-til26/index.md","source":"@site/blog/2024-02-06-til26/index.md","title":"Flutter TIL - 26","description":"---","date":"2024-02-06T00:00:00.000Z","formattedDate":"February 6, 2024","tags":[{"label":"TIL","permalink":"/blog/tags/til"},{"label":"\ud50c\ub7ec\ud130","permalink":"/blog/tags/\ud50c\ub7ec\ud130"},{"label":"flutter","permalink":"/blog/tags/flutter"},{"label":"context menu","permalink":"/blog/tags/context-menu"}],"readingTime":1.825,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"flutter-til-26","title":"Flutter TIL - 26","authors":["kihyun"],"tags":["TIL","\ud50c\ub7ec\ud130","flutter","context menu"]},"nextItem":{"title":"Virtual Box \uc5d0\ub7ec \ud574\uacb0","permalink":"/blog/virtual-err-1"}},"content":"---\\n\\n## ContextMenu\\n---\\n\\nGestureDetector\ub97c \uc0ac\uc6a9\ud558\uc5ec \uc6b0\ud074\ub9ad \uc774\ubca4\ud2b8 \uc2dc \ucee8\ud14d\uc2a4\ud2b8 \uba54\ub274\uac00 \ub098\uc624\uac8c \ud560 \uc218 \uc788\ub2e4.\\n\\n\uc6b0\ud074\ub9ad \uc774\ubca4\ud2b8\ub294 `onSecondaryTapDown` \ub610\ub294 `onSecondaryTapUp`\uc778\ub370 Up\uc774 \uc88b\uc740\uac8c \ub2e4\uc6b4 \ud588\ub2e4\uac00 \ub2e4\ub978 \uacf3\uc5d0\uc11c Up\ud558\uba74 \ucde8\uc18c\ub418\ub294\uac70\ub3c4 \uc790\uc5f0\uc2a4\ub7fd\uac8c \uc801\uc6a9\ub41c\ub2e4.\\n\\n\uba3c\uc800 overlay\ub97c \uad6c\ud574\uc57c \ud55c\ub2e4.\\n\\n```dart\\nfinal RenderObject? renderObject =\\n              Overlay.of(context).context.findRenderObject();\\n          if (renderObject is RenderBox) {\\n            final RenderBox overlay = renderObject;\\n            ...\\n```\\n\\n\ub80c\ub354\ub9c1\ud560 object\ub97c \uc704\uc82f \ud2b8\ub9ac \uc0c1\uc5d0\uc11c \uac00\uc7a5 \uac00\uae4c\uc6b4 \uc704\uc82f\uc744 build context\ub97c \ud1b5\ud574 \ucc3e\ub294\ub2e4\uace0 \ud558\ub124\uc694\\n\\n```dart\\nshowMenu(\\n  context: context,\\n  position: RelativeRect.fromRect(\\n    details.globalPosition & const Size(48, 48),\\n    Offset.zero & overlay.size,\\n  ),\\n  items: [\\n    const PopupMenuItem(\\n      value: \'menu1\',\\n      child: Text(\'\uba54\ub274 1\'),\\n    ),\\n    const PopupMenuItem(\\n      value: \'menu2\',\\n      child: Text(\'\uba54\ub274 2\'),\\n    ),\\n  ],\\n).then((value) {\\n  // \uba54\ub274 \uc120\ud0dd\uc5d0 \ub530\ub978 \ub3d9\uc791\\n  if (value != null) {\\n    print(\'\uc120\ud0dd\ub41c \uba54\ub274: $value\');\\n  }\\n});\\n```\\n\\nshowMenu \ud568\uc218\ub97c \uc0ac\uc6a9\ud574\uc11c context \uba54\ub274\ub97c \uc815\uc758\ud560 \uc218 \uc788\ub294\ub370\\n\\npostion \uc18d\uc131\uc758 \uac12\uc73c\ub85c \uccab \ubc88\uc9f8 \uc778\uc790\ub85c `Rect rect`\ub97c \ubc1b\uace0 \ub450 \ubc88\uc9f8 \uc778\uc790\ub85c\ub294 `Rect container`\ub97c \ubc1b\uc2b5\ub2c8\ub2e4.\\n\\n\uc815\ud655\ud558\uac8c\ub294 \ubaa8\ub974\uaca0\ub294\ub370 Size(,)\uc758 \uac12\uc744 \uc218\uc815\ud558\uba74 context menu\uac00 \uc81c\ud55c\ub41c \uacf3\uc744 \uc5bc\ub9cc\ud07c \ub098\uac08 \uc218 \uc788\ub294\uc9c0\uc5d0 \ub300\ud55c \uac12\uc778 \uac83 \uac19\uace0\\n\\n`item`\uc744 \ud1b5\ud574\uc11c \uba54\ub274 \uac12\uc744 \uc815\ud560 \uc218 \uc788\uace0\\n\\n`then`\uc744 \ud1b5\ud574\uc11c \ub20c\ub9b0 \ubc84\ud2bc\uc5d0 \ub300\ud55c \uc774\ubca4\ud2b8\ub97c \uc815\uc758\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \ub20c\ub9b0 \ubc84\ud2bc\uc740 item \ub9ac\uc2a4\ud2b8\uc5d0 \uc815\uc758\ub41c value\uac12\uc744 then\uc5d0 \ub118\uae30\uae30 \ub54c\ubb38\uc5d0 switch case\ub85c \uad6c\ubd84 \uac00\ub2a5"},{"id":"virtual-err-1","metadata":{"permalink":"/blog/virtual-err-1","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024-02-01-virtual-err-1/index.md","source":"@site/blog/2024-02-01-virtual-err-1/index.md","title":"Virtual Box \uc5d0\ub7ec \ud574\uacb0","description":"---","date":"2024-02-01T00:00:00.000Z","formattedDate":"February 1, 2024","tags":[{"label":"Virtual Box","permalink":"/blog/tags/virtual-box"}],"readingTime":0.445,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"virtual-err-1","title":"Virtual Box \uc5d0\ub7ec \ud574\uacb0","authors":["kihyun"],"tags":["Virtual Box"]},"prevItem":{"title":"Flutter TIL - 26","permalink":"/blog/flutter-til-26"},"nextItem":{"title":"Flutter TIL - 25","permalink":"/blog/flutter-til-25"}},"content":"---\\n\\n\uc2a4\ub0c5\uc0f7 \ucc0d\uc740 \ud658\uacbd\uc73c\ub85c \ub3cc\uc544\uac00\ub294 \uacfc\uc815\uc5d0\uc11c \uc544\ub798\uc640 \uac19\uc740 \uc5d0\ub7ec \uba54\uc2dc\uc9c0\uac00 \ubc1c\uc0dd\ud588\ub2e4.\\n\\n:::warning\\nThe VM session was aborted.  \\n\uacb0\uacfc \ucf54\ub4dc: E_FAIL (0X80004005)  \\n\uad6c\uc131 \uc694\uc18c: SessionMachine   \\n\uc778\ud130\ud398\uc774\uc2a4: ISession {c0447716-ff5a-4795-b57a-ecd5fffa18a4}\\n:::\\n\\n\uba58\ubd95\uc774 \uc654\uc9c0\ub9cc \ud574\uacb0\ubc29\ubc95\uc744 \ucc3e\uc558\ub2e4.\\n\\n`\uba38\uc2e0` > `\uc800\uc7a5\ub41c \uc0c1\ud0dc \uc0ad\uc81c`\ub97c \ud574\uc8fc\uba74 \ub41c\ub2e4.\\n\\n![Alt text](image.png)"},{"id":"flutter-til-25","metadata":{"permalink":"/blog/flutter-til-25","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024-01-31-til25/index.md","source":"@site/blog/2024-01-31-til25/index.md","title":"Flutter TIL - 25","description":"---","date":"2024-01-31T00:00:00.000Z","formattedDate":"January 31, 2024","tags":[{"label":"TIL","permalink":"/blog/tags/til"},{"label":"\ud50c\ub7ec\ud130","permalink":"/blog/tags/\ud50c\ub7ec\ud130"},{"label":"flutter","permalink":"/blog/tags/flutter"},{"label":"navigator","permalink":"/blog/tags/navigator"},{"label":"named push","permalink":"/blog/tags/named-push"},{"label":"\ub77c\uc6b0\ud305","permalink":"/blog/tags/\ub77c\uc6b0\ud305"},{"label":"\uc560\ub2c8\uba54\uc774\uc158","permalink":"/blog/tags/\uc560\ub2c8\uba54\uc774\uc158"}],"readingTime":6.82,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"flutter-til-25","title":"Flutter TIL - 25","authors":["kihyun"],"tags":["TIL","\ud50c\ub7ec\ud130","flutter","navigator","named push","\ub77c\uc6b0\ud305","\uc560\ub2c8\uba54\uc774\uc158"]},"prevItem":{"title":"Virtual Box \uc5d0\ub7ec \ud574\uacb0","permalink":"/blog/virtual-err-1"},"nextItem":{"title":"Flutter TIL - 24","permalink":"/blog/flutter-til-24"}},"content":"---\\n\\n## Navigator\\n---\\n\\n\ud50c\ub7ec\ud130\uc5d0\uc11c \ucc3d \uc804\ud658\ud558\ub294 \ubc29\ubc95\uc740 \uc5ec\ub7ec \uac00\uc9c0\uac00 \uc788\ub2e4.\\n\\n\ub098\ub294 Navigator.pushNamed\uac00 \uc88b\ub2e4.\\n\\n\ubc29\ubc95\uc740 \uac04\ub2e8\ud558\ub2e4. onGenerateRoute \ud568\uc218\ub97c \ub9cc\ub4e4\uc5b4\uc11c \uc5b4\ub5a4 \uc774\ub984\uc774 \ub4e4\uc5b4\uc654\uc744 \ub54c \uc5b4\ub5a4 \ud398\uc774\uc9c0\ub85c \ub77c\uc6b0\ud305 \ud574\uc904\uc9c0 \uc815\ud558\uba74 \ub41c\ub2e4.\\n\\n```dart\\n  static const String main = \'main\';\\n  static const String login = \'login\';\\n\\n  static Route<dynamic>? onGenerateRoute(RouteSettings settings) {\\n    late final Widget page;\\n    switch (settings.name) {\\n      case RoutePath.login:\\n        page = const LoginPage();\\n        break;\\n      case RoutePath.main:\\n        page = const MainPage();\\n        break;\\n    }\\n\\n     return MaterialPageRoute(builder: (context) => page);\\n  }\\n```\\n\\n\uac04\ub2e8\ud558\uac8c \uc774\ub7f0\uc2dd\uc774\ub2e4. \ud398\uc774\uc9c0 \uc774\ub984\ub4e4\uc744 \uc815\uc758\ud558\uace0 switch case\ub97c \uc0ac\uc6a9\ud558\uc5ec `=> page` \uc774\ub7f0\uc2dd\uc73c\ub85c \ub77c\uc6b0\ud305\uc744 \ud55c\ub2e4.\\n\\nmain.dart\uc5d0\uc11c MaterialApp\uc548\uc5d0 \uc544\ub798\uc640 \uac19\uc774 \uc791\uc131\ub9cc \ud558\uba74\ub41c\ub2e4.\\n\\n```dart\\n      // \ucd08\uae30 \ud398\uc774\uc9c0 \uc124\uc815\\n      initialRoute: RoutePath.login,\\n      // onGenerateRoute \uc124\uc815\\n      onGenerateRoute: RoutePath.onGenerateRoute,\\n```\\n\\n\\n### \ud398\uc774\ub4dc \uc544\uc6c3 \ubc29\uc2dd\\n\\n```dart\\nreturn PageRouteBuilder(\\n  pageBuilder: (context, animation, secondaryAnimation) => page,\\n  transitionsBuilder: (context, animation, secondaryAnimation, child) {\\n    return FadeTransition(\\n      opacity: animation,\\n      child: child,\\n    );\\n  },\\n  transitionDuration: const Duration(seconds: 1),\\n);\\n```\\n\\n\ud398\uc774\ub4dc \uc544\uc6c3\uc744 \ud558\ub824\uba74 FadeTransition\uc744 \uc0ac\uc6a9\ud560 \uc218 \uc788\ub2e4.\\n\\n\uadf8\ub9ac\uace0 `transitionDuration` \uc18d\uc131\uc744 \uc0ac\uc6a9\ud574\uc11c \ud398\uc774\ub4dc \uc544\uc6c3 \uc2dc\uac04\ub3c4 \uc815\ud560 \uc218 \uc788\ub2e4.\\n\\n### \uc2ac\ub77c\uc774\ub4dc \ubc29\uc2dd\\n\\n```dart\\n  return PageRouteBuilder(\\n    pageBuilder: (context, animation, secondaryAnimation) => page,\\n    transitionsBuilder: (context, animation, secondaryAnimation, child) {\\n      const begin = Offset(10.0, 0.0);\\n      const end = Offset.zero;\\n      const curve = Curves.ease;\\n      final tween =\\n          Tween(begin: begin, end: end).chain(CurveTween(curve: curve));\\n      final offsetAnimation = animation.drive(tween);\\n      return SlideTransition(\\n        position: offsetAnimation,\\n        child: child,\\n      );\\n    },\\n    transitionDuration: const Duration(milliseconds: 500),\\n  );\\n```\\n\\n\uc774\uac74 \uc2ac\ub77c\uc774\ub4dc \ubc29\uc2dd\uc774\ub2e4.\\n\\nbegin, end\uc5d0\uc11c \uc0ac\uc6a9\ud558\ub294 Offset\uc740 \uc88c\ud45c\ub97c \ub098\ud0c0\ub0b8\ub2e4. bigin\uc758 Offset x\uc88c\ud45c \ud06c\uae30\uac00 \uc791\uc73c\uba74 \uc6c0\uc9c1\uc774\ub294 \uc18d\ub3c4\ub3c4 \uc791\uc544\uc9d0\\n\\ncurve \uad00\ub828\ud574\uc11c\ub294 \uc544\ub798 \uc815\ub9ac\ud55c\ub2e4.\\n\\n:::tip curve\\n`Curves.linear`: \uc77c\uc815\ud55c \uc18d\ub3c4\ub85c \uc560\ub2c8\uba54\uc774\uc158\uc744 \uc9c4\ud589\ud569\ub2c8\ub2e4.\\n`Curves.ease`: \ucc98\uc74c\uacfc \ub05d\uc740 \ucc9c\ucc9c\ud788, \uc911\uac04\uc740 \ube60\ub974\uac8c \uac00\uc18d\ud558\ub294 \uac00\uc18d\ub3c4 \uace1\uc120\uc785\ub2c8\ub2e4.\\n`Curves.easeIn`: \ucc98\uc74c\uc5d0 \ucc9c\ucc9c\ud788 \uac00\uc18d\ud558\ub294 \uac00\uc18d\ub3c4 \uace1\uc120\uc785\ub2c8\ub2e4.\\n`Curves.easeOut`: \ub05d\uc5d0\uc11c \ucc9c\ucc9c\ud788 \uac10\uc18d\ud558\ub294 \uac10\uc18d\ub3c4 \uace1\uc120\uc785\ub2c8\ub2e4.\\n`Curves.easeInOut`: \ucc98\uc74c\uacfc \ub05d\uc5d0\uc11c \ucc9c\ucc9c\ud788 \uac00\uc18d\ud558\uace0 \uc911\uac04\uc5d0\uc11c \ucc9c\ucc9c\ud788 \uac10\uc18d\ud558\ub294 \uace1\uc120\uc785\ub2c8\ub2e4.\\n`Curves.bounceIn`: \ubc14\uc6b4\uc2a4 \ud6a8\uacfc\uac00 \uc788\ub294 \uace1\uc120\uc73c\ub85c, \ucc98\uc74c\uc5d0 \ud280\uc5b4\uc624\ub974\ub294 \ud6a8\uacfc\uac00 \uc788\uc2b5\ub2c8\ub2e4.\\n`Curves.bounceOut`: \ubc14\uc6b4\uc2a4 \ud6a8\uacfc\uac00 \uc788\ub294 \uace1\uc120\uc73c\ub85c, \ub05d\uc5d0\uc11c \ud280\uc5b4\uc624\ub974\ub294 \ud6a8\uacfc\uac00 \uc788\uc2b5\ub2c8\ub2e4.\\n`Curves.elasticIn`: \ud0c4\ub825 \ud6a8\uacfc\uac00 \uc788\ub294 \uace1\uc120\uc73c\ub85c, \ucc98\uc74c\uc5d0 \uc7a0\uae50 \ud295\uae30\ub294 \ud6a8\uacfc\uac00 \uc788\uc2b5\ub2c8\ub2e4.\\n`Curves.elasticOut`: \ud0c4\ub825 \ud6a8\uacfc\uac00 \uc788\ub294 \uace1\uc120\uc73c\ub85c, \ub05d\uc5d0\uc11c \uc7a0\uae50 \ud295\uae30\ub294 \ud6a8\uacfc\uac00 \uc788\uc2b5\ub2c8\ub2e4.\\n:::\\n\\n\uadf8\ub807\uac8c \ud574\uc11c `SlideTransition`\ub97c \uc0ac\uc6a9\ud574\uc11c \uc2ac\ub77c\uc774\ub4dc \ud615\uc2dd\uc73c\ub85c \ud55c\ub2e4. \\n\\n`transitionsBuilder`\uc758 `child`\uac12\uc5d0\ub294 `pageBuilder`\uc5d0\uc11c return\ud55c page\uac00 \ub4e4\uc5b4\uac04\ub2e4.\\n\\n\\n## \uc560\ub2c8\uba54\uc774\uc158\\n---\\n\\n```dart\\n  void _animateWindowAndNavigate(BuildContext context) {\\n    const targetSize = Size(800, 800);\\n    const duration = Duration(milliseconds: 500); // \uc560\ub2c8\uba54\uc774\uc158 \uc9c0\uc18d \uc2dc\uac04\\n    const stepDuration = Duration(milliseconds: 10);\\n    int steps = duration.inMilliseconds ~/ stepDuration.inMilliseconds;\\n    double widthStep = (targetSize.width - appWindow.size.width) / steps;\\n    double heightStep = (targetSize.height - appWindow.size.height) / steps;\\n\\n    Timer.periodic(stepDuration, (timer) {\\n    appWindow.size = Size(\\n      appWindow.size.width + widthStep,\\n      appWindow.size.height + heightStep,\\n    );\\n\\n      if (appWindow.size.width >= targetSize.width ||\\n          appWindow.size.height >= targetSize.height) {\\n        timer.cancel();\\n        appWindow.size = targetSize;\\n\\n        // \ucc3d \ud06c\uae30 \uc870\uc815 \ud6c4 \ud398\uc774\uc9c0 \uc804\ud658\\n        Navigator.pushNamed(context, RoutePath.main);\\n      }\\n    });\\n  }\\n```\\n\\n\ud398\uc774\uc9c0\uac00 \ubcc0\ud560 \ub54c \uac01 \ud398\uc774\uc9c0\uc5d0 \ub9de\ub294 \ud06c\uae30\ub97c \uc704\ud574\uc11c \ucc98\uc74c\uc5d0 \ud398\uc774\uc9c0\uc5d0 \ub3c4\ub2ec\ud558\uba74 \uadf8\ub0e5 \ubc14\ub85c \ubcc0\ud558\uac8c \ud588\ub354\ub2c8 \ubc84\ubc85\uac70\ub9ac\ub294 \uac83 \uac19\uc544\uc11c \uc0ac\uc774\uc988\ub97c \ud0a4\uc6b0\uace0 \ud654\uba74 \uc804\ud658\ud558\ub3c4\ub85d \ud574\ubd24\ub2e4.\\n\\n\uae30\uc874 \ud06c\uae30\uc5d0\uc11c \uc2a4\ud15d\ub9c8\ub2e4 \uacc4\uc0b0\ub41c \uac12(`widthStep`,`heightStep`)\uc744 \uc2a4\ud15d\uc758 \uc2dc\uac04(`stepDuration`)\ub9c8\ub2e4 \ud0a4\uc6b0\ub294 \uac83\uc774\ub2e4.\\n\\n```dart\\n    Timer.periodic(stepDuration, (timer) {\\n    appWindow.size = Size(\\n      appWindow.size.width + widthStep,\\n      appWindow.size.height + heightStep,\\n    );\\n\\n  ...\\n  \\n  })\\n```\\n\\n`Timer.periodic`\uc744 \uc0ac\uc6a9\ud574\uc11c `stepDuration` \ub9c8\ub2e4 \uc544\ub798 \ub85c\uc9c1\uc744 \uc218\ud589\ud558\uba74\uc11c if\ubb38\uc744 \ud1b5\ud574 \uc870\uac74\uc774 \ucda9\uc871\ud55c\ub2e4\uba74 `timer.cancel` \uc989 \ubb34\ud55c\ub8e8\ud504\ub97c \ub098\uc624\ub294 \ub4ef\ud55c break\ub97c \uac70\ub294 \ub85c\uc9c1\u3147\ube44\ub2c8\ub2e4.\\n\\n\uadfc\ub370 \uc704\ub294 \ud654\uba74\uc774 \ucee4\uc9c8\uc218\ub85d \ubc84\ubc85\uac70\ub9b0\ub2e4. \uadf8\ub798\uc11c \ub9c8\uc9c0\ub9c9\uc5d0 \ucee4\uc9c0\ub294 \uc18d\ub3c4\ub97c \uc904\uc5ec\uc57c \ud558\ub098 \ud588\ub2e4. \uc544\ub798\uc640 \uac19\uc740 \ucf54\ub4dc\uac00 \ub098\uc654\ub2e4.\\n\\n\\n```dart\\n  void _animateWindowAndNavigate(BuildContext context) {\\n    const targetSize = Size(800, 800);\\n    const duration = Duration(milliseconds: 500); // \uc560\ub2c8\uba54\uc774\uc158 \uc9c0\uc18d \uc2dc\uac04\\n    const timerDuration = Duration(milliseconds: 10);\\n    const curve = Curves.decelerate;\\n    int steps = duration.inMilliseconds ~/ timerDuration.inMilliseconds;\\n    int currentStep = 0;\\n\\n    Timer.periodic(timerDuration, (timer) {\\n      double fraction = (currentStep / steps);\\n      // \'Curves.decelerate\' \ucee4\ube0c\ub97c \uc0ac\uc6a9\ud558\uc5ec \ubcc0\ud654\uc728\uc744 \uacc4\uc0b0\ud569\ub2c8\ub2e4.\\n      double easedFraction = curve.transform(fraction);\\n      double width = appWindow.size.width +\\n          ((targetSize.width - appWindow.size.width) * easedFraction);\\n      double height = appWindow.size.height +\\n          ((targetSize.height - appWindow.size.height) * easedFraction);\\n\\n      appWindow.size = Size(width, height);\\n\\n      currentStep++;\\n      if (fraction >= 1) {\\n        timer.cancel();\\n        appWindow.size = targetSize; \\n\\n        // \ucc3d \ud06c\uae30 \uc870\uc815 \ud6c4 \ud398\uc774\uc9c0 \uc804\ud658\\n        Navigator.pushNamed(context, RoutePath.main);\\n      }\\n    });\\n  }\\n```\\n\\n\uc704 \ucf54\ub4dc\ub294 \ub9c8\uc9c0\ub9c9\uc5d0 \uc18d\ub3c4\ub97c \uc904\uc5ec\uc57c \ud558\uae30\uc5d0 `Curves.decelerate`\ub97c \uc0ac\uc6a9\ud574\uc11c \ucee4\ube0c \uac12\uc744 \uc5bb\uc5c8\uace0 \ubcc0\ud654\uc728\uc744 \uacc4\uc0b0\ud558\uc5ec \uc801\uc6a9\ud574\ubd24\uc9c0\ub9cc\\n\\n\uadf8\ub798\ub3c4 \ubc84\ubc85\uac70\ub9bc\uc740 \ud574\uacb0\ud558\uc9c0 \ubabb\ud588\uc2b5\ub2c8\ub2e4.\\n\\n\\n```dart\\n  static void animateWindowForMain(BuildContext context, String routePath) {\\n    const targetSize = mainPageSize; // \uc815\uc758\ub41c main page size\\n    const duration = Duration(milliseconds: 500); // \uc560\ub2c8\uba54\uc774\uc158 \uc9c0\uc18d \uc2dc\uac04\\n    const curve = Curves.easeOutExpo; // \ubcf4\ub2e4 \ubd80\ub4dc\ub7ec\uc6b4 \uc560\ub2c8\uba54\uc774\uc158\uc744 \uc704\ud55c \ucee4\ube0c\\n    final numFrames = duration.inMilliseconds ~/ 16; // \uc57d 60fps\\n\\n    List<Size> frameSizes = List.generate(numFrames, (index) {\\n      double progress = (index / numFrames);\\n      double animatedValue = curve.transform(progress);\\n      double width = appWindow.size.width +\\n          ((targetSize.width - appWindow.size.width) * animatedValue);\\n      double height = appWindow.size.height +\\n          ((targetSize.height - appWindow.size.height) * animatedValue);\\n      return Size(width, height);\\n    });\\n\\n    int currentFrame = 0;\\n    Timer.periodic(const Duration(milliseconds: 16), (timer) {\\n      Size newSize = frameSizes[currentFrame];\\n      appWindow.size = newSize;\\n\\n      currentFrame++;\\n      if (currentFrame >= frameSizes.length) {\\n        timer.cancel();\\n        appWindow.size = targetSize;\\n\\n        // \ucc3d \ud06c\uae30 \uc870\uc815 \ud6c4 \ud398\uc774\uc9c0 \uc804\ud658\\n        Navigator.pushNamed(context, routePath);\\n      }\\n    });\\n  }\\n```\\n\\n\uadf8\ub798\uc11c `List<Size>` \ud0c0\uc785\uc758 \ubcc0\uc218 \uc548\uc5d0 \ubbf8\ub9ac \ud06c\uae30\ub4e4\uc744 \uacc4\uc0b0\ud574\uc11c \ub123\uc5b4\ub193\uace0 `Timer.periodic`\uc5d0\uc120 \ub9ac\uc2a4\ud2b8\uc5d0 \uc788\ub294 \uac12\uc744 \uaebc\ub0b4\uae30\ub9cc \ud558\uba74 \ub418\ub2c8 \ub354\uc6b1 \uae54\ub054\ud574\uc9c8 \uc218 \uc788\uc5c8\uc2b5\ub2c8\ub2e4."},{"id":"flutter-til-24","metadata":{"permalink":"/blog/flutter-til-24","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024-01-25-til24/index.md","source":"@site/blog/2024-01-25-til24/index.md","title":"Flutter TIL - 24","description":"---","date":"2024-01-25T00:00:00.000Z","formattedDate":"January 25, 2024","tags":[{"label":"TIL","permalink":"/blog/tags/til"},{"label":"\ud50c\ub7ec\ud130","permalink":"/blog/tags/\ud50c\ub7ec\ud130"},{"label":"flutter","permalink":"/blog/tags/flutter"},{"label":"intl","permalink":"/blog/tags/intl"},{"label":"localization","permalink":"/blog/tags/localization"},{"label":"\ub2e4\uad6d\uc5b4 \uc124\uc815","permalink":"/blog/tags/\ub2e4\uad6d\uc5b4-\uc124\uc815"}],"readingTime":1.145,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"flutter-til-24","title":"Flutter TIL - 24","authors":["kihyun"],"tags":["TIL","\ud50c\ub7ec\ud130","flutter","intl","localization","\ub2e4\uad6d\uc5b4 \uc124\uc815"]},"prevItem":{"title":"Flutter TIL - 25","permalink":"/blog/flutter-til-25"},"nextItem":{"title":"Flutter TIL - 23","permalink":"/blog/flutter-til-23"}},"content":"---\\n\\n## \ub2e4\uad6d\uc5b4 \uc124\uc815\\n---\\n\\n1. `flutter_localization`,`intl` \ud328\ud0a4\uc9c0 \ucd94\uac00\\n\\n2. vs code `Flutter Intl` extension \uc124\uce58\\n\\n3. pubspec.yaml\ud30c\uc77c\uc5d0 \uc544\ub798 \ub0b4\uc6a9 \uc785\ub825\\n```yaml\\nflutter_intl:\\n  enabled: true\\n  arb_dir: lib/util/lang/l10n\\n  output_dir: lib/util/lang/generated\\n```\\n\\n4. `ctrl`+`shift`+`p`\ub85c \uba85\ub839\uc5b4 \ud314\ub808\ud2b8 \uc5f4\uace0 flutter intl initialize\\n\\n5. \uadf8\ub7ec\uba74 lib/util/lang \ubc11\uc5d0 `l10n`\uacfc `generated`\uac00 \uc0dd\uae40\\n\\n\ub05d\\n\\n### \ud55c\uad6d\uc5b4 \ucd94\uac00\ud558\uae30\\n\\n1. `ctrl`+`shift`+`p`\ub85c \uc5f4\uace0 intl: Add locale\ud558\uace0 `ko`\ucd94\uac00\\n\\n2. \uadf8\ub7ec\uba74 intl_ko.arb\ud30c\uc77c \uc0dd\uae34\ub2e4.\\n\\n```\\n{\\n    \\"@@locale\\" : \\"en\\",\\n    \\"language\\" : \\"language\\"\\n}\\n\\n{\\n    \\"@@locale\\" : \\"ko\\",\\n    \\"language\\" : \\"\uc5b8\uc5b4\\"\\n}\\n```\\n\\n\uc774\ub7f0\uc2dd\uc73c\ub85c \uc124\uc815\ud558\uba74 \ub41c\ub2e4.\\n\\n\\n### \ucd94\uac00 \uc124\uc815\\n\\n1. ios\uc5d0\uc11c \uc0ac\uc6a9\ud558\ub824\uba74 `ios/Runner/Info.plist` \ud30c\uc77c\uc5d0\uc11c\\n\\n```\\n<key>CFBundleDevelopmentRegion</key>\\n\\t<array>\\n\\t\\t<string>en</string>\\n\\t\\t<string>ko</string>\\n\\t</array>\\n```\\n\\nkey\ud0dc\uadf8 \ubc11\uc5d0 array\ud0dc\uadf8 \ucd94\uac00\ud558\uae30\\n\\n\\n2. main.dart \uc124\uc815\\n\\n```dart\\nimport \'package:flutter_localizations/flutter_localizations.dart\';\\n\\n...\\n      localizationsDelegates: const [\\n        S.delegate,\\n        GlobalMaterialLocalizations.delegate,\\n        GlobalWidgetsLocalizations.delegate,\\n        GlobalCupertinoLocalizations.delegate,\\n      ],\\n      supportedLocales: S.delegate.supportedLocales,\\n...\\n```\\n\\n\ud574\ub2f9 \ub0b4\uc6a9 \ucd94\uac00\ud558\uae30\\n\\n\uadf8\ub9ac\uace0 \ucd94\uac00\uc801\uc73c\ub85c \uad6c\ud604\ud574\uc57c\ud560 \uac83\uc774 locale\uac12\uc744 watch\ud558\ub294 provider \ub9cc\ub4e4\uc5b4\uc11c `MaterialApp` \uc548\uc5d0 `locale` \uc18d\uc131\uac12\uc5d0 `watch`\ub85c \ub123\uae30"},{"id":"flutter-til-23","metadata":{"permalink":"/blog/flutter-til-23","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024-01-24-til23/index.md","source":"@site/blog/2024-01-24-til23/index.md","title":"Flutter TIL - 23","description":"---","date":"2024-01-24T00:00:00.000Z","formattedDate":"January 24, 2024","tags":[{"label":"TIL","permalink":"/blog/tags/til"},{"label":"\ud50c\ub7ec\ud130","permalink":"/blog/tags/\ud50c\ub7ec\ud130"},{"label":"flutter","permalink":"/blog/tags/flutter"},{"label":"TextOverflow","permalink":"/blog/tags/text-overflow"}],"readingTime":0.67,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"flutter-til-23","title":"Flutter TIL - 23","authors":["kihyun"],"tags":["TIL","\ud50c\ub7ec\ud130","flutter","TextOverflow"]},"prevItem":{"title":"Flutter TIL - 24","permalink":"/blog/flutter-til-24"},"nextItem":{"title":"Flutter TIL - 22","permalink":"/blog/flutter-til-22"}},"content":"---\\n\\n## TextOverflow\\n---\\n\\nText\uc704\uc82f\uc5d0\uc11c maxLines\ub97c \uc815\ud558\uace0 overflow\ub97c \uc815\uc758\ud560 \uc218 \uc788\ub2e4.\\n\\n### \uc885\ub958\\n\\n- `TextOverflow.clip`: \ud14d\uc2a4\ud2b8\uac00 \uadf8 \uacbd\uacc4\ub97c \ub118\uc5b4\uac00\uba74 \uc798\ub77c\ub0c5\ub2c8\ub2e4. \uc774\ub294 \uae30\ubcf8\uac12\uc785\ub2c8\ub2e4.\\n\\n- `TextOverflow.fade`: \ud14d\uc2a4\ud2b8\uac00 \uadf8 \uacbd\uacc4\ub97c \ub118\uc5b4\uac00\uba74 \uc810\uc810 \ud750\ub824\uc9c0\uac8c \ub9cc\ub4ed\ub2c8\ub2e4.\\n\\n- `TextOverflow.ellipsis`: \ud14d\uc2a4\ud2b8\uac00 \uadf8 \uacbd\uacc4\ub97c \ub118\uc5b4\uac00\uba74 \ub05d\uc5d0 \'...\'\ub97c \ucd94\uac00\ud569\ub2c8\ub2e4.\\n\\n- `TextOverflow.visible`: \ud14d\uc2a4\ud2b8\uac00 \uadf8 \uacbd\uacc4\ub97c \ub118\uc5b4\uac00\ub3c4 \uc798\ub9ac\uac70\ub098 \uc0ac\ub77c\uc9c0\uc9c0 \uc54a\uace0 \uadf8\ub300\ub85c \ubcf4\uc774\uac8c \ud569\ub2c8\ub2e4.\\n\\nfade\ub098 ellipsis\ub97c \ub9ce\uc774 \uc4f8 \ub4ef"},{"id":"flutter-til-22","metadata":{"permalink":"/blog/flutter-til-22","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024-01-23-til22/index.md","source":"@site/blog/2024-01-23-til22/index.md","title":"Flutter TIL - 22","description":"---","date":"2024-01-23T00:00:00.000Z","formattedDate":"January 23, 2024","tags":[{"label":"TIL","permalink":"/blog/tags/til"},{"label":"\ud50c\ub7ec\ud130","permalink":"/blog/tags/\ud50c\ub7ec\ud130"},{"label":"flutter","permalink":"/blog/tags/flutter"},{"label":"dll \uc0ac\uc6a9","permalink":"/blog/tags/dll-\uc0ac\uc6a9"},{"label":"typedef","permalink":"/blog/tags/typedef"}],"readingTime":2.34,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"flutter-til-22","title":"Flutter TIL - 22","authors":["kihyun"],"tags":["TIL","\ud50c\ub7ec\ud130","flutter","dll \uc0ac\uc6a9","typedef"]},"prevItem":{"title":"Flutter TIL - 23","permalink":"/blog/flutter-til-23"},"nextItem":{"title":"Flutter TIL - 21","permalink":"/blog/flutter-til-21"}},"content":"---\\n\\n## typedef\\n---\\n\\n```dart\\ntypedef HelloThere = Pointer<Utf8> Function(Pointer<Utf8> str);\\n```\\n\\n`typedef`\ub97c \uc0ac\uc6a9\ud558\uba74 \ud2b9\uc815 \ud0c0\uc785\uc744 \ucee4\uc2a4\ud141 \ud560 \uc218 \uc788\ub2e4.\\n\\n\ub2e8 \ubb38\uc81c\uc810\uc774 \ud558\ub098 \uc788\ub2e4. \ud568\uc218 \uc548\uc5d0\uc11c\ub294 \uc0ac\uc6a9\ubabb\ud55c\ub2e4. \ubb34\uc870\uac74 \ud568\uc218 \ubc16\uc5d0\uc11c \uc0ac\uc6a9..\\n\\n## dll \uc0ac\uc6a9\ud558\uae30\\n---\\n\\ndll \uc0ac\uc6a9\ud558\ub824\uba74 [ffi](https://pub.dev/packages/ffi)\ub77c\ub294 \ud328\ud0a4\uc9c0\ub97c \uc124\uce58\ud574\uc57c\ud55c\ub2e4.\\n(dart:ffi\ub791\uc740 \ub2e4\ub978 \ud328\ud0a4\uc9c0\ub2e4. \uc774\uac8c \uc788\uc5b4\uc57c `Pointer<Utf8>`\uc0ac\uc6a9 \uac00\ub2a5)\\n\\n### \ud568\uc218 \ubd88\ub7ec\uc624\uae30\\n\\n```dart\\nfinal DynamicLibrary dylib = DynamicLibrary.open(\'hello.dll\');\\n```\\n\\n\uc704\ucc98\ub7fc dll\ud30c\uc77c \uc77d\uc5b4\uc11c \uc77c\ub2e8 dll\ud30c\uc77c \uc790\uccb4\ub97c DynamicLibrary \ud0c0\uc785\uc758 \ubcc0\uc218\uc5d0 \uc800\uc7a5\ud558\uace0\\n(\uc774 \ub54c `hello.dll`\ud30c\uc77c \uc704\uce58\ub294 root\ub2e4.)\\n\\n```dart\\ntypedef HelloThereFunc = Pointer<Utf8> Function(Pointer<Utf8> str);\\ntypedef HelloThere = Pointer<Utf8> Function(Pointer<Utf8> str);\\n```\\n\\n\ud3b8\uc758\ub97c \uc704\ud574\uc11c 2\uac1c\uc758 \ud568\uc218\ud615\uc744 typedef\ub85c \uc815\uc758\ud569\ub2c8\ub2e4.\\n\\n`HelloThereFunc`\ub294 C \ub77c\uc774\ube0c\ub7ec\ub9ac\uc758 native \ud568\uc218\uc774\uace0\\n`HelloThere`\ub294 Dart\uc5d0\uc11c \uc0ac\uc6a9\ud558\ub294 \ud568\uc218\uc785\ub2c8\ub2e4.\\n\\n\ud0c0\uc785\uc774 `Pointer<Utf8>`\uc778 \uc774\uc720\ub294 Dart\uc640 C\uc758 \ubb38\uc790\uc5f4 \ub098\ud0c0\ub0b4\ub294 \ubc29\ubc95\uc774 \ub2ec\ub77c\uc11c \uc5b4\uca54 \uc218 \uc5c6\ub2e4\uace0 \ud558\ub124\uc694\\n\\n\\n```dart\\nfinal helloThere =\\n        dylib.lookupFunction<HelloThereFunc, HelloThere>(\'HelloThere\');\\n```\\n\\n\uc774\uc81c \uc2e4\uc9c8\uc801\uc73c\ub85c dll\uc5d0 \uc788\ub294 \ud568\uc218\ub97c import\ud558\ub294 \ubc29\ubc95\uc785\ub2c8\ub2e4.\\n\\n`dll`\ud30c\uc77c\uc5d0 `DynamicLibrary`\uc758 `lookupFunction<C_native_func, Dart_func>`\uc744 \uc0ac\uc6a9\ud558\uc5ec\uc11c `(\'\ud568\uc218\uc774\ub984\')`\uc774 \ud568\uc218\ub97c \ud638\ucd9c\ud558\ub294 \uac83\uc785\ub2c8\ub2e4.\\n\\n\ucf54\ub4dc\ub85c \ubcf4\uc790\uba74\\n\\n```dart\\nfinal \ubcc0\uc218\uba85 = dll\uc774\ub984.lookupFunction<C_\ub124\uc774\ud2f0\ube0c\ud568\uc218_\uc2dc\uadf8\ub2c8\ucc98, Dart_\ud568\uc218_\uc2dc\uadf8\ub2c8\ucc98>(\ud638\ucd9c\ud560 \ud568\uc218\uc774\ub984);\\n```\\n\\n\ub77c\uace0 \uc815\ub9ac\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n### \uc0ac\uc6a9\ubc95\\n\\n```dart\\nfinal Pointer<Utf8> nName = \'Park\'.toNativeUtf8();\\nfinal Pointer<Utf8> nRst = helloThere(nName);\\ncalloc.free(nName);\\n\\nCenter(\\n  child: Text(nRst.toDartString()),\\n),\\n```\\n\\n\uac04\ub2e8\ud55c \uc0ac\uc6a9 \uc608\uc2dc \uc785\ub2c8\ub2e4.\\n\\n\uba3c\uc800 \uc778\uc790\uac12 \uc120\uc5b8\uc744 \ud569\ub2c8\ub2e4(nName). \uc2a4\ud2b8\ub9c1\uc744 `toNativeUtf8()`\ub85c \ubcc0\ud658\ud574\uc8fc\uace0\\n\\n\ud568\uc218 \ud638\ucd9c\ud558\uace0\\n\\n\ub2e4 \uc4f4 \uac12\uc740 free \uc2dc\ucf1c\uc90d\ub2c8\ub2e4.\\n\\nnRst\ub3c4 free\uc2dc\ucf1c\uc918\uc57c\ud558\ub294\ub370 \uc9c0\uae08 \uc2dc\ud0a4\uba74 \ud504\ub85c\uadf8\ub7a8\uc774 \uaebc\uc9d1\ub2c8\ub2e4. \uc774\uc5d0 \ub300\ud574\uc11c\ub294 \uc870\uae08 \ub354 \uacf5\ubd80\ud574\ubd10\uc57c \ud569\ub2c8\ub2e4."},{"id":"flutter-til-21","metadata":{"permalink":"/blog/flutter-til-21","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024-01-22-til21/index.md","source":"@site/blog/2024-01-22-til21/index.md","title":"Flutter TIL - 21","description":"---","date":"2024-01-22T00:00:00.000Z","formattedDate":"January 22, 2024","tags":[{"label":"TIL","permalink":"/blog/tags/til"},{"label":"\ud50c\ub7ec\ud130","permalink":"/blog/tags/\ud50c\ub7ec\ud130"},{"label":"flutter","permalink":"/blog/tags/flutter"},{"label":"window manger","permalink":"/blog/tags/window-manger"},{"label":"bitsdojo_window","permalink":"/blog/tags/bitsdojo-window"}],"readingTime":2.3,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"flutter-til-21","title":"Flutter TIL - 21","authors":["kihyun"],"tags":["TIL","\ud50c\ub7ec\ud130","flutter","window manger","bitsdojo_window"]},"prevItem":{"title":"Flutter TIL - 22","permalink":"/blog/flutter-til-22"},"nextItem":{"title":"Flutter TIL - 20","permalink":"/blog/flutter-til-20"}},"content":"---\\n\\n## Window app\uc5d0\uc11c \uc0c1\ub2e8\ubc14 \ucee4\uc2a4\ud140\\n---\\n\\n[bitdoho_window](https://pub.dev/packages/bitsdojo_window)\ub77c\ub294 \ud328\ud0a4\uc9c0\ub97c \uc774\uc6a9\ud55c\ub2e4.\\n\\n### \ucd08\uae30\uac12 \uc124\uc815\\n\\n```dart\\nvoid main() {\\n  runApp(const MyApp());\\n  doWhenWindowReady(() {\\n    final win = appWindow; // \uc815\uc758\\n    const initialSize = Size(600, 450); // \uc0ac\uc774\uc988 \uc815\uc758\\n    win.minSize = initialSize; // \ucd5c\uc18c \uc0ac\uc774\uc988 \ud560\ub2f9\\n    win.size = initialSize; // \ucd08\uae30 \uc0ac\uc774\uc988 \ud560\ub2f9\\n    win.alignment = Alignment.center; // \uc2e4\ud589\uc2dc \ud654\uba74 \uc704\uce58\\n    win.title = \\"Custom Window app\\"; // \ucc3d \uc774\ub984\\n    win.show(); // \uc774\uac70 \uc788\uc5b4\uc57c \ubcf4\uc5ec\uc900\ub2e4.\\n  });\\n}\\n```\\n\\n### \ud14c\ub450\ub9ac \uc124\uc815\\n---\\n\\n```dart\\nScaffold(\\n  // \ud14c\ub450\ub9ac\\n  body: WindowBorder(\\n    color: const Color(0xFF0B4279),\\n    width: 1,\\n    child: const Row(\\n      children: [\\n        LeftSide(),\\n        RightSide(),\\n      ],\\n    ),\\n  ),\\n),\\n```\\n\\n`WindowBorder`\ub77c\ub294 \uc704\uc82f\uc744 \uc0ac\uc6a9\ud574\uc11c \ud14c\ub450\ub9ac\ub97c \uc124\uc815\ud560 \uc218 \uc788\ub2e4. \ud14c\ub450\ub9ac\uc758 \ub450\uaed8, \uc0c9\uc0c1\uc744 \uc124\uc815\ud560 \uc218 \uc788\ub2e4.\\n\\n### \uc774\ub3d9 \uc124\uc815\\n\\n```dart\\nchild: Column(\\n  children: [\\n    WindowTitleBarBox(\\n      child: Row(\\n        children: [\\n          Expanded(\\n            child: MoveWindow(),\\n          ),\\n          const WindowButtons(),\\n        ],\\n      ),\\n    ),\\n  ],\\n),\\n```\\n\\n`WindowTitleBarBox`\ub97c \uc815\uc758\ud558\uace0 \uc548\uc5d0\uc11c MoveWindow\ub97c \uc815\uc758\ud558\uba74 \ud574\ub2f9 \uce78\uc744 \uc7a1\uace0 \ub4dc\ub798\uadf8\ud558\uba74 \ucc3d\ub3c4 \ub4dc\ub798\uadf8\ud558\ub3c4\ub85d \uc124\uc815\ud560 \uc218 \uc788\ub2e4.\\n\\n### \uc774\ubca4\ud2b8 \ubc84\ud2bc \uc124\uc815\\n\\n```dart\\nWindowButtonColors buttonColors = WindowButtonColors(\\n  iconNormal: const Color(0xFF0B4279),\\n  mouseOver: const Color(0xFF2A78C6),\\n  mouseDown: const Color(0xFF0B4279),\\n  iconMouseOver: const Color(0xFF0B4279),\\n  iconMouseDown: const Color(0xFFCEE1FF),\\n);\\n\\nRow(\\n  children: [\\n    MinimizeWindowButton(\\n      colors: buttonColors,\\n    ),\\n    MaximizeWindowButton(\\n      colors: buttonColors,\\n    ),\\n    CloseWindowButton(),\\n  ],\\n);\\n```\\n\\n\uc774\ubbf8 \uc815\uc758 \ub3fc\uc788\ub294 \uc774\ubca4\ud2b8 \ubc84\ud2bc\uc744 \uc0ac\uc6a9\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \uc5ec\ub7ec \uac00\uc9c0 \uc0c9\uc0c1 \uc18d\uc131\uc744 \uc815\uc758\ud558\uc5ec \ucee4\uc2a4\ud140\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n## \ud50c\ub7ab\ud3fc \ubcc4 \uc124\uc815\\n---\\n\\n\\n### For Windows\\n\\n```cpp\\n#include <bitsdojo_window_windows/bitsdojo_window_plugin.h>\\nauto bdw = bitsdojo_window_configure(BDW_CUSTOM_FRAME | BDW_HIDE_ON_STARTUP);\\n```\\n\\n\uc704 \ub0b4\uc6a9\uc744 `windows\\\\runner\\\\main.cpp`\uc758 \ucd5c\uc0c1\ub2e8\uc5d0 \uc791\uc131\ud574\uc57c \ud569\ub2c8\ub2e4.\\n\\n### For Mac\\n\\n`macos\\\\runner\\\\MainFlutterWindow.swift`\uc5d0\uc11c\\n\\n```swift\\nimport bitsdojo_window_macos // FlutterMacOS \ubc11\uc5d0 \ucd94\uac00\\n```\\n\\n\uc774 \ucf54\ub4dc\ub97c `import FlutterMacOs`\ubc11\uc5d0 \ucd94\uac00\ud558\uace0\\n\\n```swift\\nclass MainFlutterWindow: NSWindow {\\n\\n// \ub97c \uc544\ub798 \ucf54\ub4dc\ub85c \ubcc0\uacbd\\n\\nclass MainFlutterWindow: BitsdojoWindow {\\n```\\n\\n```swift\\noverride func bitsdojo_window_configure() -> UInt {\\n    return BDW_CUSTOM_FRAME | BDW_HIDE_ON_STARTUP\\n  }\\n```\\n\\n\uc774 \ucf54\ub4dc\ub97c\\n\\n```swift\\noverride func awakeFromNib() {\\n```\\n\\n\uc774 \ucf54\ub4dc \uc704\uc5d0 \ucd94\uac00\ud569\ub2c8\ub2e4.\\n\\n\ub9ac\ub205\uc2a4\ub97c \uc704\ud55c \ubc29\ubc95\ub3c4 \uc788\ub294\ub370 \ub530\ub85c \uc815\ub9ac\ud558\uc9c4 \uc54a\uaca0\uc2b5\ub2c8\ub2e4."},{"id":"flutter-til-20","metadata":{"permalink":"/blog/flutter-til-20","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024-01-19-til20/index.md","source":"@site/blog/2024-01-19-til20/index.md","title":"Flutter TIL - 20","description":"---","date":"2024-01-19T00:00:00.000Z","formattedDate":"January 19, 2024","tags":[{"label":"TIL","permalink":"/blog/tags/til"},{"label":"\ud50c\ub7ec\ud130","permalink":"/blog/tags/\ud50c\ub7ec\ud130"},{"label":"flutter","permalink":"/blog/tags/flutter"},{"label":"revierpod","permalink":"/blog/tags/revierpod"},{"label":"path_provider","permalink":"/blog/tags/path-provider"},{"label":"AsyncValue","permalink":"/blog/tags/async-value"}],"readingTime":2.56,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"flutter-til-20","title":"Flutter TIL - 20","authors":["kihyun"],"tags":["TIL","\ud50c\ub7ec\ud130","flutter","revierpod","path_provider","AsyncValue"]},"prevItem":{"title":"Flutter TIL - 21","permalink":"/blog/flutter-til-21"},"nextItem":{"title":"Flutter TIL - 19","permalink":"/blog/flutter-til-19"}},"content":"---\\n\\n## path_provider \uc885\ub958\\n---\\n\\ngpt\uc758 \ub2f5\ubcc0\uc744 \uc815\ub9ac\ud569\ub2c8\ub2e4.\\n\\n1. getApplicationDocumentsDirectory()  \\n  - Windows\uc5d0\uc11c \uc774 \ud568\uc218\ub294 \uc0ac\uc6a9\uc790\uc758 \\"Documents\\" \ud3f4\ub354\uc5d0 \uc788\ub294 \uc560\ud50c\ub9ac\ucf00\uc774\uc158 \ub370\uc774\ud130 \ub514\ub809\ud1a0\ub9ac\ub97c \ubc18\ud658\ud569\ub2c8\ub2e4. \ubcf4\ud1b5 `C:\\\\Users\\\\<User Name>\\\\Documents` \uacbd\ub85c\ub85c \ucc3e\uc744 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n2. getApplicationSupportDirectory()  \\n  - `C:\\\\Users\\\\User\\\\AppData\\\\Roaming\\\\ [\ud328\ud0a4\uc9c0\uc774\ub984]\\\\ [\ud504\ub85c\uc81d\ud2b8\uc774\ub984]`\\n\\n3. getDownloadsDirectory()  \\n  - \uc0ac\uc6a9\uc790\uc758 \\"Downloads\\" \ud3f4\ub354\ub97c \ubc18\ud658\ud569\ub2c8\ub2e4, \ubcf4\ud1b5 `C:\\\\Users\\\\<User Name>\\\\Downloads`\uc5d0 \uc704\uce58\ud569\ub2c8\ub2e4.\\n\\n4. getExternalCacheDirectories()  \\n  - Windows\uc5d0\uc11c \uc678\ubd80 \uce90\uc2dc \ub514\ub809\ud1a0\ub9ac\ub294 \uc77c\ubc18\uc801\uc73c\ub85c \ud574\ub2f9\ub418\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4. \uc774 \ud568\uc218\ub294 Windows\uc5d0\uc11c \uc9c0\uc6d0\ub418\uc9c0 \uc54a\uc744 \uac00\ub2a5\uc131\uc774 \ub192\uc2b5\ub2c8\ub2e4.\\n\\n5. getExternalStorageDirectories({StorageDirectory? type})  \\n  - Windows\uc5d0\uc11c \uc678\ubd80 \uc800\uc7a5\uc18c \ub514\ub809\ud1a0\ub9ac\ub294 \uc77c\ubc18\uc801\uc73c\ub85c \ud574\ub2f9\ub418\uc9c0 \uc54a\uc73c\uba70, \uc774 \ud568\uc218\ub294 Android \ud50c\ub7ab\ud3fc\uc5d0 \ud2b9\ud654\ub418\uc5b4 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n6. getExternalStorageDirectory()\\n  - \uc774 \ud568\uc218\ub3c4 \ub9c8\ucc2c\uac00\uc9c0\ub85c Windows\uc5d0\uc11c\ub294 \uc77c\ubc18\uc801\uc73c\ub85c \uc0ac\uc6a9\ub418\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4. Android\uc5d0\uc11c\ub294 \uc678\ubd80 \uc800\uc7a5\uc18c\uc758 \ub8e8\ud2b8 \ub514\ub809\ud1a0\ub9ac\ub97c \ubc18\ud658\ud569\ub2c8\ub2e4.\\n\\n7. getLibraryDirectory()  \\n  - macOS\uc5d0\uc11c\ub9cc \uc0ac\uc6a9\ub418\uba70, Windows\uc5d0\uc11c\ub294 \ud574\ub2f9 \ub514\ub809\ud1a0\ub9ac\uac00 \uc5c6\uc2b5\ub2c8\ub2e4.\\n\\n8. getTemporaryDirectory()  \\n  - \uc2dc\uc2a4\ud15c\uc758 \uc784\uc2dc \ud3f4\ub354\ub97c \ubc18\ud658\ud569\ub2c8\ub2e4. Windows\uc5d0\uc11c\ub294 \ubcf4\ud1b5 `C:\\\\Users\\\\<User Name>\\\\AppData\\\\Local\\\\Temp`\uc5d0 \uc704\uce58\ud569\ub2c8\ub2e4.\\n\\n\\n## AsyncValeu - properties\\n---\\n\\n### value\\n\\n<table>\\n  <tr class=\\"custom_th\\">\\n    <th>Async\uc885\ub958</th>\\n    <th>previous value [X]</th>\\n    <th>previous value [O]</th>\\n  </tr>\\n  <tr>\\n    <td class=\\"custom_td\\">AsyncLoading</td>\\n    <td>null</td>\\n    <td>previous value</td>\\n  </tr>\\n  <tr>\\n    <td class=\\"custom_td\\">AsyncData</td>\\n    <td>current value</td>\\n    <td>current value</td>\\n  </tr>\\n  <tr>\\n    <td class=\\"custom_td\\">AsyncError</td>\\n    <td>rethrow error</td>\\n    <td>previous value</td>\\n  </tr>\\n</table>\\n\\n### error, stackTrace\\n\\n<table>\\n  <tr class=\\"custom_th\\">\\n    <th>Async\uc885\ub958</th>\\n    <th>previous error [X]</th>\\n    <th>previous error [O]</th>\\n  </tr>\\n  <tr>\\n    <td class=\\"custom_td\\">AsyncLoading</td>\\n    <td>null</td>\\n    <td>previous error</td>\\n  </tr>\\n  <tr>\\n    <td class=\\"custom_td\\">AsyncData</td>\\n    <td>null</td>\\n    <td>null</td>\\n  </tr>\\n  <tr>\\n    <td class=\\"custom_td\\">AsyncError</td>\\n    <td>current error</td>\\n    <td>current error</td>\\n  </tr>\\n</table>\\n\\n\\n### isLoading/hasValue/hasError\\n\\n<table class=\\"custom_table\\">\\n  <tr class=\\"custom_th\\">\\n    <th>Async\uc885\ub958</th>\\n    <th>previous value [X]<br/>previous error [X]</th>\\n    <th>previous value [X]<br/>previous error [O]</th>\\n    <th>previous value [O]<br/>previous error [X]</th>\\n    <th>previous value [O]<br/>previous error [O]</th>\\n  </tr>\\n  <tr>\\n    <td class=\\"custom_td\\">AsyncLoading</td>\\n    <td>isLoading [O] <br/>hasValue [X] <br/>hasError [X]</td>\\n    <td>isLoading [O] <br/>hasValue [O] <br/>hasError [X]</td>\\n    <td>isLoading [O] <br/>hasValue [X] <br/>hasError [O]</td>\\n    <td>isLoading [O] <br/>hasValue [O] <br/>hasError [O]</td>\\n  </tr>\\n  <tr>\\n    <td class=\\"custom_td\\">AsyncData</td>\\n    <td>isLoading [X] <br/>hasValue [O] <br/>hasError [X]</td>\\n    <td>isLoading [X] <br/>hasValue [O] <br/>hasError [X]</td>\\n    <td>isLoading [X] <br/>hasValue [O] <br/>hasError [X]</td>\\n    <td>isLoading [X] <br/>hasValue [O] <br/>hasError [X]</td>\\n  </tr>\\n  <tr>\\n    <td class=\\"custom_td\\">AsyncError</td>\\n    <td>isLoading [X] <br/>hasValue [X] <br/>hasError [O]</td>\\n    <td>isLoading [X] <br/>hasValue [O] <br/>hasError [O]</td>\\n    <td>isLoading [X] <br/>hasValue [X] <br/>hasError [O]</td>\\n    <td>isLoading [X] <br/>hasValue [O] <br/>hasError [O]</td>\\n  </tr>\\n</table>"},{"id":"flutter-til-19","metadata":{"permalink":"/blog/flutter-til-19","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024-01-18-til19/index.md","source":"@site/blog/2024-01-18-til19/index.md","title":"Flutter TIL - 19","description":"---","date":"2024-01-18T00:00:00.000Z","formattedDate":"January 18, 2024","tags":[{"label":"TIL","permalink":"/blog/tags/til"},{"label":"\ud50c\ub7ec\ud130","permalink":"/blog/tags/\ud50c\ub7ec\ud130"},{"label":"flutter","permalink":"/blog/tags/flutter"},{"label":"revierpod","permalink":"/blog/tags/revierpod"},{"label":"notifierProvider","permalink":"/blog/tags/notifier-provider"},{"label":"asyncNotifierProvider","permalink":"/blog/tags/async-notifier-provider"},{"label":"tear-offs","permalink":"/blog/tags/tear-offs"},{"label":"enum based class","permalink":"/blog/tags/enum-based-class"},{"label":"sealed based class","permalink":"/blog/tags/sealed-based-class"}],"readingTime":5.84,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"flutter-til-19","title":"Flutter TIL - 19","authors":["kihyun"],"tags":["TIL","\ud50c\ub7ec\ud130","flutter","revierpod","notifierProvider","asyncNotifierProvider","tear-offs","enum based class","sealed based class"]},"prevItem":{"title":"Flutter TIL - 20","permalink":"/blog/flutter-til-20"},"nextItem":{"title":"Flutter TIL - 18","permalink":"/blog/flutter-til-18"}},"content":"---\\n\\n## AutoDispose\\n---\\n\\nautodispose\ub97c \uc0ac\uc6a9\ud558\ub824\uba74\\n\\n```dart\\nfinal counterProvider = NotifierProvider.autoDispose<Counter, int>(Counter.new);\\n```  \\n\\n\ub85c \uc120\uc5b8\ud574\uc57c \ud558\uace0\\n\\n```dart\\nclass Counter extends AutoDisposeNotifier<int>{}\\n```\\n\\n\uc704\ucc98\ub7fc Notifier\ub97c \uc0ac\uc6a9\ud574\uc57c \ud55c\ub2e4.\\n\\n\\n## Family\\n---\\n\\n```dart\\nfinal counterProvider = NotifierProvider.family<Counter, int, int>(Counter.new);\\n```\\n\\nfamily\ub97c \uc0ac\uc6a9\ud558\ub824\uba74 family\uc640 \ub118\uaca8\uc904 \uc778\uc790\uac12\uc744 \ucd94\uac00\ud574\uc57c\ud558\uace0\\n\\n```dart\\nclass Counter extends FamilyNotifier<int, int> {\\n  @override\\n  int build(int arg) {return arg;}\\n}\\n```\\n\\nNotifier\ub3c4 FamilyNotifier\uc640 \uc778\uc790 \ucd94\uac00\uc640 build\ud568\uc218\uc5d0 \uc778\uc790\ub97c \ucd94\uac00\ud574\uc57c \ud55c\ub2e4.\\n\\n\\n## AutoDispose Family\\n---\\n\\n\uc704\uc758 \ub458\uc744 \ud569\uce58\uba74 \ub41c\ub2e4.\\n\\n## riverpod generator \uc774\uc6a9\\n---\\n\\ngenerator\ub97c \uc774\uc6a9\ud574\uc11c notifier\ub97c \ub9cc\ub4e4\uba74 \ub354 \uc27d\ub2e4.\\n\\n1. riverpodpart \ub9cc\ub4e4\uae30\\n\\n2. riverpodclass\ub85c \ub9cc\ub4e4\uae30 (riverpodclass\uac00 notifier\ub2e4.)\\n\\n3. \uc774\ub984 \ub123\uace0 build \ud568\uc218 \ud0c0\uc785 \uc9c0\uc815\ud558\uae30\\n\\n4. \ub098\uba38\uc9c0 \uad6c\ud604\\n\\nAutoDispose\ub294 \uc5b4\ub178\ud14c\uc774\uc158\uc5d0 \ub530\ub77c \uacb0\uc815\ub418\uace0 family \uc5ec\ubd80\ub294 build\ud568\uc218 \uc778\uc790\uac12 \uc874\uc7ac \uc720\ubb34\ub85c \uacb0\uc815\ub41c\ub2e4\uace0 \ud569\ub2c8\ub2e4.\\n\\n\ucd94\uac00 \ud2b9\uc774\uc0ac\ud56d\uc774 \uc788\uc73c\uba74 \uadf8 \ub54c \uc815\ub9ac\ud574\uc57c\uc9c0.\\n\\n\\n## state shape\\n---\\n\\n2\uac00\uc9c0 \uc788\ub2e4\uace0 \ud55c\ub2e4.\\n\\n`enum`, `sealed` .. \uadf8\ub807\ub2e4\\n\\n\ucd94\uac00\ub85c `AsyncValue`\ub3c4 \uc788\ub2e4.\\n\\n\\n[\uc774\uacf3\uc758 API](https://www.boredapi.com/)\ub97c \ud65c\uc6a9\ud55c\ub2e4.\\n\\n\\n## data model\uc744 freezed\ub85c \ub9cc\ub4dc\ub294 \uc808\ucc28\\n---\\n\\n1. `ptf`\\n\\n2. `pts`\\n\\n3. `fdataclass`\\n\\n4. factory \uc0dd\uc131\uc790\uc5d0 \uc778\uc790\uac12 \ub123\uae30 required\ub85c \uc544\ub2c8\uc5ec\ub3c4\ub418\uad6c\\n\\n5. `fromJson`\ud0a4\uc6cc\ub4dc\ub85c fromJson \ub9cc\ub4e4\uae30 (\uc774\ub984\uc740 class\uc774\ub984\ubd99\uc774\uace0)\\n\\n6. \uba54\uc11c\ub4dc\ub4e4 \ub9cc\ub4e4\uae30(empty,add,remove \ub4f1)\\n\\n## stat\ub97c freezed\ub85c \ub9cc\ub4dc\ub294 \uc808\ucc28\\n---\\n\\n1. `ptf`\\n\\n2. `fdataclass`\\n\\n3. \ud544\uc694\ud55c factory \uba54\uc11c\ub4dc \ub9cc\ub4e4\uae30\\n\\n\\n## dio provier \ub9cc\ub4e4\uae30 \uc808\ucc28\\n---\\n\\n1. `riverpodpart`\\n\\n2. `riverpod`\uc73c\ub85c provider\ub9cc\ub4e4\uae30\\n\\n3. \uc544\ub798 \ubb38\ubc95 \ucc98\ub7fc\\n\\n```dart\\n@riverpod\\nDio dio(DioRef ref) {\\n  return Dio(BaseOptions(baseUrl: \'[Target URL]\'));\\n}\\n```\\n\\n## Enum based\uc5d0\uc11c \uac12 \uc694\uccad provider \ub9cc\ub4dc\ub294 \uc808\ucc28\\n---\\n\\n1. `riverpodpart`\uc640  `riverpodclass`\ub85c \ucd08\uae30 \uc124\uc815 \ud6c4 \uc774\ub984 \uc124\uc815\\n\\n2. build \ud568\uc218 \ud0c0\uc785 \uc815\ud574\uc8fc\uace0 return \uac12 \uc815\ud574\uc8fc\uae30\\n\\n3. \uc5ec\ub7ec \uc0c1\ud0dc \ucee8\ud2b8\ub864\ud558\ub294 \ud568\uc218 \ub9cc\ub4e4\uae30(loading, error, success \ub4f1\ub4f1)\\n\\n4. \ud750\ub984\uc744 \uc801\uc790\uba74 \uba3c\uc800 state\uc758 `status\ub97c loading`\uc73c\ub85c \ubc14\uafd4\uc8fc\uace0 `Get\uc694\uccad`\uc744 \ub0a0\ub9b0\ub2e4\uc74c\uc5d0 \uc131\uacf5\uc801\uc73c\ub85c \uac12\uc744 \uac00\uc838\uc624\uba74 `fromJson`\ud574\uac00\uc9c0\uad6c `copyWith`\ud574\uc11c `status success\uc640 \uac12\uc744 \uac00\uc838\uc628 \uac12\uc73c\ub85c \ubcc0\uacbd`\uc744 \ud55c\ub2e4. \uc5d0\ub7ec\uac00 \ub09c\ub2e4\uba74 `copyWith\ud574\uc11c status failure\uc640 error\uc5d0 e.toString` \ub123\uc5b4\uc90c\\n\\n### \ud2b9\uc774\uc810 \uc815\ub9ac\\n\\n- copyWith\ub85c \uac12 \ubcc0\uacbd  \\n- single state class\uc784\\n\\n## inistate modifier \uc8fc\uc758\ud560 \uc810\\n\\n\ud398\uc774\uc9c0\uc5d0 \uc9c4\uc785\ud588\uc744 \ub54c \ubc14\ub85c api\ub97c \uc3d8\ub294 \ub3d9\uc791\uc744 \ud558\uace0 \uc2f6\uc5b4\uc11c initState\uc5d0 api \ud1b5\uc2e0\ud558\ub294 \ucf54\ub4dc\ub97c \ub123\uc5c8\ub2e4. \uc774 \ub54c UI\ub97c \uc218\uc815\ud558\ub294 \ub3d9\uc791\ub3c4 \ud3ec\ud568\ub3fc\uc788\uc5b4\uc11c\\n\\n`FlutterError (Tried to modify a provider while the widget tree was building....` \uc5d0\ub7ec\uac00 \ub0ac\ub2e4. \\n\\n```dart\\n  @override\\n  void initState() {\\n    super.initState();\\n    ref.read(enumActivityProvider.notifier).fetchActivity(activityTypes[0]);\\n  }\\n\\n// \uc774\uac70\ub97c \uc544\ub798\ub85c \uc218\uc815\\n\\n  @override\\n  void initState() {\\n    super.initState();\\n    Future.delayed(Duration.zero, () {\\n      ref.read(enumActivityProvider.notifier).fetchActivity(activityTypes[0]);\\n    });\\n  }\\n```\\n\\n`Future.delayed`\ub85c \uac10\uc2f8\uba74 \uc5d0\ub7ec\uac00 \ud574\uacb0\ub41c\ub2e4. \uc774\uac78 \uc0ac\uc6a9\ud558\uba74 \ube44\ub3d9\uae30\uc801\uc73c\ub85c \uc2e4\ud589\ud558\ub294\ub4ef \uadf8\ub798\uc11c UI \uadf8\ub824\uc9c0\uae30 \uae4c\uc9c0 \uae30\ub2e4\ub824\uc8fc\ub294 \uac83 \uac19\uc74c.\\n\\n\\n## Sealed class based\\n---\\n\\n\ud2b9\uc9d5\uc740 multi class \uc774\ub2e4.\\n\\n\\n## \uc808\ucc28\\n\\n1. sealed class\ub97c \ub9cc\ub4e0\ub2e4.\\n\\n```dart\\nsealed class StateClass {\\n  const StateClass();\\n}\\n```\\n\\n2. StateClass\ub97c extend\ud558\uc5ec init, loading, success, fail\uc744 \uad6c\ud604\ud55c\ub2e4.\\n\\n```dart\\nfinal class StateClassInit extends StateClass {\\n  const StateClassInit();\\n\\n  @override\\n  String toString() => \'StateClass()\';\\n}\\n```\\n\\n3. provider\uc5d0\uc11c state \ud560\ub2f9\ud560 \ub54c copyWith\uc744 \uc0ac\uc6a9\ud558\ub294\uac8c \uc544\ub2c8\ub77c \uad6c\ud604\ud55c class\ub97c \uc0ac\uc6a9\ud55c\ub2e4. \ub098\uba38\uc9c0\ub294 \ube44\uc2b7\\n\\n\\n## async\ucc98\ub7fc \ubcf4\uc774\uac8c\ud558\ub294 notifier\\n---\\n\\n### enum\\n\\nsetInit \ub300\uc2e0\uc5d0 provider\uc5d0\uc11c build\ud568\uc218 \uc548\uc5d0 fetch\ud574\uc8fc\uba74 \ub41c\ub2e4.\\n\\n```dart\\n  @override\\n  StateClass build() {\\n    fetchActivity(types[0]);\\n    return StateClass.init();\\n  }\\n\\n```\\n\\n### \uc8fc\uc758\ud560 \uc810\\n\\n\uc774 \ub54c\ub3c4 \uc704\ucc98\ub7fc\ub9cc \ud574\ubc84\ub9ac\uba74 \uc5d0\ub7ec\uac00\ub09c\ub2e4.\\n\\nfuture.delayed\ub85c \uac10\uc2f8\ub294 \uac83\uc774 \uc544\ub2cc state\uc5d0 init()\uc744 \uba3c\uc800 \ud560\ub2f9\ud574\uc900\ub2e4.\\n\\n```dart\\n  @override\\n  StateClass build() {\\n    state = StateClass.init();\\n    fetchActivity(types[0]);\\n    return StateClass.init();\\n  }\\n```\\n\\n\\n## AsyncNotifier\\n---\\n\\n\ubc29\uc2dd\uc740 Notifier\uc640 \ube44\uc2b7\ud558\uc9c0\ub9cc \uc548\uc5d0 \uc0dd\uc131\ud558\ub294 \uba54\uc11c\ub4dc\ub4e4\uc740  \ubaa8\ub450 `Future<void>`\ud0c0\uc785\uc774\ub2e4.\\n\\n`AsyncValue`\uac00 \uc88b\uc740\uac8c `AsyncLoading`\uc5d0\uc11c \uc774\uc804\uac12\uc744 \uac00\uc9c0\uace0 \uc788\uace0 `AsyncData`\uc5d0\uc11c \ubc14\ub010 next\uac12\uc744 \uac00\uc9c0\uace0 \uc788\ub2e4.\\n\\n`AsyncError`\uc5d0\uc11c\ub3c4 value\uc5d0\ub294 \uc774\uc804\uac12 \ubcf4\uc720\ud55c\ub2e4.\\n\\n### guard\\n\\nAsync\ud560 \ub54c try catch\ubb38\uc5d0\uc11c \ubcf4\ud1b5 try\uc5d0 AsyncData, catch\uc5d0\uc120 AsyncError\uc744 \uc815\uc758\ud569\ub2c8\ub2e4. \uc774\ub97c \uac04\uc18c\ud654\uc2dc\ucf1c\uc8fc\ub294 \ubc29\ubc95\uc785\ub2c8\ub2e4.\\n\\n\\n```dart\\nstate = await AsyncValue.guard(() async {\\n  await wait();\\n  return state.value! + 1;\\n});\\n```\\n\\n\uc774\ub807\uac8c \ud558\uba74 \uc54c\uc544\uc11c AsyncData\uc640 AsyncError\uc5d0 \uac12\uc744 \ub123\uc5b4\uc900\ub2e4.\\n\\n### riverpod annotation \uc808\ucc28\\n\\n1. riverpodpart\\n\\n2. riverpodAsyncClass / \uc791\uba85 / build\ud568\uc218 \ud0c0\uc785 \uc9c0\uc815\\n\\n3. build\uc5d0 async \ucd94\uac00 \ubc0f family \ud560\uac70\uba74 build\uc5d0 \uc778\uc790 \ucd94\uac00 \\n\\n4. \ucd94\uac00 \uac12\ub4e4 \ucd94\uac00\\n\\n\\n```dart\\nFutureOr<int> build({required int init}) async {\\n    \\n    return init;\\n  }\\n```\\n\\nriverpod annotation \uc0ac\uc6a9\ud558\uba74 named parameter \uc0ac\uc6a9\ud560 \uc218 \uc788\ub2e4.\\n\\n\\n### skip error\\n\\n`AsyncValue`\uc758 `when` \uba54\uc11c\ub4dc \uc0ac\uc6a9 \uc2dc `skipError` \uc18d\uc131\uc774 \uc788\ub2e4.\\n\\n\uc774 \uc18d\uc131\uc740 default\uac00 false\uace0 true\ub85c \ubc14\uafb8\uba74 \uc5d0\ub7ec \ubc1c\uc0dd \uc2dc error: \ub85c\uc9c1\uc5d0 \ucc98\ub9ac\ub41c\uac8c \uc2e4\ud589\ub418\ub294\uac8c \uc544\ub2cc data\uac00 \uc788\ub2e4\uba74 \uc774\uc804 \ub370\uc774\ud130\ub97c \ubcf4\uc5ec\uc8fc\ub294 \uac83\uc774\ub2e4."},{"id":"flutter-til-18","metadata":{"permalink":"/blog/flutter-til-18","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024-01-17-til18/index.md","source":"@site/blog/2024-01-17-til18/index.md","title":"Flutter TIL - 18","description":"---","date":"2024-01-17T00:00:00.000Z","formattedDate":"January 17, 2024","tags":[{"label":"TIL","permalink":"/blog/tags/til"},{"label":"\ud50c\ub7ec\ud130","permalink":"/blog/tags/\ud50c\ub7ec\ud130"},{"label":"flutter","permalink":"/blog/tags/flutter"},{"label":"revierpod","permalink":"/blog/tags/revierpod"},{"label":"notifierProvider","permalink":"/blog/tags/notifier-provider"}],"readingTime":1.645,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"flutter-til-18","title":"Flutter TIL - 18","authors":["kihyun"],"tags":["TIL","\ud50c\ub7ec\ud130","flutter","revierpod","notifierProvider"]},"prevItem":{"title":"Flutter TIL - 19","permalink":"/blog/flutter-til-19"},"nextItem":{"title":"Flutter TIL - 17","permalink":"/blog/flutter-til-17"}},"content":"---\\n\\n## ListView\\n---\\n\\n`ListView` \uc704\uc82f\uc744 `Column/Row`\uc704\uc82f \uc544\ub798\uc5d0 \ub454\ub2e4\uba74 `ListView`\uc640 `Column/Row`\uc758 \uc0ac\uc774\uc988\ub4e4\uc774 unbounded height\uac00 \uc77c\uc5b4\ub098\uc11c render overflow\uac00 \ub0a9\ub2c8\ub2e4.\\n\\n`Column/Row` \uc544\ub798\uc5d0 `ListView`\ub97c \ub450\uace0 \uc2f6\ub2e4\uba74 `Expanded` \uc704\uc82f\uc73c\ub85c `ListView`\ub97c \uac10\uc2f8\uc57c \ud568.\\n\\n## Notifier Provider\\n---\\n\\n### \uc0dd\uc131\\n\\nnotifier\ub97c \uc785\ub825\ud574\uc11c \uba3c\uc800 notifier\ub97c \uc815\uc758\ud55c\ub2e4.\\n\\n```dart\\nclass CounterNotifier extends Notifier<int> {\\n  @override\\n  int build() {\\n    return 0;\\n  }\\n}\\n```\\n\\n`CounterNotifier`\ub294 Notifier\uc758 \uc774\ub984\uc774\uace0 `Notifier<int>`\ub85c \ub3fc\uc788\ub294\ub370 int\ub294 \ubc18\ud658 \ud0c0\uc785\uc774\ub2e4. build\ud568\uc218 \uc55e\uc5d0\ub294 \ubc18\ud658 \ud0c0\uc785\uc744 \ubd99\uc5ec\uc918\uc57c \ud55c\ub2e4.\\n\\n`StateNotifier`\ub098 `ChangeNotifier`\ub97c \uc0ac\uc6a9\ud558\uba74 `ref`\ub97c \uc0ac\uc6a9\ud560 \uc218 \uc5c6\uc9c0\ub9cc(\uc0ac\uc6a9\ud558\ub824\uba74 \uc0dd\uc131\uc790\uc5d0\uc11c \uc815\uc758\ud574\uc918\uc57c \ud55c\ub2e4.) `Notifier`\ub97c \uc0ac\uc6a9\ud558\uba74 `ref`\ub97c \ubc14\ub85c \uc0ac\uc6a9\ud560 \uc218 \uc788\ub2e4.\\n\\n\\n### tear-offs \uc9c0\uc6d0\\n\\n```dart\\nonPressed:(){\\n  func();\\n}\\n\\n# \uc704\uc640 \uc544\ub798\ub294 \uac19\ub2e4.\\n\\nonPressed: func,\\n```\\n\\n\uc704 \ucf54\ub4dc\uc640 \uac19\uc740 \ub3d9\uc791\uc744 \ud558\ub294 \uac83\uc774 tear-offs\ub2e4.\\n\\n\uac70\ucd94\uc7a5\uc2a4\ub7ec\uc6b4 \ubd80\ubd84\uc774 \uc81c\uac70\uac00 \ub41c\ub2e4. \ud568\uc218\uc640 \uc0dd\uc131\uc790\uc5d0\uc11c \uc0ac\uc6a9\ud560 \uc218 \uc788\ub2e4.\\n\\n\uadf8\ub798\uc11c \uc544\ub798\uc640 \uac19\uc774 `notifierProvider`\ub97c \uc120\uc5b8\ud560 \uc218 \uc788\ub2e4.\\n```dart\\nfinal counterProvider = NotifierProvider<Counter, int>(() {\\n  return Counter();\\n});\\n\\n#\uc704\ub97c \uc544\ub798\ucc98\ub7fc\\n\\nfinal counterProvider = NotifierProvider<Counter, int>(Counter.new);\\n```\\n\\n\ubaa8\ub974\uba74 \uc77c\ub2e8 \uc678\uc6b0\uc790 tear-offs\\n\\n\\n### \uc811\uadfc\\n\\nwatch\ud558\uba74 state\uac12\uc744 \uac00\uc838\uc62c \uc218 \uc788\uace0 \uc778\uc2a4\ud134\uc2a4\uc5d0 \uc811\uadfc\ud558\ub824\uba74\\n\\n```dart\\nref.raed(counterProvider.notifier).increment();\\n```\\n\\n\uc774\ub807\uac8c \ud560 \uc218 \uc788\ub2e4."},{"id":"flutter-til-17","metadata":{"permalink":"/blog/flutter-til-17","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024-01-16-til17/index.md","source":"@site/blog/2024-01-16-til17/index.md","title":"Flutter TIL - 17","description":"---","date":"2024-01-16T00:00:00.000Z","formattedDate":"January 16, 2024","tags":[{"label":"TIL","permalink":"/blog/tags/til"},{"label":"\ud50c\ub7ec\ud130","permalink":"/blog/tags/\ud50c\ub7ec\ud130"},{"label":"flutter","permalink":"/blog/tags/flutter"},{"label":"revierpod","permalink":"/blog/tags/revierpod"},{"label":"FutureProvider","permalink":"/blog/tags/future-provider"},{"label":"refresh","permalink":"/blog/tags/refresh"},{"label":"invalidate","permalink":"/blog/tags/invalidate"}],"readingTime":0.725,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"flutter-til-17","title":"Flutter TIL - 17","authors":["kihyun"],"tags":["TIL","\ud50c\ub7ec\ud130","flutter","revierpod","FutureProvider","refresh","invalidate"]},"prevItem":{"title":"Flutter TIL - 18","permalink":"/blog/flutter-til-18"},"nextItem":{"title":"Flutter TIL - 16","permalink":"/blog/flutter-til-16"}},"content":"---\\n\\n## invalidate\\n---\\n\\n```dart\\nonPressed: () async {\\n  ref.invalidate(userDetailProvider);\\n},\\n```\\n\\nrefresh\ud560 \ub54c `invalidate`\ub97c \uc0ac\uc6a9\ud55c\ub2e4\uba74 \uc704\ucc98\ub7fc onPressed \ud568\uc218\ub97c \uad6c\ud604\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \ubb3c\ub860 skipLoadingOnRefresh\ub3c4 \uc801\uc6a9\ud588\uc2b5\ub2c8\ub2e4.\\n\\n`invalidate`\uc758 \uc778\uc790\uac12 \ud0c0\uc785\uc740 `ProviderOrFamily`\uc774\ub2e4. \uadf8\ub798\uc11c Family\ub97c \uc8fc\uc9c0 \uc54a\uace0 \uc801\uc6a9\ud55c\ub2e4\uba74 \ubaa8\ub4e0 provider\uac00 auto dispose\ub41c\ub2e4.\\n\\n## refresh\\n---\\n\\n```dart\\nonPressed: () async {\\n  return ref.refresh(userDetailProvider(userId));\\n},\\n```\\n\\n\ub610\ub294\\n\\n```dart\\nonPressed: () {\\n  return ref.refresh(userDetailProvider(userId).future);\\n},\\n```\\n\\nrefresh \uc778\uc790 \ud0c0\uc785\uc740 Family Provider\ub77c\uba74 family\uac12\uc744 \ub118\uaca8\uc8fc\uc5b4\uc57c \ud55c\ub2e4. \uadf8\ub9ac\uace0 return\uc744 \uc0ac\uc6a9\ud574\uc57c \ud558\uae30\uc5d0 return\uac12\uc774 \uc5c6\ub2e4\uba74 invalidate\ub97c \ucd94\ucc9c\ud55c\ub2e4."},{"id":"flutter-til-16","metadata":{"permalink":"/blog/flutter-til-16","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024-01-15-til16/index.md","source":"@site/blog/2024-01-15-til16/index.md","title":"Flutter TIL - 16","description":"---","date":"2024-01-15T00:00:00.000Z","formattedDate":"January 15, 2024","tags":[{"label":"TIL","permalink":"/blog/tags/til"},{"label":"\ud50c\ub7ec\ud130","permalink":"/blog/tags/\ud50c\ub7ec\ud130"},{"label":"flutter","permalink":"/blog/tags/flutter"},{"label":"revierpod","permalink":"/blog/tags/revierpod"},{"label":"FutureProvider","permalink":"/blog/tags/future-provider"}],"readingTime":0.81,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"flutter-til-16","title":"Flutter TIL - 16","authors":["kihyun"],"tags":["TIL","\ud50c\ub7ec\ud130","flutter","revierpod","FutureProvider"]},"prevItem":{"title":"Flutter TIL - 17","permalink":"/blog/flutter-til-17"},"nextItem":{"title":"Flutter TIL - 15","permalink":"/blog/flutter-til-15"}},"content":"---\\n\\n## skipLoadingOnRefresh\\n---\\n\\nwhen \uba54\uc11c\ub4dc\uc5d0\uc11c `skipLoadingOnRefresh`\ub77c\ub294 \uba54\uc11c\ub4dc\uac00 \uc788\ub294\ub370 true\uac00 \ub514\ud3f4\ud2b8\ub2e4. \uc0c8\ub85c\uace0\uce68\ud574\ub3c4 loading \ucc3d \uc548\ubcf4\uc5ec\uc8fc\ub294\uac74\ub370 false\ub85c \ud574\uc8fc\ub294 \ud3b8\uc774 \uc88b\ub2e4.\\n\\n## \uc0c8\ub85c\uace0\uce68\\n---\\n\\n`ref.refresh()` \ub610\ub294 `ref.invalidate()`\ub97c \uc0ac\uc6a9\ud55c\ub2e4. \uc608\uc2dc\ub85c\ub294 `RefreshIndicator`\ub85c \ud588\uc9c0\ub9cc \ubc84\ud2bc\uc73c\ub85c \ud558\ub294\uac8c \uc88b\uc740 UI\ub77c\uace0 \ud558\ub294 \ub4ef\\n\\n\uadf8\ub9ac\uace0 \uc708\ub3c4\uc6b0\uc5d0\uc11c\ub294 `RefreshIndicator` \ub3d9\uc791\uc548\ud55c\ub2e4..\\n\\n## freezed class override\\n---\\n\\n```dart\\n@freezed\\nclass User with _$User {\\n  const User._();\\n  \\n  ...\\n  @override\\n  String toString() => \'User(id:$id)\';\\n}\\n```\\n\\nfreezed data class \uc5d0\uc11c User._()\ub97c \uc120\uc5b8\ud558\uace0 toString\uc744 \ub2e4\uc2dc \uc624\ubc84\ub77c\uc774\ub529 \ud560 \uc218 \uc788\ub358\ub370 \uc774\uc5d0 \ub300\ud574\uc11c \uc870\uae08 \ub354 \uc54c\uc544\ubd10\uc57c \ud560 \ub4ef"},{"id":"flutter-til-15","metadata":{"permalink":"/blog/flutter-til-15","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024-01-11-til15/index.md","source":"@site/blog/2024-01-11-til15/index.md","title":"Flutter TIL - 15","description":"---","date":"2024-01-11T00:00:00.000Z","formattedDate":"January 11, 2024","tags":[{"label":"TIL","permalink":"/blog/tags/til"},{"label":"\ud50c\ub7ec\ud130","permalink":"/blog/tags/\ud50c\ub7ec\ud130"},{"label":"flutter","permalink":"/blog/tags/flutter"},{"label":"revierpod","permalink":"/blog/tags/revierpod"},{"label":"FutureProvider","permalink":"/blog/tags/future-provider"}],"readingTime":2.175,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"flutter-til-15","title":"Flutter TIL - 15","authors":["kihyun"],"tags":["TIL","\ud50c\ub7ec\ud130","flutter","revierpod","FutureProvider"]},"prevItem":{"title":"Flutter TIL - 16","permalink":"/blog/flutter-til-16"},"nextItem":{"title":"Flutter TIL - 14","permalink":"/blog/flutter-til-14"}},"content":"---\\n\\n## \uac00\uc0c1 API\\n---\\n\\n[\uc5ec\uae30](https://jsonplaceholder.typicode.com) \uc5d0\uc11c \ub2e4\uc591\ud55c API\ub97c \uc81c\uacf5\ud574\uc900\ub2e4.\\n\\nusers API\ub85c FutureProvider \uc2e4\uc2b5\uc744 \ud55c\ub2e4.\\n\\n\\n## autoDispose \uc0ac\uc6a9 \uc5ec\ubd80\\n---\\n\\n\ub9cc\uc57d \ud2b9\uc815 \ud398\uc774\uc9c0 \uc9c4\uc785 \uc2dc API\ub97c \ud1b5\ud574\uc11c \uac12\uc744 \uac00\uc838\uc654\uc744 \ub54c \uc774 \uac12\uc744 \uce90\uc2f1 \ud560 \uac83\uc774\uba74 `autoDispose` \uc0ac\uc6a9\ud558\uba74 \uc548\ub418\uace0 \ub2e4\uc2dc \uc548 \uac00\uc838\uc62c \uac83\uc774\uba74 `autoDispose` \uc0ac\uc6a9\ud558\ub294 \uac83\uc774 \uc88b\ub2e4.\\n\\n\uc124\uc815\uac12 \uac19\uc740 \uacbd\uc6b0\ub294 API\ub97c \uc3f4\uc11c \ubcc0\uacbd\ud558\ub294 \uacbd\uc6b0\uac00 \uac70\uc758 \uc5c6\uc73c\ubbc0\ub85c \uce90\uc2f1 \ud558\ub294 \uac83\uc774 \uc88b\ub2e4.\\n\\n\\n## future provider body\\n---\\n\\n### when\\n\\n\uac12\uc744 \ubd88\ub7ec\uc62c \ub54c when\uc744 \uc0ac\uc6a9\ud55c \ubaa8\uc2b5\uc785\ub2c8\ub2e4.\\n\\n```dart\\nbody: userList.when(\\n  data: (users) {\\n    return ListView.separated(\\n      itemCount: users.length,\\n      separatorBuilder: (context, index) {\\n        return const Divider();\\n      },\\n      itemBuilder: (context, index) {\\n        final user = users[index];\\n        return ListTile(\\n          leading: CircleAvatar(\\n            child: Text(user.id.toString()),\\n          ),\\n          title: Text(user.name),\\n        );\\n      },\\n    );\\n  },\\n  error: (e, st) {\\n    return Text(\\n      e.toString(),\\n      style: const TextStyle(fontSize: 20, color: Colors.red),\\n    );\\n  },\\n  loading: () => const Center(\\n    child: CircularProgressIndicator(),\\n  ),\\n),\\n```\\n\\n\\n\\n### switch expression\\n\\n\uac12\uc744 \ubd88\ub7ec\uc62c \ub54c switch\ub97c \uc0ac\uc6a9\ud55c \ubaa8\uc2b5\uc785\ub2c8\ub2e4.\\n\\n```dart\\nbody: switch (userList) {\\n  AsyncData(value: final users) => ListView.separated(\\n      itemCount: users.length,\\n      separatorBuilder: (context, index) {\\n        return const Divider();\\n      },\\n      itemBuilder: (context, index) {\\n        final user = users[index];\\n        return ListTile(\\n          leading: CircleAvatar(\\n            child: Text(user.id.toString()),\\n          ),\\n          title: Text(user.name),\\n        );\\n      },\\n    ),\\n  AsyncError(error: final e) => Text(\\n      e.toString(),\\n      style: const TextStyle(fontSize: 20, color: Colors.red),\\n    ),\\n  _ => const Center(\\n      child: CircularProgressIndicator(),\\n    ),\\n},\\n```\\n\\n\ub9c8\uc9c0\ub9c9\uc5d0 \uc6d0\ub798 `_` \ub300\uc2e0 `AsyncLoading`\uc774 \ub4e4\uc5b4\uac00\uc57c \ud558\uc9c0\ub9cc \ubb34\uc2a8 \uc5d0\ub7ec\uac00 \ub09c\ub2e4.\\n\\nuserListProvider\ub97c `@Sealed`\ub85c \ub9cc\ub4e4\uc5c8\uc5b4\uc57c \ud55c\ub2e4\uace0 \ud55c\ub2e4.\\n\\n## keepalive\\n---\\n\\n\ud558\uba74\uc11c \uad81\uae08\uc99d\uc774 \uc0dd\uacbc\uc5c8\ub294\ub370 \uac12\uc744 \uac00\uc838\uc654\uc73c\uba74 \ub2e4\uc2dc \ub098\uac14\ub2e4 \uc654\uc744 \ub54c loading \uc548 \ubcf4\uace0 \uc2f6\uc5c8\uc2b5\ub2c8\ub2e4.\\n\\n\uadf8\ub7ec\uba74 autoDispose\uc77c \ub54c ref.keepAlive()\ub97c \uc0ac\uc6a9\ud558\uba74 \ub429\ub2c8\ub2e4.  \\n\uc8fc\uc758\ud560 \uc810\uc740 http \ud638\ucd9c\uc774 \ub05d\ub098\uace0 \uc801\uc6a9\ud574\uc57c \ud569\ub2c8\ub2e4.\\n\\n\uac12\uc744 \uac00\uc838\uc628 \uac83\uc744 \uc131\uacf5\ud55c \ud398\uc774\uc9c0\ub294 \uac12\uc774 \uc720\uc9c0\uac00 \ub418\uace0(dispose\uc548\ud568)\\nerror\uac00 \ub098\uba74 dispose \ud569\ub2c8\ub2e4."},{"id":"flutter-til-14","metadata":{"permalink":"/blog/flutter-til-14","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024-01-10-til14/index.md","source":"@site/blog/2024-01-10-til14/index.md","title":"Flutter TIL - 14","description":"---","date":"2024-01-10T00:00:00.000Z","formattedDate":"January 10, 2024","tags":[{"label":"TIL","permalink":"/blog/tags/til"},{"label":"\ud50c\ub7ec\ud130","permalink":"/blog/tags/\ud50c\ub7ec\ud130"},{"label":"flutter","permalink":"/blog/tags/flutter"},{"label":"revierpod","permalink":"/blog/tags/revierpod"},{"label":"stateprovider","permalink":"/blog/tags/stateprovider"},{"label":"remote api","permalink":"/blog/tags/remote-api"},{"label":"FutureProvider","permalink":"/blog/tags/future-provider"}],"readingTime":1.67,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"flutter-til-14","title":"Flutter TIL - 14","authors":["kihyun"],"tags":["TIL","\ud50c\ub7ec\ud130","flutter","revierpod","stateprovider","remote api","FutureProvider"]},"prevItem":{"title":"Flutter TIL - 15","permalink":"/blog/flutter-til-15"},"nextItem":{"title":"Flutter TIL - 12","permalink":"/blog/flutter-til-12"}},"content":"---\\n\\n## state provider\\n---\\n\\n\ud2b9\uc9d5\uc73c\ub85c\ub294 code generator\uac00 \uc548\ub418\uace0\\n\\nstate\ub97c \uac16\uace0 \uc788\ub2e4\ub294 \uc810\\n\\n```dart\\nfloatingActionButton: FloatingActionButton(\\n  onPressed: () {\\n    ref.read(counterProvider.notifier).state++;\\n  },\\n  child: const Icon(Icons.add),\\n),\\n```\\n\\n\uc704\uc640 \uac19\uc774 read\ub97c \ud558\ub294\ub370 notifier\ub97c \uc0ac\uc6a9\ud574\uc11c state\uc5d0 \uc811\uadfc\ud560 \uc218 \uc788\ub2e4.\\n\\n\uadf8\ub9ac\uace0 \ucd94\uac00\ub85c UI\ub97c \uadf8\ub9ac\ub824\uba74 `Future.delay` \ub610\ub294 Listen\uc744 \uc0ac\uc6a9\ud560 \uc218 \uc788\ub2e4.  \\n(\uadf8\ub0e5 \uadf8\ub9ac\ub824\uba74 \uc5d0\ub7ec\ub09c\ub2e4. \ucda9\ub3cc\ub098\uc11c)\\n\\n```dart\\nref.listen<int>(counterProvider, (previous, next) {\\n  if (next == 3) {\\n    showDialog(\\n      context: context,\\n      builder: (context) {\\n        return AlertDialog(\\n          content: Text(\'counter : $next\'),\\n        );\\n      },\\n    );\\n  }\\n});\\n```\\n\\n\uc694\ub7f0\uc2dd\uc73c\ub85c listen\ud560 \uc218 \uc788\ub2e4. \uc774\uc804 \uac12 \ub2e4\uc74c \uac12\uc774 \uc788\ub2e4.\\n\\n## update\\n---\\n\\n```dart\\nonPressed: () {\\n  ref\\n      .read(autoDisposecounterProvider.notifier)\\n      .update((state) => state + 10);\\n},\\n```\\n\\n\uc704 \ucf54\ub4dc\ub294\\n\\n```dart\\nref.read(autoDisposecounterProvider.notifier).state + \\n  ref.read(autoDisposecounterProvider.notifier).state + 10\\n```\\n\\n\uacfc \uac19\uc740 \ucf54\ub4dc\uc774\ub2e4. \ub108\ubb34 \uae38\uae30 \ub54c\ubb38\uc5d0 \uadf8\ub0e5 update \uc0ac\uc6a9\ud558\ub294 \uac83\uc774 \ud3b8\ub9ac\ud558\ub2e4.\\n\\nstate\ub97c \uc778\uc790\ub85c \uc0ac\uc6a9\ud560 \ub85c\uc9c1\uc774 \ud544\uc694\ud558\uba74 `update` \uc0ac\uc6a9\ud558\uae30\\n\\n## Future Provider\uc758 \uc774\uc57c\uae30\\n---\\n\\nremote api\ub97c \ud638\ucd9c\ud558\uba74 3\uac00\uc9c0 \uc0c1\ud0dc \ucc98\ub9ac\uac00 \ud544\uc694\ud558\ub2e4.\\n\\n`in progress`, `success`, `error`\uc774\ub2e4.\\n\\n3\uac00\uc9c0 \ubaa8\ub450 \ub3d9\uc2dc\uc5d0 2\uac00\uc9c0 \uc774\uc0c1 \uc0c1\ud0dc\uac00 \ub420 \uc218 \uc5c6\ub2e4.\\n\\n`FutureProvider`\ub294 \uc774 3\uac00\uc9c0 \uc0c1\ud0dc\uc5d0 \ub300\ud55c \uac12\uc744 \ucc98\ub9ac\ud574\uc900\ub2e4.\\n\\n`AsyncData`, `AsyncError`, `AsyncLoading`\uc774 \uc788\ub2e4.\\n\\n\uc0dd\uc131\uc790\ub3c4 3\uac00\uc9c0 \uc788\ub2e4.\\n\\n`AsyncValue`\uac00 \uc911\uc694\ud558\ub2e4\ub294 \ub73b\\n\\n## \uc18c\uc18c\ud55c \ud301\\n---\\n\\n1. provider \uc548\uc5d0 ref.read()\ub97c \uc0ac\uc6a9\ud558\uc9c0 \ub9d0 \uac83\\n\\n2. StateProvider \ub300\uc2e0 NotifierProvider \uc0ac\uc6a9\ud560 \uac83"},{"id":"flutter-til-12","metadata":{"permalink":"/blog/flutter-til-12","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024-01-09-til12/index.md","source":"@site/blog/2024-01-09-til12/index.md","title":"Flutter TIL - 12","description":"---","date":"2024-01-09T00:00:00.000Z","formattedDate":"January 9, 2024","tags":[{"label":"TIL","permalink":"/blog/tags/til"},{"label":"\ud50c\ub7ec\ud130","permalink":"/blog/tags/\ud50c\ub7ec\ud130"},{"label":"flutter","permalink":"/blog/tags/flutter"},{"label":"revierpod","permalink":"/blog/tags/revierpod"},{"label":"provider","permalink":"/blog/tags/provider"}],"readingTime":2.485,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"flutter-til-12","title":"Flutter TIL - 12","authors":["kihyun"],"tags":["TIL","\ud50c\ub7ec\ud130","flutter","revierpod","provider"]},"prevItem":{"title":"Flutter TIL - 14","permalink":"/blog/flutter-til-14"},"nextItem":{"title":"Flutter TIL - 13","permalink":"/blog/flutter-til-13"}},"content":"---\\n\\n```dart\\nfinal helloProvider = Provider<String>((ref) {\\n  ref.onDispose(() {\\n    print(\\"[helloProvider] : disposed\\");\\n  });\\n  return \\"Hello\\";\\n});\\n```\\n\\nriverpod\uc758 \uae30\ubcf8 \ubaa8\uc2b5\uc774 \uc774\ub807\ub2e4.\\n\\n\ubcc0\uc218\uc5d0 \ud560\ub2f9\ud558\uace0 `Provider` \ubd80\ubd84\uc740 \uc0ac\uc6a9\ud560 Provider \uc885\ub958,\\n\\n`<String>`\uc5d0\ub294 return\uac12 \ud0c0\uc785\uc744 \uc815\uc758\ud55c\ub2e4.\\n\\nref\ub97c \ud1b5\ud574\uc11c \uc5ec\ub7ec \uae30\ub2a5\uc744 \uc0ac\uc6a9\ud560 \uc218 \uc788\ub294\ub370 ref.onDispose\ud574\uc8fc\uba74 dispose\ub41c\ub2e4.\\n\\n### onDispose\\n\\n\ud574\ub2f9 provider\uac00 dispose\ub418\uba74 \uc2e4\ud589\ub418\ub294 \ud568\uc218\\n\\n\uc704\uc758 \ucf54\ub4dc\ub294 \uc790\ub3d9\uc73c\ub85c dispose \ub418\uc9c0 \uc54a\ub294\ub2e4.\\n\\n### \ub300\ud45c\uc801 3\uac00\uc9c0\\n\\n`watch` : \uac12 \ubcc0\ud558\ub294\uc9c0 \uacc4\uc18d \ud655\uc778\ud558\uace0 \ubcc0\ud558\uba74 \ub9ac\ube4c\ub4dc (async\ud558\uba74\uc548\ub41c\ub2e4.)\\n\\n`listen` : \uac12 \ubcc0\uacbd\ub418\uba74 \ub9ac\ube4c\ub529 \ub418\ub294 \uac83\uc774 \uc544\ub2cc \uc561\uc158\uc744 \uc218\ud589(navigate\uac19\uc740) (async\ud558\uba74 \uc548\ub41c\ub2e4.)\\n\\n`read` : \uac12\uc744 \ud655\uc778\ud558\uc9c0\ub9cc \ubcc0\uacbd\uc744 watch\ud558\uc9c0 \uc54a\uc74c(build\uc5d0\uc11c \uc0ac\uc6a9\ud558\uc9c0\ub9c8\ub77c)\\n\\n## auto dispose\\n---\\n\\n```dart\\nfinal autoDisposeHelloProvider = Provider.autoDispose<String>((ref) {\\n  print(\'[autoDisposeHelloProvder]: created\');\\n  ref.onDispose(() {\\n    print(\'[autoDisposeHelloProvder]: disposed\');\\n  });\\n  return \'Hello\';\\n});\\n```\\n\\n\ud398\uc774\uc9c0\uc5d0\uc11c \ub098\uc624\uba74 autodispose\ud574\uc900\ub2e4.\\n\\n## family\\n---\\n\\n```dart\\nfinal familyHelloProvider = Provider.family<String, String>((ref, name) {\\n  ref.onDispose(() {\\n    print(\'[familyHelloProvider] disposed\');\\n  });\\n  return \'Hello $name\';\\n});\\n```\\n\uc774\ub807\uac8c provider \uc815\uc758\ud558\uba74 argument \uc0ac\uc6a9\ud560 \uc218 \uc788\ub2e4.\\n\\n```dart\\n    final helloA = ref.watch(familyHelloProvider(\'A\'));\\n    final helloB = ref.watch(familyHelloProvider(\'B\'));\\n```\\nwatch\ud560 \ub54c\ub3c4 \uc774\ub7f0\uc2dd\uc73c\ub85c \ud574\uc57c\ud55c\ub2e4.\\n\\n## autoDisposeFamily\\n---\\n\\n```dart\\nfinal autoDisposeFamilyHelloProvider =\\n    Provider.autoDispose.family<String, String>((ref, name) {\\n  ref.onDispose(() {\\n    print(\'[autoDisposeFamilyHelloProvider] disposed\');\\n  });\\n  return \'Hello $name\';\\n});\\n```\\nautoDispose\uc640 family\ub97c \ubaa8\ub450 \uc0ac\uc6a9\ud560 \uc218 \uc788\ub2e4.\\n\\n\ub9cc\uc57d \ub458\uc758 \uc778\uc790\uac12\uc774 `A`\ub77c\uba74 dispose\ub294 \ud55c\ubc88\ub9cc \uc77c\uc5b4\ub0a9\ub2c8\ub2e4. (\uadf8\ub0e5 autoDispose\ub3c4 \ud55c\ubc88\ub9cc \uc77c\uc5b4\ub0a8)\\n\\n\\n## \uac1d\uccb4 \ub118\uae30\uae30 \\n---\\n\\n```dart\\nclass Counter {\\n  final int count;\\n  Counter({\\n    required this.count,\\n  });\\n\\n  @override\\n  String toString() => \'Counter()(count: $count)\';\\n}\\n\\nfinal counterProvider = Provider.autoDispose.family<int, Counter>((ref, c) {\\n  ref.onDispose(() {\\n    print(\'[countProvider($c)] disposed\');\\n  });\\n  return c.count;\\n});\\n```\\n\\n\ub9cc\uc57d \uc704\ucc98\ub7fc \uac1d\uccb4\ub97c \ub118\uaca8\uc11c\\n\\n```dart\\n    ref.watch(counterProvider(Counter(count: 0)));\\n    ref.watch(counterProvider(Counter(count: 0)));\\n```\\n\\n\uc774\ub807\uac8c watch\ub97c \uc870\uc9c0\uba74 dispose\uac00 \ub450\ubc88 \uc77c\uc5b4\ub0a9\ub2c8\ub2e4. \ub458 \ub2e4 \ub2e4\ub978 \uac1d\uccb4\ub85c \ud310\ub2e8\ud569\ub2c8\ub2e4.\\n\\n\\n```dart\\nclass Counter extends Equatable {\\n  final int count;\\n  const Counter({\\n    required this.count,\\n  });\\n\\n  @override\\n  String toString() => \'Counter()(count: $count)\';\\n\\n  @override\\n  List<Object> get props => [count];\\n}\\n```\\n\\nCounter \uac1d\uccb4\ub97c Equatable\ud574\uc57c dispose \ud55c\ubc88\ub9cc \uc77c\uc5b4\ub09c\ub2e4.\\n\\n\\n## \uc815\ub9ac\\n---\\n\\nautoDispose \uc870\uc2ec\ud788 \uc0ac\uc6a9\ud574\uc57c \ud55c\ub2e4. \uacc4\uc18d dispose \ud558\uae30 \ub54c\ubb38\uc5d0"},{"id":"flutter-til-13","metadata":{"permalink":"/blog/flutter-til-13","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024-01-09-til13/index.md","source":"@site/blog/2024-01-09-til13/index.md","title":"Flutter TIL - 13","description":"---","date":"2024-01-09T00:00:00.000Z","formattedDate":"January 9, 2024","tags":[{"label":"TIL","permalink":"/blog/tags/til"},{"label":"\ud50c\ub7ec\ud130","permalink":"/blog/tags/\ud50c\ub7ec\ud130"},{"label":"flutter","permalink":"/blog/tags/flutter"},{"label":"revierpod","permalink":"/blog/tags/revierpod"},{"label":"code generator","permalink":"/blog/tags/code-generator"},{"label":"provider","permalink":"/blog/tags/provider"},{"label":"stateProvider","permalink":"/blog/tags/state-provider"}],"readingTime":2.39,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"flutter-til-13","title":"Flutter TIL - 13","authors":["kihyun"],"tags":["TIL","\ud50c\ub7ec\ud130","flutter","revierpod","code generator","provider","stateProvider"]},"prevItem":{"title":"Flutter TIL - 12","permalink":"/blog/flutter-til-12"},"nextItem":{"title":"Flutter TIL - 10","permalink":"/blog/flutter-til-10"}},"content":"---\\n\\n## code generator\\n---\\n\\n`rivp`: `riverpodPart`\\n\\n```dart\\npart \'b_provider.g.dart\';\\n```\\n\\n`riverpodKeepAlive`\\n\\nriverpod code generator\ub294 \uc790\ub3d9\uc73c\ub85c autoDispose\uc778\ub370 keepAlive:true\ub97c \ud574\uc8fc\uba74 autoDispose\ud558\uc9c0 \uc54a\ub294\ub2e4.\\n\\n```dart\\n@Riverpod(keepAlive: true)\\nString hello(HelloRef ref) {\\n  ref.onDispose(() {\\n    print(\\"[helloProvider] : disposed\\");\\n  });\\n  return \\"Hello\\";\\n}\\n```\\n\\n`String`: return\uc758 \ud0c0\uc785\\n`hello`: \ub098\uc911\uc5d0 helloProvider\ub77c\ub294 \uc774\ub984\uc744 \uac16\ub294\ub2e4.\\n`HelloRef`: generator\ud558\uba74 Ref\ub85c \ub098\uc624\ub294\ub370 hello\uc5d0\uc11c \uc55e\uae00\uc790\ub97c \ub300\ubb38\uc790\ub85c \ud574\uc11c \ubd99\uc774\uba74 HelloRef\uac00 \ub41c\ub2e4. \uc774\uac78\ub85c \uad50\uccb4\ud574\uc918\uc57c\ud55c\ub2e4.\\n\\n### \ucf54\ub4dc\uc0dd\uc131\\n\\n```bash\\ndart run build_runner build -d\\n```\\n\\n\uc704 \ucc98\ub7fc build runner \uc2e4\ud589\ud574\uc11c generate\ud560 \uc218 \uc788\ub2e4.\\n\\n`-d`\uc635\uc158\uc740 generate\uc911 \ucda9\ub3cc\uc774 \ub098\ub3c4 \uadf8\ub0e5 \uc0dd\uc131\ud558\ub77c\ub294 \ub73b\uc785\ub2c8\ub2e4.\\n\\n```bash\\ndart run build_runner watch -d\\n```\\n\\nwatch\ub97c \uc0ac\uc6a9\ud558\uba74 \ud55c\ubc88\ub9cc \uc0ac\uc6a9\ud558\uba74 \ubcc0\ud654\ub97c \uacc4\uc18d watch\ud574\uc11c \uc801\uc6a9\ub41c\ub2e4.\\n\\n### \ucc28\uc774\uc810\\n\\n\uc218\ub3d9 \uc0dd\uc131\uacfc \ucc28\uc774\uc810\uc740\\n\\n1. \uae30\uc874\uc740 `helloProvider` \uc774\ub807\uac8c \ud588\ub2e4\uba74 \uc790\ub3d9 \uc0dd\uc131\uc5d0\uc11c\ub294 hello\ub85c\ub9cc \ud574\ub3c4 `helloProvider` \uc0dd\uc131\ud574\uc90c.\\n\\n2. \uc790\ub3d9\uc0dd\uc131\uc5d0\uc11c\ub294 Provider \uc885\ub958 \uc9c0\uc815 \uc548\ud574\ub3c4\ub41c\ub2e4.\\n\\n\\n## Provider\\n---\\n\\n### autoDispose\\n---\\n\\nautoDispose Provider\ub294 `riverpod`\uc2a4\ub2c8\ud33b \uc73c\ub85c \ub9cc\ub4e4 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n```dart\\n@riverpod\\nString autoDisposeHello(AutoDisposeHelloRef ref) {\\n  print(\'[autoDisposeHelloProvder]: created\');\\n  ref.onDispose(() {\\n    print(\'[autoDisposeHelloProvder]: disposed\');\\n  });\\n  return \'Hello\';\\n}\\n```\\n\\n\\n\\n### family\\n---\\n\\nfamily\ub294 \uadf8\ub0e5 `riverpod`\uc774\ub098 `riverpodkeepalive`\uc5d0\uc11c  ref \uc606\uc5d0 \ud30c\ub77c\ubbf8\ud130 \ucd94\uac00\ud574\uc8fc\uba74 family\ub85c \uc790\ub3d9\uc73c\ub85c \ub9cc\ub4e4\uc5b4\uc90d\ub2c8\ub2e4.\\n\\n```dart\\n@Riverpod(keepAlive: true)\\nString familyHello(FamilyHelloRef ref, {required String name}) {\\n  ref.onDispose(() {\\n    print(\'[familyHelloProvider] disposed\');\\n  });\\n  return \'Hello $name\';\\n}\\n```\\n\\n\ucc38\uace0\ub85c `name`\uc744 \uc0ac\uc6a9\ud558\uba74 \uc5d0\ub7ec\ub09c\ub2e4. \uadf8 \uc774\uc720\ub294 generator\uc5d0\uc11c name\uc774\ub77c\ub294 \ubcc0\uc218\ub97c \uc774\ubbf8 \uc0ac\uc6a9\ud558\uace0 \uc788\uae30 \ub54c\ubb38\uc774\ub2e4.\\n\\n### autoDispose, family\\n---\\n\\n```dart\\n@riverpod\\nString autoDisposeFamilyHello(AutoDisposeFamilyHelloRef ref,\\n    {required String nom}) {\\n  ref.onDispose(() {\\n    print(\'[autoDisposeFamilyHelloProvider] disposed\');\\n  });\\n  return \'Hello $nom\';\\n}\\n```\\n\\n\ubcc4\ub85c \uc5b4\ub835\uc9c0 \uc54a\uc74c\\n\\n## \ud55c\uac00\uc9c0 \ubc30\uc6b4 dart \uc5b8\uc5b4 syntax\\n---\\n\\n`part`\ub294 `import`\ub2e4\uc74c\uc73c\ub85c \ucd5c\uc0c1\ub2e8\uc5d0 \uc704\uce58\ud574\uc57c\ud55c\ub2e4.\\n\\n\\n## StateProvider\\n---\\n\\n### \ud2b9\uc9d5\\n\\n- stateProvider\ub294 notifierProvider\uc758 \uac04\uc18c\ud654\ub41c \ubc84\uc804  \\n- \ubcf5\uc7a1\ud558\uc9c0 \uc54a\ub294 \ub85c\uc9c1\uc744 \uc4f8 \ub54c \uc0ac\uc6a9  \\n- code generator\ud574\uc11c \ub9cc\ub4e4 \uc218 \uc5c6\ub2e4.(\uc218\ub3d9\ub9cc \uac00\ub2a5)"},{"id":"flutter-til-10","metadata":{"permalink":"/blog/flutter-til-10","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024-01-08-til10/index.md","source":"@site/blog/2024-01-08-til10/index.md","title":"Flutter TIL - 10","description":"---","date":"2024-01-08T00:00:00.000Z","formattedDate":"January 8, 2024","tags":[{"label":"TIL","permalink":"/blog/tags/til"},{"label":"\uac1c\ub150","permalink":"/blog/tags/\uac1c\ub150"},{"label":"mutex","permalink":"/blog/tags/mutex"},{"label":"semaphore","permalink":"/blog/tags/semaphore"}],"readingTime":0.995,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"flutter-til-10","title":"Flutter TIL - 10","authors":["kihyun"],"tags":["TIL","\uac1c\ub150","mutex","semaphore"]},"prevItem":{"title":"Flutter TIL - 13","permalink":"/blog/flutter-til-13"},"nextItem":{"title":"Flutter TIL - 11","permalink":"/blog/flutter-til-11"}},"content":"---\\n\\n## mutex\uc640 semaphore \ucc28\uc774\\n---\\n\\n### mutex\\n\\n\uacf5\uc720\ub41c \uc790\uc6d0\uc5d0 \uc2a4\ub808\ub4dc\ub4e4\uc758 \ub3d9\uc2dc \uc811\uadfc\uc744 \ub9c9\uc544\uc90d\ub2c8\ub2e4. 1\uac1c\uc758 \ud504\ub85c\uc138\uc2a4 \ud639\uc740 \uc4f0\ub808\ub4dc\ub9cc \uacf5\uc720 \uc790\uc6d0\uc5d0 \uc811\uadfc\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \ud0a4\ub97c \uae30\ubc18\uc73c\ub85c \ud55c \uc0c1\ud638\ubc30\uc81c \uae30\ubc95\uc785\ub2c8\ub2e4.\\n\\n\uacf5\uc720\ub41c \uc790\uc6d0\uc744 \uce74\ud398 \ud654\uc7a5\uc2e4\ub85c \ube44\uc720\ud560 \uc218 \uc788\uace0 \ud0a4\ub97c \uc5f4\uc1e0\ub85c \ube44\uc720\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n### semaphore\\n\\n\uc138\ub9c8\ud3ec\uc5b4\ub3c4 \ub3d9\uc2dc \uc811\uadfc\uc744 \ub9c9\uc544\uc8fc\ub294\ub370 1\uac1c\uc758 \ud504\ub85c\uc138\uc2a4\ub9cc \uc811\uadfc\ud560 \uc218 \uc788\ub294 \uac83\uc774 \uc544\ub2cc \uc5ec\ub7ec \uc124\uc815\ub41c \ucd5c\ub300\uac12 \ub9cc\ud07c \ub4e4\uc5b4\uac08 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \ube48\uce78\uc774 0\uc774\uba74 \ub300\uae30\ud574\uc57c \ud569\ub2c8\ub2e4.\\n\\n\uacf5\uc720\ub41c \uc790\uc6d0\uc744 \uce74\ud398 \ud654\uc7a5\uc2e4\uc778\ub370 \uce78\uc774 \uc5ec\ub7ec \uac1c \uc788\ub294 \ud654\uc7a5\uc2e4\ub85c \ube44\uc720\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4."},{"id":"flutter-til-11","metadata":{"permalink":"/blog/flutter-til-11","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024-01-08-til11/index.md","source":"@site/blog/2024-01-08-til11/index.md","title":"Flutter TIL - 11","description":"---","date":"2024-01-08T00:00:00.000Z","formattedDate":"January 8, 2024","tags":[{"label":"TIL","permalink":"/blog/tags/til"},{"label":"\ud50c\ub7ec\ud130","permalink":"/blog/tags/\ud50c\ub7ec\ud130"},{"label":"flutter","permalink":"/blog/tags/flutter"},{"label":"dart","permalink":"/blog/tags/dart"},{"label":"freezed","permalink":"/blog/tags/freezed"},{"label":"json_annotation","permalink":"/blog/tags/json-annotation"},{"label":"riverpod","permalink":"/blog/tags/riverpod"},{"label":"provider","permalink":"/blog/tags/provider"}],"readingTime":2.015,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"flutter-til-11","title":"Flutter TIL - 11","authors":["kihyun"],"tags":["TIL","\ud50c\ub7ec\ud130","flutter","dart","freezed","json_annotation","riverpod","provider"]},"prevItem":{"title":"Flutter TIL - 10","permalink":"/blog/flutter-til-10"},"nextItem":{"title":"Flutter TIL - 9","permalink":"/blog/flutter-til-9"}},"content":"---\\n\\n## factory Constructor\\n---\\n\\nfactory constructor\uc758 constructor redirection\uc5d0 \ub300\ud574 \uc54c\uace0 \uc788\uc5b4\uc57c \ud55c\ub2e4. \uadf8\ub9ac\uace0 const\ub97c \uc0ac\uc6a9\ud560 \uc218 \uc788\uc74c.\\n\\n## \ud544\uc694\ud55c \ud328\ud0a4\uc9c0\\n---\\n\\n`freezed_annotation`: dep : \ucf54\ub4dc \uc0dd\uc131\uae30\uc5d0 \ub300\ud55c \uc5b4\ub178\ud14c\uc774\uc158 \ud328\ud0a4\uc9c0\\n\\n`build_runner` : dev-dep : \ucf54\ub4dc \uc0dd\uc131\uae30 \uc2e4\ud589\\n\\n`freezed` : dev-dep : \ucf54\ub4dc \uc0dd\uc131\uae30\\n\\n`json_annotation` : dep : \ucf54\ub4dc \uc0dd\uc131\uae30\uc778 json_serializable\uc758 \uc5b4\ub178\ud14c\uc774\uc158 \uac16\uace0 \uc788\ub294 \ud328\ud0a4\uc9c0\\n\\n`json_serializable` : dev-dep : \ucf54\ub4dc \uc0dd\uc131\uae30\\n\\n### freezed\uc640 json_serializable \uc0ac\uc6a9\ud560 \uacbd\uc6b0\\n\\nanalysis_options.yaml\uc5d0 \uc124\uc815\\n\\n```yaml\\nanalyzer:\\n  errors:\\n    invalid_annotation_target: ignore\\n  exclude:\\n    - \'**/*.freezed.dart\'\\n    - \'**/*.g.dart\'\\n```\\n\\n### build runner\ub97c \uc0ac\uc6a9\ud574\uc11c \ucf54\ub4dc gen\ud558\ub824\uba74\\n\\n```bash\\ndart run build_runner build [--delete-conflicting-outputs]\\n\\nor\\n\\ndart run build_runner watch [-d]\\n```\\n\\nbuild\ub294 one-time, watch\ub294 \uacc4\uc18d \ube4c\ub4dc\ud568\\n\\nwatch\uac00 \ube4c\ub4dc \ud0c0\uc784 \uc801\ub2e4.\\n\\n`[]`\uc5d0 \uc788\ub294 \uc635\uc158\uc740 previous build\uc5d0\uc11c \ubc1c\uc0dd\ud55c \uac83 \uac74\ub108\ub6f0\uae30\\n\\n\\n## extension\\n\\n`freezed`\ub77c\ub294 \ud655\uc7a5 \uc124\uce58\ud574\uc57c \ud55c\ub2e4.\\n\\n`ptf` : part \'*.freezed.dart\'; \uc0dd\uc131\\n`pts` : part \'*.g.dart\'; \uc0dd\uc131\\n`fdataclass` : Dataclass \uc0dd\uc131\\n`funion` : Union class \uc0dd\uc131\\n\\n\\n## \uae30\ub2a5\\n---\\n\\n### \uc815\ub9ac\\n\\n\uc6b0\uc120 \ub2e4\uc591\ud55c \uac83\ub4e4\uc744 override\ud574\uc900\ub2e4.\\n\\ntoString\uc774\ub098 copyWith, equality \ub4f1\uc744 \uc624\ubc84\ub77c\uc774\ub529 \ud574\uc90c.\\n\\n### copyWith\\n\\n\uc77c\ubc18\uc801\uc778 copyWith + null\ub3c4 \uc9c0\uc6d0\ud574\uc90c\\n\\ndeep copyWith\ub3c4 \uc81c\uacf5\ud574\uc900\ub2e4. \ubcf5\uc7a1\ud55c \ucf54\ub4dc\ub97c \uac04\ub2e8\ud558\uac8c \uc791\uc131\ud560 \uc218 \uc788\ub3c4\ub85d \uc9c0\uc6d0\\n\\n### Json annotation\\n\\n```dart\\n@JsonKey(name: \'parking_lot_capacity\') int? parkingLotcapacity,\\n```\\n\\ndata class\ub97c \ub9cc\ub4e4 \ub54c \uc774\ub7f0 \uc778\uc790\uac12\uc744 \ubcfc \uc218 \uc788\ub2e4.\\n\\n\ubcc0\uc218 parkingLotcapacity\ub97c json\ud0a4 \uac12 \'parking_lot_capacity\'\ub85c \ud310\ub2e8\ud558\uaca0\ub2e4\ub294 \ub73b\uc774\ub2e4.\\n\\n```dart\\n  factory Hotel.fromJson(Map<String, dynamic> json) => _$HotelFromJson(json);\\n```\\n\\n\uc774\ub7f0 \uac83\ub3c4 \uc81c\uacf5\ud574\uc900\ub2e4.\\n\\n## Provider\\n---\\n\\n\uc704\uc82f\uc774\ub098 \ub2e4\ub978 Provider\uc5d0 \uac12\uc744 \uc81c\uacf5\\n\\nriverpod\uc5d0\uc11c\ub294 Provider\ub97c watch\ud560 \uc218 \uc788\ub2e4.\\n\uadf8\ub9ac\uace0 \uadf8\ub0e5 \uac12\uc744 \uc81c\uacf5\ud558\ub294 Provider\ub2e4.\\n\\n### dep\\n\\n`equatable`,`flutter_riverpod`,`riverpod_annotation`\\n\\n### dev-dep\\n\\n`build_runner`,`custom_lint`,`flutter_lints`,`riverpod_generator`, `riverpod_lint`"},{"id":"flutter-til-9","metadata":{"permalink":"/blog/flutter-til-9","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024-01-04-til9/index.md","source":"@site/blog/2024-01-04-til9/index.md","title":"Flutter TIL - 9","description":"---","date":"2024-01-04T00:00:00.000Z","formattedDate":"January 4, 2024","tags":[{"label":"TIL","permalink":"/blog/tags/til"},{"label":"\ud50c\ub7ec\ud130","permalink":"/blog/tags/\ud50c\ub7ec\ud130"},{"label":"flutter","permalink":"/blog/tags/flutter"},{"label":"dart","permalink":"/blog/tags/dart"},{"label":"data class generator","permalink":"/blog/tags/data-class-generator"},{"label":"equatable","permalink":"/blog/tags/equatable"},{"label":"json","permalink":"/blog/tags/json"}],"readingTime":1.13,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"flutter-til-9","title":"Flutter TIL - 9","authors":["kihyun"],"tags":["TIL","\ud50c\ub7ec\ud130","flutter","dart","data class generator","equatable","json"]},"prevItem":{"title":"Flutter TIL - 11","permalink":"/blog/flutter-til-11"},"nextItem":{"title":"Flutter TIL - 8","permalink":"/blog/flutter-til-8"}},"content":"---\\n\\n## Equatable\\n---\\n\\n`dart class generator`\ub77c\ub294 vs code extension\uc744 \uc0ac\uc6a9\ud560 \ub54c \uac1d\uccb4 \ube44\uad50\ub97c \uc704\ud574\uc11c `equatable`\uc774\ub77c\ub294 dart \ud328\ud0a4\uc9c0\ub97c \uc774\uc6a9\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\n\\nvs code preferences\uc5d0\uc11c equatable \uad00\ub828 \uc124\uc815\uc744 `true`\ub85c \ubcc0\uacbd\ud55c\ub2e4\uba74 generator\ub97c \uc774\uc6a9\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n\ud568\uc218\ub97c \ud1b5\ud574 \uac1d\uccb4\ub97c \uc0dd\uc131\ud558\uba74 \uc8fc\uc18c \uac12\uc774 \ub2ec\ub77c\uc838\uc11c \uac19\uc740 \uac12\uc744 \uac16\uace0 \uc788\ub294 \uac1d\uccb4\ub97c \ube44\uad50\ud574\ub3c4 false\ub85c \ub098\uc624\ub294\ub370 `equatable`\uc744 \uc774\uc6a9\ud574\uc11c \ube44\uad50\ud558\uba74 true\ub97c \ubc18\ud658\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n## Json \uad00\ub828\\n---\\n\\njson object\ub85c \uc790\ub3d9 data class\uac00 \uc0dd\uc131\ub418\ub294 \ub9c8\ubc95\uc774 \uc788\ub2e4\uace0 \ud569\ub2c8\ub2e4.\\n\\n1. \uc77c\ub2e8 dart \ud30c\uc77c\uc744 \ub9cc\ub4ed\ub2c8\ub2e4.\\n\\n2. api \uc751\ub2f5 json \uac12\uc744 \ub123\uc2b5\ub2c8\ub2e4.\\n\\n3. `ctrl`+`shift`+`p`\ud574\uc11c Generate from JSON \uc785\ub825\ud574\uc11c \uc120\ud0dd\\n\\n4. class \uc774\ub984 \uc785\ub825\\n\\n5. no \uc120\ud0dd\\n\\n\uadf8\ub7fc data class \uc790\ub3d9 \uc0dd\uc131 \ud574\uc900\ub2e4.\\n\\nfromMap, toMap\ub9cc \uc798 \ud655\uc778\ud574\ubcf4\uba74 \ub41c\ub2e4. (beta \ub2e8\uacc4\uc784)"},{"id":"flutter-til-8","metadata":{"permalink":"/blog/flutter-til-8","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024-01-03-til8/index.md","source":"@site/blog/2024-01-03-til8/index.md","title":"Flutter TIL - 8","description":"---","date":"2024-01-03T00:00:00.000Z","formattedDate":"January 3, 2024","tags":[{"label":"TIL","permalink":"/blog/tags/til"},{"label":"\ud50c\ub7ec\ud130","permalink":"/blog/tags/\ud50c\ub7ec\ud130"},{"label":"flutter","permalink":"/blog/tags/flutter"},{"label":"dart","permalink":"/blog/tags/dart"},{"label":"tree-view","permalink":"/blog/tags/tree-view"}],"readingTime":0.62,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"flutter-til-8","title":"Flutter TIL - 8","authors":["kihyun"],"tags":["TIL","\ud50c\ub7ec\ud130","flutter","dart","tree-view"]},"prevItem":{"title":"Flutter TIL - 9","permalink":"/blog/flutter-til-9"},"nextItem":{"title":"Git - LF will be replaced by CRLF the next time Git touches it","permalink":"/blog/git-error-1"}},"content":"---\\n\\n## Treeview\\n---\\n\\n[\uc774 \ub77c\uc774\ube0c\ub7ec\ub9ac](https://pub.dev/packages/animated_tree_view)\ub97c \uc0ac\uc6a9\ud55c\ub2e4.\\n\\n`animated_tree_view`\ub2e4.\\n\\n`TreeNode.root`\uc5d0 `..addAll([])` \ud574\uc11c \ubc30\uc5f4\uc744 \ub123\uc744 \uc218 \uc788\ub2e4.\\n\\n```dart\\n  final myTree = TreeNode.root()\\n    ..addAll([\\n      TreeNode(key: \\"Today\\"),\\n      TreeNode(key: \\"Tomorrow\\")\\n        ..addAll([\\n          TreeNode(key: \\"task 1\\"),\\n          TreeNode(key: \\"task 2\\"),\\n          TreeNode(key: \\"task 3\\"),\\n        ]),\\n      TreeNode(key: \\"Upcoming\\"),\\n    ]);\\n```\\n\\n`TreeView.simple`\uc744 \uc0ac\uc6a9\ud574\ubd24\ub294\ub370 builder\uc5d0\uc11c \uc778\uc790\ub85c `context`, `node`\ub97c \ubc1b\ub294\ub2e4.\\n\\n\uc8fc\uc758\ud560 \uc810\uc740 key\ub85c \ud558\uae30 \ub54c\ubb38\uc5d0 key \uc911\ubcf5\ub418\uc9c0 \uc54a\uac8c \uc870\uc2ec\ud574\uc57c\ud55c\ub2e4. \uac19\uc740 level\ub9cc \uc544\ub2c8\uba74 \uad1c\ucc2e\ub2e4. (\uac19\uc740 level\uc544\ub2c8\uba74 \uc774\ub984 \uc911\ubcf5 \uac00\ub2a5)"},{"id":"git-error-1","metadata":{"permalink":"/blog/git-error-1","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2023-12-28-error1/index.md","source":"@site/blog/2023-12-28-error1/index.md","title":"Git - LF will be replaced by CRLF the next time Git touches it","description":"---","date":"2023-12-28T00:00:00.000Z","formattedDate":"December 28, 2023","tags":[{"label":"git","permalink":"/blog/tags/git"}],"readingTime":0.11,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"git-error-1","title":"Git - LF will be replaced by CRLF the next time Git touches it","authors":["kihyun"],"tags":["git"]},"prevItem":{"title":"Flutter TIL - 8","permalink":"/blog/flutter-til-8"},"nextItem":{"title":"Flutter TIL - 7","permalink":"/blog/flutter-til-7"}},"content":"---\\n\\n## window\\n---\\n\\n```bash\\ngit config --global core.autocrlf true\\n```\\n\\n## linux, mac\\n---\\n\\n```bash\\ngit config --global core.autocrlf input\\n```"},{"id":"flutter-til-7","metadata":{"permalink":"/blog/flutter-til-7","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2023-12-28-til7/index.md","source":"@site/blog/2023-12-28-til7/index.md","title":"Flutter TIL - 7","description":"---","date":"2023-12-28T00:00:00.000Z","formattedDate":"December 28, 2023","tags":[{"label":"TIL","permalink":"/blog/tags/til"},{"label":"\ud50c\ub7ec\ud130","permalink":"/blog/tags/\ud50c\ub7ec\ud130"},{"label":"flutter","permalink":"/blog/tags/flutter"},{"label":"dart","permalink":"/blog/tags/dart"},{"label":"future_wait","permalink":"/blog/tags/future-wait"}],"readingTime":0.54,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"flutter-til-7","title":"Flutter TIL - 7","authors":["kihyun"],"tags":["TIL","\ud50c\ub7ec\ud130","flutter","dart","future_wait"]},"prevItem":{"title":"Git - LF will be replaced by CRLF the next time Git touches it","permalink":"/blog/git-error-1"},"nextItem":{"title":"Git - \ubcc0\uacbd\uc0ac\ud56d \ucde8\uc18c","permalink":"/blog/tip-git-1"}},"content":"---\\n\\n## Future.wait\\n---\\n\\n```dart\\n  Future<void> searchProductList() async {\\n    isBusy = true;\\n    final results = await Future.wait([\\n      productRepository.searchProductList(keyword),\\n      Future.delayed(const Duration(milliseconds: 555)),\\n    ]);\\n    productList = results[0];\\n    isBusy = false;\\n  }\\n```\\n\\n`Future.wait`\uc774\ub77c\ub294\uac8c \uc788\ub294\ub370 \uc548\uc5d0 \uc788\ub294 Future wait\uc758 \ubc30\uc5f4 \uba85\ub839\uc5b4\ub4e4\uc774 \ubaa8\ub450 \ub05d\ub0a0 \ub54c\uae4c\uc9c0 \uae30\ub2e4\ub9bc\\n\\n\uc989 \uc704 \ucf54\ub4dc \uc0c1\uc73c\ub85c\ub294 search\ud558\ub294\uac70\uc640 delayed\ub97c \ub3d9\uc2dc\uc5d0 \ub3cc\ub9ac\ub294\ub370 555 millisecond\ub294 \ubb34\uc870\uac74 \ub3cc\uace0 \uadf8 \uc774\uc0c1\uc740 search\ub05d\ub0a0 \ub54c\uae4c\uc9c0 \uae30\ub2e4\ub9b0\ub2e4\ub294 \ub73b"},{"id":"tip-git-1","metadata":{"permalink":"/blog/tip-git-1","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2023-12-28-tip-git1/index.md","source":"@site/blog/2023-12-28-tip-git1/index.md","title":"Git - \ubcc0\uacbd\uc0ac\ud56d \ucde8\uc18c","description":"---","date":"2023-12-28T00:00:00.000Z","formattedDate":"December 28, 2023","tags":[{"label":"git","permalink":"/blog/tags/git"}],"readingTime":0.05,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"tip-git-1","title":"Git - \ubcc0\uacbd\uc0ac\ud56d \ucde8\uc18c","authors":["kihyun"],"tags":["git"]},"prevItem":{"title":"Flutter TIL - 7","permalink":"/blog/flutter-til-7"},"nextItem":{"title":"Flutter TIL - 6","permalink":"/blog/flutter-til-6"}},"content":"---\\n\\n## \uba85\ub839\uc5b4\\n\\n```bash\\ngit reset --hard\\n```"},{"id":"flutter-til-6","metadata":{"permalink":"/blog/flutter-til-6","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2023-12-27-til6/index.md","source":"@site/blog/2023-12-27-til6/index.md","title":"Flutter TIL - 6","description":"---","date":"2023-12-27T00:00:00.000Z","formattedDate":"December 27, 2023","tags":[{"label":"TIL","permalink":"/blog/tags/til"},{"label":"\ud50c\ub7ec\ud130","permalink":"/blog/tags/\ud50c\ub7ec\ud130"},{"label":"flutter","permalink":"/blog/tags/flutter"},{"label":"dart","permalink":"/blog/tags/dart"},{"label":"listview","permalink":"/blog/tags/listview"},{"label":"clipping","permalink":"/blog/tags/clipping"},{"label":"GestureDetector","permalink":"/blog/tags/gesture-detector"},{"label":"divider","permalink":"/blog/tags/divider"}],"readingTime":2.52,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"flutter-til-6","title":"Flutter TIL - 6","authors":["kihyun"],"tags":["TIL","\ud50c\ub7ec\ud130","flutter","dart","listview","clipping","GestureDetector","divider"]},"prevItem":{"title":"Git - \ubcc0\uacbd\uc0ac\ud56d \ucde8\uc18c","permalink":"/blog/tip-git-1"},"nextItem":{"title":"Flutter TIL - 5","permalink":"/blog/flutter-til-5"}},"content":"---\\n\\n## ClipRRect\\n---\\n\\ncontainer\ub97c border radius\ud558\uac8c \ub514\uc790\uc778 \ud588\ub294\ub370 \uc2a4\ud06c\ub864 \ubc14\uac00 \uc624\ubc84\ud50c\ub85c\uc6b0 \ub418\ub294 \ud604\uc0c1\uc774 \uc788\uc5c8\ub2e4.\\n\\nClipRRect\ub85c \uc2a4\ud06c\ub864\ubc14\ub97c \ub9cc\ub4dc\ub294 listview \uc704\uc82f\uc744 \uac10\uc2f8\ub2c8 \uc624\ubc84\ud50c\ub85c\uc6b0 \ub418\ub294 \ubd80\ubd84\uc740 \uc548\ubcf4\uc774\uac8c \ub410\ub2e4.\\n\\nClipRRect\uc704\uc82f\uc740 \ud074\ub9ac\ud551\ud558\ub294 \uc704\uc82f\uc778\ub370 \ud074\ub9ac\ud551\uc774\ub780 \uc8fc\uc5b4\uc9c4 \uacbd\uacc4 \ub0b4\uc5d0\uc11c\ub9cc \ub0b4\uc6a9\uc744 \ubcf4\uc5ec\uc8fc\uace0 \uacbd\uacc4 \ub118\uc5b4\uc11c\ub294 \uc798\ub77c\ub0b4\ub294 \uac83\uc744 \uc758\ubbf8\ud55c\ub2e4\uace0 \ud55c\ub2e4.\\n\\n\uc8fc\ub85c \uc774\ubbf8\uc9c0\ub97c \ub465\uadfc \uc561\uc790\uc5d0 \ub123\uace0 \uc2f6\uc744 \ub54c\ub3c4 \uc0ac\uc6a9\ud55c\ub2e4\uace0 \ud55c\ub2e4..\\n\\n## listView\\n---\\n\\n\uc0ac\uc2e4 \ubc14\ubcf4\uac19\uc740 \uc9d3\uc744 \ud588\ub2e4 listView \uc548\uc5d0 expanded\ub97c \ub123\uc73c\ub824\uace0 \ud588\ub2e4. \uc65c\ub0d0\ud558\uba74 width\ub97c double.infinity\ud558\uac8c \ud558\uace0\uc2f6\uc5c8\uc5c8\ub2e4. \uadf8\ub7ec\ub098 listView\ub97c \uc798 \ubab0\ub790\uc5c8\ub2e4.\\n\\nlistView\uc758 \uc790\uc2dd\ub4e4\uc740 listView\uc758 \ud06c\uae30\ub97c \ub530\ub77c\uac04\ub2e4. \uadf8\ub798\uc11c listView\ub97c Expanded\uc548\uc5d0 infinity\ub85c \ub450\uba74 \uadf8 \uc548\uc5d0\ub3c4 infinity\ub2e4. \uadf8\ub807\uac8c \ud574\uacb0\ud588\ub2e4.\\n\\n## GestureDetector\uc758 behavior\\n---\\n\\n:::tip\\n`deferToChild`: \uc790\uc2dd \uc911 \ud558\ub098\uac00 \uc801\uc911 \uc2dc \uc774\ubca4\ud2b8 \uc218\uc2e0(\ud22c\uba85\ud55c \ub300\uc0c1 \uc774\ubca4\ud2b8 \uc218\uc2e0 x)  \\n`translucent` : \ubc18\ud22c\uba85\ud55c \ub300\uc0c1 & \uc2dc\uac01\uc801\uc73c\ub85c \ub4a4\uc5d0 \uc788\ub294 \ub300\uc0c1\ub3c4 \uc774\ubca4\ud2b8 \uc218\uc2e0  \\n`opaque` : \uc2dc\uac01\uc801\uc73c\ub85c \ub4a4\uc5d0 \uc788\ub294 \ub300\uc0c1\uc740 \uc774\ubca4\ud2b8 \uc218\uc2e0 \ubd88\uac00\ub2a5\\n:::\\n\\n```dart\\nbehavior: HitTestBehavior.translucent,\\n```\\n\\n\uc774\uc640 \uac19\uc774 \uc0ac\uc6a9\ud55c\ub2e4\uba74 \ud328\ub529\ubd80\ubd84\ub3c4 \ud074\ub9ad\ud55c\ub2e4\uba74 \uc774\ubca4\ud2b8 \uc218\uc2e0\ub420 \uc218 \uc788\ub2e4.\\n\\n\\n## Divider\\n---\\n\\n`ListView.separated`\ub97c \uc0ac\uc6a9\ud558\uc5ec `separatorBuilder`\ub97c \ud1b5\ud574 \uad6c\ubd84\uc790\ub97c \ub123\uc744 \uc218 \uc788\uc5c8\ub2e4.\\n\\n\uc904\uc744 \uae0b\uace0 \uc2f6\uc5c8\ub294\ub370 `Divider`\ub97c \uc0ac\uc6a9\ud560 \uc218 \uc788\uc5c8\ub2e4.\\n\\n`height`\ub85c \uc0c1\ud558 \uc5ec\ubc31\uc744 \uc815\ud560 \uc218 \uc788\uc5c8\uace0  \\n`thickness`\ub85c \uc904\uc758 \uad75\uae30\ub97c  \\n`indent`,`endIndent`\ub85c \uc88c\uc6b0 \uc5ec\ubc31\uc744  \\n`color`\ub85c \uc0c9\uc0c1\uc744 \uc815\ud560 \uc218 \uc788\uc5c8\ub2e4.\\n\\n## \ub9ac\ub79c\ub354\ub9c1\\n---\\n\\n\ub2e4\uad6d\uc5b4 \uc9c0\uc6d0 \uc124\uc815\uc744 \ud588\ub294\ub370 \uac12\uc740 \ubcc0\uacbd \ub410\ub294\ub370 \ud654\uba74 \ub9ac\ub79c\ub354\ub9c1\uc744 \ubabb\ud574\uc11c \uacc4\uc18d \uc560\uba39\uc5c8\uc5c8\ub2e4. \uacb0\uad6d\uc5d0\ub294 riverpod provider\ub97c \uc218\uc815\ud558\uc5ec \ub2e4\uad6d\uc5b4\ub3c4 watch\ud558\ub294 \ubc29\ubc95\uc73c\ub85c \ubcc0\uacbd\ud588\ub294\ub370 \ud604\uc5c5\uc5d0\uc11c \uc774\ub807\uac8c \uc0ac\uc6a9\ud558\ub294\uc9c0\ub294 \uc544\uc9c1 \ubaa8\ub974\uaca0\ub2e4.."},{"id":"flutter-til-5","metadata":{"permalink":"/blog/flutter-til-5","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2023-12-26-til5/index.md","source":"@site/blog/2023-12-26-til5/index.md","title":"Flutter TIL - 5","description":"---","date":"2023-12-26T00:00:00.000Z","formattedDate":"December 26, 2023","tags":[{"label":"TIL","permalink":"/blog/tags/til"},{"label":"\ud50c\ub7ec\ud130","permalink":"/blog/tags/\ud50c\ub7ec\ud130"},{"label":"flutter","permalink":"/blog/tags/flutter"},{"label":"dart","permalink":"/blog/tags/dart"},{"label":"\uc0dd\uc131\uc790","permalink":"/blog/tags/\uc0dd\uc131\uc790"},{"label":"constructor","permalink":"/blog/tags/constructor"},{"label":"nullabel","permalink":"/blog/tags/nullabel"}],"readingTime":1.675,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"flutter-til-5","title":"Flutter TIL - 5","authors":["kihyun"],"tags":["TIL","\ud50c\ub7ec\ud130","flutter","dart","\uc0dd\uc131\uc790","constructor","nullabel"]},"prevItem":{"title":"Flutter TIL - 6","permalink":"/blog/flutter-til-6"},"nextItem":{"title":"Flutter TIL - 4","permalink":"/blog/flutter-til-4"}},"content":"---\\n\\n## nullable constructor\\n---\\n\\n### \uc2e4\uc218\ud55c \ucf54\ub4dc\\n\\n\ucc98\uc74c\uc5d0 class\uc758 \uc778\uc2a4\ud134\uc2a4\ub97c \ub9cc\ub4e4 \ub54c nullable\ub85c \uc120\uc5b8\ud558\uba74 \ub420 \uc904 \uc54c\uc558\ub2e4.\\n\\n```dart\\nclass NaviState {\\n  final int? index;  \\n  final bool? yesOrNo;  \\n\\n  NaviState({\\n    this.index,\\n    this.yesOrNo,\\n  });\\n}\\n```\\n\\n\uc774\ub807\uac8c \ud588\ub354\ub2c8 \uc0ac\uc6a9\ud558\ub294 \ubcc0\uc218 \ud0c0\uc785\uc774 nullabe\uc774 \ub418\uc5b4\ubc84\ub824\uc11c \uacc4\uc18d \uc0ac\uc6a9\ud558\ub294 \ubcc0\uc218 \ub4a4\uc5d0 `!`\ub97c \ubd99\uc5ec\uc918\uc11c null\uc774 \uc544\ub2d8\uc744 \uba85\uc2dc\ud588\uc5b4\uc57c \ud588\ub294\ub370\\n\\n### \uc6d0\ud588\ub358 \ucf54\ub4dc\\n\\n```dart\\nclass NaviState {\\n  final int index;\\n  final bool yesOrNo;\\n\\n  NaviState({\\n    int? index,\\n    bool? yesOrNo,\\n  })  : index = index ?? 0,\\n        yesOrNo = yesOrNo ?? false;\\n}\\n```\\n\\n\uc774\ub807\uac8c nullable\ub85c \uc120\uc5b8\ud558\ub294 \uac83\uc774 \uc544\ub2cc \uc0dd\uc131\uc790\uc5d0\uc11c nullable\ub85c \ubc1b\uace0 null\uc778 \uacbd\uc6b0 \ucd08\uae30\uac12\uc744 \uc124\uc815\ud558\ub3c4\ub85d \ud558\ub294 \uac83\uc774 \ub0b4\uac00 \uc758\ub3c4\ud55c \ubc29\ud5a5\uc131\uacfc \ub354 \ub9de\ub294 \ucf54\ub4dc\uc778 \uac83\uc744 \uc54c\uac8c \ub410\ub2e4.\\n\\n\\n## Navigator.pushNamed\\n---\\n\\nflutter\uc5d0\uc11c \ub77c\uc6b0\ud305 \ud558\ub294 \ubc29\ubc95\uc740 \uc880 \ub2e4\uc591\ud55c \uac83 \uac19\ub2e4.\\n\\n\uadf8 \uc911 `Navigator.pushNamed`\uc774\ub2e4.\\n\\nNavigator.pushNamed\ub85c context\uc5d0 \ubd88\ub7ec\uc62c \uc704\uc82f \uc774\ub984\uc744 push\ud55c\ub2e4.\\n\\n\uadf8\ub7ec\uba74 \uc815\uc758\ud574 \ub193\uc740 `onGenerateRoute`\ub97c \ud1b5\ud574\uc11c page\ub97c \ubd88\ub7ec\uc624\uba74 \ub41c\ub2e4. \uac04\ub2e8\ud558\ub2e4.\\n\\n## GestureDetector \ub80c\ub354\ub9c1 \ubb38\uc81c\\n---\\n\\n\uac11\uc790\uae30 GestureDetector\ub9cc \uc0ac\uc6a9\ud558\uba74 \ub80c\ub354\ub9c1 \uc5d0\ub7ec\uac00 \ub0ac\ub2e4.\\n\\nGestureDetector\uc5d0 \uc0ac\uc774\uc988\ub97c \uc81c\uacf5\ud574\uc8fc\uc9c0 \uc54a\uc558\uae30 \ub54c\ubb38\uc774\ub77c\uace0 \ud55c\ub2e4. (ListView\ub3c4 \ub9c8\ucc2c\uac00\uc9c0\ub2e4)\\n\\n```dart\\nExpanded(\\n  child: SizedBox(\\n    height: 200,\\n    width: 200,\\n    child: GestureDetector(),\\n  ),\\n)\\n```\\n\\n\uc774\ub7f0\uc2dd\uc73c\ub85c \uad6c\ud604\ud560 \uc218 \uc788\ub2e4."},{"id":"flutter-til-4","metadata":{"permalink":"/blog/flutter-til-4","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2023-12-21-til4/index.md","source":"@site/blog/2023-12-21-til4/index.md","title":"Flutter TIL - 4","description":"---","date":"2023-12-21T00:00:00.000Z","formattedDate":"December 21, 2023","tags":[{"label":"TIL","permalink":"/blog/tags/til"},{"label":"\ud50c\ub7ec\ud130","permalink":"/blog/tags/\ud50c\ub7ec\ud130"},{"label":"flutter","permalink":"/blog/tags/flutter"},{"label":"dart","permalink":"/blog/tags/dart"},{"label":"function","permalink":"/blog/tags/function"}],"readingTime":2.565,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"flutter-til-4","title":"Flutter TIL - 4","authors":["kihyun"],"tags":["TIL","\ud50c\ub7ec\ud130","flutter","dart","function"]},"prevItem":{"title":"Flutter TIL - 5","permalink":"/blog/flutter-til-5"},"nextItem":{"title":"Flutter TIL - 3","permalink":"/blog/flutter-til-3"}},"content":"---\\n\\n## \uc120\ud0dd\uc801 \ub9e4\uac1c\ubcc0\uc218\\n---\\n\\n```dart\\nColor getColor(WidgetRef ref, bool isInactive, [Color? color]) {}\\n```\\n\\n\uc704\uc640 \uac19\uc740 \ud568\uc218\uac00 \uc788\ub2e4\uace0 \uac00\uc815\ud558\uc790. `[Color? color]` \uc774\ub807\uac8c \ub300\uad04\ud638\ub85c \ubc1b\ub294 \ub9e4\uac1c\ubcc0\uc218\ub294 \ub123\uc5b4\ub3c4 \ub418\uace0 \uc548 \ub123\uc5b4\ub3c4 \ub418\ub294 \uc120\ud0dd\uc801 \ub9e4\uac1c\ubcc0\uc218\uc774\ub2e4.\\n\\n\\n## svg icon\uc5d0 \ub300\ud574\uc11c\\n---\\n\\n\uc9c0\uae08 \uc800\ub294 IconButton\uc744 \uc0ac\uc6a9\ud558\uc9c0 \uc54a\uace0 Custom\uc73c\ub85c Button\uc704\uc82f\uc744 \ub9cc\ub4e4\uc5b4\uc11c \uc0ac\uc6a9\ud558\uace0 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n\uc774 \ub54c \ubc84\ud2bc \ub4f1 \ub2e4\uc591\ud55c \uac12\ub4e4\uc744 `GestureDetector`\uc758 `Row` \uc704\uc82f\uc73c\ub85c \uac10\uc2f8\uc544\uc11c \ud588\ub294\ub370 width\uac00 \ub118\uc5b4\uac14\ub2e4\ub294\uace0 \ud558\ub124\uc694.. \uadf8\ub798\uc11c appbar\uac00 \uc880 \ubc00\ub824\ubcf4\uc600\uc2b5\ub2c8\ub2e4.\\n\\nsvg\ud30c\uc77c\uc758 \ud06c\uae30\ub97c \uc904\uc5ec\uc57c \ud569\ub2c8\ub2e4. vs code\uc5d0\uc11c \uc704\uc82f\ud2b8\ub9ac \ub514\ubc84\uae45 \ud655\uc778\ud574\ubcf4\uba70 Row\uc5d0 \ud560\ub2f9\ub41c width\ub97c \ud655\uc778\ud558\uace0 \uadf8 \uc774\ud558\ub85c svg \ud30c\uc77c \ud06c\uae30\ub97c \uc904\uc774\uba74 \ud574\uacb0\ub429\ub2c8\ub2e4.\\n\\n## NaviagtionRail\\n---\\n\\nnavigationRail\uc744 \uc0ac\uc6a9\ud558\uba74 \uc0ac\uc774\ub4dc \ub124\ube44\uac8c\uc774\uc158 \ubc14\ub97c \uc0ac\uc6a9\ud560 \uc218 \uc788\ub2e4.\\n\\n`NavigationRail`\uc548\uc5d0 `NavigationRailDestination`\uc73c\ub85c Navigator\ub97c \ud558\ub098\ud558\ub098 \uc815\uc758\ud560 \uc218 \uc788\ub2e4.\\n\\n`selectedIndex`\uac00 \ud544\uc218\ub85c \ud544\uc694\ud558\ub2e4.\\n\\n`onDestinationSelected`\ub85c \uc5b4\ub5a4 \uac83\uc744 \uc120\ud0dd\ud588\ub294\uc9c0 \uc815\uc758\ud560 \uc218 \uc788\ub2e4. setState\ub85c\ub3c4 \ud560 \uc218 \uc788\ub294\ub370 provider\ub97c \uc0ac\uc6a9\ud574\uc11c watch\ud574\uc11c \uc0ac\uc6a9\ud560 \uc218\ub3c4 \uc788\ub2e4.\\n\\n\uc608\ub97c \ub4e4\uc5b4\uc11c `selectedIndex`\ub97c state\ub97c watch\ud558\uace0 `onDestinationSelected`\uc5d0\ub294 \uac12\uc744 \ubc14\uafd4\uc8fc\ub294 \ud568\uc218\ub97c \uc815\uc758\ud574\uc11c read\ub85c \ud638\ucd9c\ud558\uba74 \ub420 \ub4ef\\n\\n`selectedIconTheme`\uacfc `unselectedIconTheme`\uc744 \ud1b5\ud558\uc5ec \ud14c\ub9c8 \uc9c0\uc815 \uac00\ub2a5 \uc544\uc9c1\uc740 \ud070 \ud544\uc694\uc131 \ubaa8\ub974\uaca0\ub2e4.\\n\\ntrailing\uc744 \uc0ac\uc6a9\ud558\uba74 \ub9e8 \ubc11\uc5d0 \ubc84\ud2bc \uac19\uc740 \uac78 \ub9cc\ub4e4 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n\uc774 \uacfc\uc815\ub3c4 \ubcf5\uc7a1\ud588\ub294\ub370 Expanded\uc640 Align \uc744 \uc0ac\uc6a9\ud574\uc57c \ud560 \uc218 \uc788\uc5c8\uc2b5\ub2c8\ub2e4. \uc774\uc5d0 \ub300\ud574\uc11c\ub294 \ub610 \ucc3e\uc544\ubd10\uc57c\uaca0\ub124\uc694\\n\\n## body\uc5d0 border-radius\\n---\\n\\n\uc0ac\uc2e4 body\uc5d0 border-radius\uc918\ub3c4 \uc548\ubc14\ub010\ub2e4 \uc65c\ub0d0\ud558\uba74 \ubc30\uacbd\uc0c9\uacfc \uc0c9\uc774 \uac19\uc544\uc11c\\n\\n\uadf8\ub798\uc11c body\ub97c \uc774\ub8e8\uace0 \uc788\ub294 Row\uc704\uc82f\uc744 ColorBox\ub85c \uac10\uc309\ub2c8\ub2e4. \uadf8\ub807\uac8c \ubc30\uacbd\uc0c9\uc744 \uc8fc\uace0 \ubc11\uc5d0\uc11c Container\uc5d0 \ud574\ub2f9\ud588\ub358 \ubd80\ubd84(\uae30\uc874\uc5d0 border-radius\ub97c \uc92c\ub358 \ubd80\ubd84)\uc744 Expanded\ub85c \ud655\uc7a5\uc2dc\ud0b5\ub2c8\ub2e4 \uadf8\ub7fc \ub05d !"},{"id":"flutter-til-3","metadata":{"permalink":"/blog/flutter-til-3","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2023-12-20-til3/index.md","source":"@site/blog/2023-12-20-til3/index.md","title":"Flutter TIL - 3","description":"---","date":"2023-12-20T00:00:00.000Z","formattedDate":"December 20, 2023","tags":[{"label":"TIL","permalink":"/blog/tags/til"},{"label":"\ud50c\ub7ec\ud130","permalink":"/blog/tags/\ud50c\ub7ec\ud130"},{"label":"flutter","permalink":"/blog/tags/flutter"},{"label":"riverpod","permalink":"/blog/tags/riverpod"},{"label":"notifier","permalink":"/blog/tags/notifier"},{"label":"dart \uc0dd\uc131\uc790","permalink":"/blog/tags/dart-\uc0dd\uc131\uc790"}],"readingTime":1.245,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"flutter-til-3","title":"Flutter TIL - 3","authors":["kihyun"],"tags":["TIL","\ud50c\ub7ec\ud130","flutter","riverpod","notifier","dart \uc0dd\uc131\uc790"]},"prevItem":{"title":"Flutter TIL - 4","permalink":"/blog/flutter-til-4"},"nextItem":{"title":"Flutter TIL - 2","permalink":"/blog/flutter-til-2"}},"content":"---\\n\\n## NotifierProvider\uc758 notifier \uba54\uc18c\ub4dc\\n---\\n\\n```dart\\nfinal cartProvider = NotifierProvider<RiverpodCart, List<Product>>(() {\\n  return RiverpodCart();\\n});\\n```\\n\\n\ud50c\ub7ec\ud130\ub294 \uc704\ucc98\ub7fc provider\ub97c \uc704\uc82f\ud2b8\ub9ac\uc5d0 \ub530\ub85c \ub4f1\ub85d\ud558\uc9c0 \uc54a\uace0 \ubcc0\uc218\ub85c \uc120\uc5b8\ud574\uc11c \uc0ac\uc6a9\ud55c\ub2e4.\\n\\n```dart\\nreturn ProductTile(\\n  product: product,\\n  isInCart: ref.watch(cartProvider).contains(product),\\n  onPressed: ref.read(cartProvider.notifier).onProductPressed,\\n);\\n```\\n\\n\uc2e0\uae30\ud55c \uac83\uc774 \uc788\uc5c8\ub2e4. \uc774\ub807\uac8c \uc804\uc5ed\ubcc0\uc218\ub85c \uc120\uc5b8\ud55c \uac83\uc744 watch\ud558\uace0 read\ud558\ub294 \uac83\uc740 \uc774\ud574\ub97c \ud588\ub294\ub370 \uac11\uc790\uae30 `.notifier`.. \uc774\uac74 \ubb50\uc9c0\\n\\n\uc2e4\ud5d8\ud574\ubcf4\uace0 \ucc3e\uc544\ubcf4\ub2c8 `.notifier`\ub97c \ubd99\uc774\uba74 \ud574\ub2f9 provider\uc758 class\ub85c \uc811\uadfc\ud574\uc11c \uadf8 class\uc758 \uba54\uc18c\ub4dc \ub4f1\uc744 \uc0ac\uc6a9\ud560 \uc218 \uc788\ub2e4\ub294 \uac83.\\n\\n\uc989 \uc704\uc5d0\uc11c cartProvider\uc758 `NotifierProvider<RiverpodCart, List<Product>>` \uc911 \uc55e \ubd80\ubd84\uc778 `RiverpodCart`\uc5d0 \uc811\uadfc\ud558\ub294 \ub290\ub08c\uc774\ub2e4.\\n\\n`.notifier`\ub97c \ubd99\uc774\uc9c0 \uc54a\uc73c\uba74 \uc774 provider\uc758 \uc0c1\ud0dc\ub85c \uc811\uadfc\ud558\ub294 \uac83\uc774\ub2e4.\\n\\n\uc989 `List<Product>`\uc5d0 \uc811\uadfc\ud55c\ub2e4. \uadf8\ub798\uc11c contians \uba54\uc18c\ub4dc\ub97c \uc0ac\uc6a9\ud560 \uc218 \uc788\uc5c8\ub2e4.\\n\\n## dart \uc0dd\uc131\uc790\\n\\n---\\n\\n### named parameter\\n\\n\uc0dd\uc131\uc790 \uc548\uc5d0 `{}` \uc911\uad04\ud638\ub85c \ud30c\ub77c\ubbf8\ud130\ub97c \ubb36\uc73c\uba74 named parameter \uac00\ub2a5\\n\\nnamed parameter\ud558\uba74 required \ud560 \uc218\ub3c4 \uc788\ub2e4."},{"id":"flutter-til-2","metadata":{"permalink":"/blog/flutter-til-2","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2023-12-19-til2/index.md","source":"@site/blog/2023-12-19-til2/index.md","title":"Flutter TIL - 2","description":"---","date":"2023-12-19T00:00:00.000Z","formattedDate":"December 19, 2023","tags":[{"label":"TIL","permalink":"/blog/tags/til"},{"label":"\ud50c\ub7ec\ud130","permalink":"/blog/tags/\ud50c\ub7ec\ud130"},{"label":"flutter","permalink":"/blog/tags/flutter"},{"label":"const","permalink":"/blog/tags/const"},{"label":"provider","permalink":"/blog/tags/provider"},{"label":"riverpod","permalink":"/blog/tags/riverpod"}],"readingTime":6.495,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"flutter-til-2","title":"Flutter TIL - 2","authors":["kihyun"],"tags":["TIL","\ud50c\ub7ec\ud130","flutter","const","provider","riverpod"]},"prevItem":{"title":"Flutter TIL - 3","permalink":"/blog/flutter-til-3"},"nextItem":{"title":"Flutter TIL - 1","permalink":"/blog/flutter-til-1"}},"content":"---\\n\\n## const\uc5d0 \ub300\ud574\\n---\\n\\nclass\uc5d0\uc11c \uc0dd\uc131\uc790\ub97c `const`\ub85c \ub9cc\ub4e4\uc9c0 \uc54a\uc558\uc744 \ub54c\\n\\n```dart\\nclass Product {\\n  final int id;\\n  final String name;\\n  final String desc;\\n  final String price;\\n  final String imageUrl;\\n\\n  Product({\\n    required this.id,\\n    required this.name,\\n    required this.desc,\\n    required this.price,\\n    required this.imageUrl,\\n  });\\n}\\n```\\n\\n\uc704\ucc98\ub7fc \ub9cc\ub4e4\uba74 \uc544\ub798 \ucf54\ub4dc\ub294 \uc5d0\ub7ec\ub09c\ub2e4.\\n\\n```dart\\nconst List<Product> storeProductList = [];\\n```\\n\\n\uc0dd\uc131\uc790 Product\uc5d0 `const`\ub97c \ubd99\uc5ec\uc8fc\uba74 \ud574\uacb0\ud560 \uc218 \uc788\ub2e4.\\n\\n## context.read\uc5d0 \ub300\ud574\\n\\n---\\n\\n```dart\\nvoid main() {\\n  runApp(\\n    MultiProvider(\\n      providers: [\\n        ChangeNotifierProvider(\\n          create: (context) => MyCart(),\\n        ),\\n        ChangeNotifierProvider(\\n          create: (context) => MyBadge(myCart: context.read()),\\n        ),\\n      ],\\n      child: MaterialApp(\\n        home: MyApp(),\\n      ),\\n    ),\\n  );\\n}\\n```\\n\\n\ucf54\ub4dc \uc0c1\ud669\uc774 \uc704\uc640 \uac19\uc744 \ub54c \uc5b4\ub5bb\uac8c MyCart\uc758 \uc815\ubcf4\ub97c `contex.read()`\ub85c \uac00\uc838\uc624\ub098 \uc758\ubb38\uc774 \uc788\uc5c8\ub2e4.\\n\\n\ubcf8\ub860\ubd80\ud130 \ub9d0\ud558\uba74\\n\\n```dart\\n        ChangeNotifierProvider(\\n          create: (context) => MyBadge(myCart: context.read<MyCart>()),\\n        ),\\n```\\n\\n\uc704\uc640 \uac19\uc774 \uc0ac\uc6a9\ud558\uba74 \ud5f7\uac08\ub9b4 \uc77c\uc774 \uc5c6\uace0 \uac00\uc838\uc62c \uc218 \uc788\ub294 \uc774\uc720\ub294 `ChangeNotifierProvider`\ub97c \ud1b5\ud574\uc11c `MyCart`\ub97c \uc704\uc82f \ud2b8\ub9ac \uc0c1 \ub4f1\ub85d \ud588\uae30\uc5d0 \ubc14\ub85c \uac00\uc838\uc640\uc9c0\ub294 \uac83\uc774\ub2e4. \ub9cc\uc57d \uc911\uac04\uc5d0 `MyStore` \uac19\uc740 \ub2e4\ub978 \uc704\uc82f\uc774 \uc788\uc5c8\ub2e4\uba74 `MyCart`\ub294 \uc800\ub7f0\uc2dd\uc73c\ub85c \uac00\uc838\uc624\uc9c0 \ubabb\ud55c\ub2e4.\\n\\n## List\uc758 \uac12\uc5d0 const\uc5d0 \ub300\ud574\\n\\n---\\n\\n```dart\\nList<Product> cartProductList = const [];\\n```\\n\\n\ub9ac\uc2a4\ud2b8\uc758 \ubd88\ubcc0\uc744 \ubcf4\uc7a5\ud574\uc8fc\uae30 \uc704\ud574 []\uc55e\uc5d0 `const` \ud0a4\uc6cc\ub4dc\ub97c \ubd99\uc77c \uc218 \uc788\ub2e4. `List<Product>` \uc55e\uc5d0 \ubd99\uc774\ub294 \uac83\uacfc\ub294 \ub2e4\ub974\ub2e4. \ub9ac\uc2a4\ud2b8\ub97c \ubc14\uafc0 \uc218 \uc788\uc9c0\ub9cc(\uc694\uc18c \ub9d0\uace0) \ub9ac\uc2a4\ud2b8\uc5d0 \uc9c1\uc811\uc801\uc778 \uac12\uc744\ucd94\uac00\ud558\uac70\ub098 \uc0ad\uc81c \uc218\uc815\uc740 \ubabb\ud55c\ub2e4.\\n\\n\uc0ad\uc81c\ub97c \uc6d0\ud55c\ub2e4\uba74 where\ub97c \uc0ac\uc6a9\ud560 \uc218 \uc788\ub2e4.\\n\\n```dart\\nlist.where((p)=>p!= product).toList();\\n```\\n\\n\uc704\ucc98\ub7fc \uc791\uc131\ud558\uba74 list\ub97c \ub3cc\uba74\uc11c \ub3cc\uace0 \uc788\ub294 \uac12\uc774 p\uc778\ub370 product\uc640 \ube44\uad50\ud558\uba74\uc11c product\ub294 \ube7c\uace0 \ub2e4\uc2dc \ub9ac\uc2a4\ud2b8\ub97c \ub9cc\ub4dc\ub294 \ucf54\ub4dc\uc774\ub2e4.\\n\\n\ucd94\uac00\ub97c \uc6d0\ud55c\ub2e4\uba74\\n\\n```dart\\n[...list,product]\\n```\\n\\n\uc544\ub798\ucc98\ub7fc \uac04\ub2e8\ud558\uac8c `...`\uc5f0\uc0b0\uc790\ub97c \uc0ac\uc6a9\ud560 \uc218 \uc788\ub2e4.\\n\\n## dart \uc790\ub3d9 \ub9e4\uac1c\ubcc0\uc218..?\\n\\n---\\n\\n```dart\\n  void onProductPressed(Product product) {\\n    if (cartProductList.contains(product)) {\\n      cartProductList = cartProductList.where((p) => p != product).toList();\\n    } else {\\n      cartProductList = [...cartProductList, product];\\n    }\\n    notifyListeners();\\n  }\\n```\\n\\n\uc774\ub807\uac8c \ub9e4\uac1c\ubcc0\uc218\uac00 \ud544\uc694\ud55c \ud568\uc218\ub85c \uad6c\ud604\ub3fc\uc788\ub294\ub370\\n\\n```dart\\n      return ProductTile(\\n        product: product,\\n        isInCart: providerCart.cartProductList.contains(product),\\n        onPressed: providerCart.onProductPressed,\\n      );\\n```\\n\\n\uc774\ub807\uac8c \uc0ac\uc6a9\ud558\uae38\ub798 \uae5c\uc9dd \ub180\ub790\ub2e4. \ubb54\uac00 \uc2f6\uc5c8\ub294\ub370 ProductTile class\uc5d0 \ube44\ubc00\uc774 \uc788\uc5c8\ub2e4.\\n\\n```dart\\n  final Product product;\\n  final bool isInCart;\\n  final void Function(Product product) onPressed;\\n```\\n\\n\uc774\ub807\uac8c onPressed\uac00 \uad6c\ud604\ub3fc\uc788\uc73c\uba74 product\ub97c \ub123\uc9c0 \uc54a\uc544\ub3c4 \uc54c\uc544\uc11c \ub123\uc5b4\uc900\ub2e4\uace0..\\n\\nproduct\ub97c \ub123\uc9c0 \uc54a\uc558\ub294\ub370 \uc5b4\ub5bb\uac8c \uc544\ub0d0\uad6c\uc694? ProductTile \uc704\uc82f\uc744 \ub9cc\ub4e4 \ub54c product\uac12\uc744 \uc804\ub2ec\ud558\uae30 \ub54c\ubb38\uc5d0 \uc778\uc9c0\ud560 \uc218 \uc788\ub2e4\uace0 \ud558\ub124\uc694 !\\n\\n\uc815\ub9ac\ud558\uc790\uba74 \ud2b9\uc815 \uc704\uc82f\uc5d0 a\ub77c\ub294 \uac12\uc744 \ud1b5\ud574\uc11c \uad6c\ud604\ud558\uace0 \uadf8 a\ub77c\ub294 \uac12\uc744 \ub9e4\uac1c\ubcc0\uc218\ub85c \uc0ac\uc6a9\ud558\ub294 \ud568\uc218\uac00 \uc788\uc744 \ub54c \ub2e4\ub978 \ud568\uc218\ub3c4 \uadf8 a\ub77c\ub294 \uac12\uc744 \ud544\uc694\ub85c \ud55c\ub2e4\uba74 \uc0ac\uc6a9\ud558\uc9c0 \uc54a\ub294\ub2e4.. \ub77c\ub294 \uac83\uc785\ub2c8\ub2e4. \uadfc\ub370 100% \uc774\ud574\ub97c \ubabb\ud588\ub2e4. \ub9c8\uc74c\uc5d0 \ub2f4\uc544\ub450\uc790.\\n\\n## context.read() 2\\n\\n---\\n\\n\ud55c \uac00\uc9c0\ub97c \ub354 \uc774\ud574\ud574 \ubc84\ub838\ub2e4.\\n\\n\uc704\uc82f \ud2b8\ub9ac \uc0c1\uc5d0 \ub4f1\ub85d\ud574\uc11c context\ub85c \uac00\uc838\uc62c \uc218 \uc788\ub2e4\uba74\\n\\n```dart\\ncontext.read<ProviderCart>().onProductPressed\\n```\\n\\n\uc704 \ucc98\ub7fc ProviderCart\uc758 \ud568\uc218\ub97c \uac00\uc838\uc62c \uc218 \uc788\ub2e4.\\n\\n## context.select()\\n\\n---\\n\\n\uc774\uac70 \uc880 \uc774\uc0c1\ud558\uae34 \ud558\ub2e4. \uadf8\ub798\uc11c \uc774\uc81c \uc644\ubcbd\ud788 \uc774\ud574\ud588\ub2e4.\\n\\n`context.watch()` : Provider\uc758 \ubaa8\ub4e0 \uc0c1\ud0dc\ub97c \uad6c\ub3c5\ud55c\ub2e4.\\n\\n`context.select()`: Provider\uc758 \ud2b9\uc815 \uc0c1\ud0dc\ub97c \uad6c\ub3c5\ud55c\ub2e4.\\n\\n```dart\\nfinal count = context.select<Counter,int>((counter) => counter.count);\\n```\\n\\n\uc704 \ucc98\ub7fc \uc0ac\uc6a9\ud558\uae30 \ub54c\ubb38\uc5d0 select\ub294 \ud2b9\uc815 \uc0c1\ud0dc \uad6c\ub3c5 \uac00\ub2a5\\n\\n`context.read()`: \uad6c\ub3c5\uc548\ud558\uace0 \ud604\uc7ac \uc0c1\ud0dc \uadf8\ub0e5 \uac00\uc838\uc624\uae30\\n\\n\ub4dc\ub514\uc5b4 context 3\ud615\uc81c\ub294 \uc774\ud574\ud55c\ub4ef\\n\\n## Riverpod\\n\\n---\\n\\nprovider \ub9cc\ub4e0 \uc0ac\ub78c\uc774 \ub9cc\ub4e0\uac70\ub77c\uace0 \ud574\uc11c provider\ub791 \ube44\uc2b7\ud560 \uc904 \uc54c\uc558\ub294\ub370 \ub2e4\ub974\ub2e4.\\n\\nprovider \ub4f1\ub85d\uc744 MultiProvider\uc5d0 \ub4f1\ub85d\ud558\ub294 \uac83\uc774 \uc544\ub2cc \uadf8\ub0e5 \uc804\uc5ed \ubcc0\uc218\ub85c \ub4f1\ub85d\ud55c\ub2e4. \ubcc4\ub3c4 \ubcc0\uc218\uc5d0 \ud560\ub2f9\ud558\uae30 \ub54c\ubb38\uc5d0 \uac19\uc740 Provider\ub97c \ub2e4\ub978 \ubcc0\uc218\uc5d0 \ud560\ub2f9\ud560 \uc218 \uc788\ub2e4. \uadf8\ub9ac\uace0 BuildContex\ub97c \uc0ac\uc6a9\ud558\uc9c0 \uc54a\uace0 \ubcc4\ub3c4\uc758 WidgetRef\ub77c\ub294 \uac83\uc744 \uc0ac\uc6a9\ud55c\ub2e4.\\n\\n:::tip \ubcc0\uacbd\uc810 \uc815\ub9ac\\n\\n1. provider\ub97c \uc804\uc5ed \ubcc0\uc218\ub85c \uc120\uc5b8\ud574\uc11c \uc0ac\uc6a9\\n2. BuildContext \ub300\uc2e0 WidgetRef \uc0ac\uc6a9\\n   :::\\n\\n\ub098\uba38\uc9c0\ub294 \ucc28\ucc28 \uc54c\uc544\uac00\ubcf4\ub294\uac78\ub85c\\n\\n`StatelessWidget`\uc740 `ConsumerWidget`\uc73c\ub85c \ubc14\uafd4\uc57c\ud55c\ub2e4.\\n\uadf8\ub9ac\uace0 `build()`\uba54\uc18c\ub4dc \ud30c\ub77c\ubbf8\ud130\uc5d0 `WidgetRef ref`\ub97c \ucd94\uac00\ud574\uc57c ref\uc0ac\uc6a9\ud560 \uc218 \uc788\ub2e4.\\n\\n`StatefulWidget`\uc740 `ConsumerStatefulWidget`\uc73c\ub85c \ubc14\uafd4\uc57c \ud55c\ub2e4.\\n\\n\ubc14\uafb8\uae30 \uc2eb\uc73c\uba74 `Consumer` \uc704\uc82f\uc73c\ub85c \uac10\uc2f8\uc11c \uc0ac\uc6a9\ud560 \uc218 \uc788\ub2e4.\\n\\n### provider \uc885\ub958\\n\\n1. `StateProvider` : \ubcc4\ub85c \ud074\ub798\uc2a4 \uc120\uc5b8 \uc5c6\uc774 \uac00\ubccd\uac8c \uc0ac\uc6a9\ud560 \uc218 \uc788\ub2e4.\\n\\n2. `NotifierProvider` : \ud074\ub798\uc2a4\ub97c \ub9cc\ub4e4\uc5b4\uc11c \uc0ac\uc6a9\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n3. `Provider` : \uae30\uc874 Provider\uc758 Provider\uc640 \uac19\uc74c \uc989 \uc0c1\ud0dc\uac00 \uc5c6\ub294 Provider\ub4e4\\n\\n### \uc7a1\uae30\uc220\\n\\n1. `AutoDispose` : `NotifierProvider`\ub4a4\uc5d0 `.autoDispose`\ub97c \ubd99\uc774\uace0 `Notifier` extends\ud55c \uac83\uc744 `AutoDisposeNotifier`\ub85c \uc218\uc815\ud558\uba74 \ub429\ub2c8\ub2e4. \uc790\ub3d9\uc73c\ub85c dispose \ud574\uc90d\ub2c8\ub2e4.\\n\\n2. `family` : `NotifierProvider`\ub4a4\uc5d0 `family`\ub97c \ucd94\uac00\ud574\uc11c \uc0ac\uc6a9\ud558\uba74 \ub418\ub290\ub370 \ub9e4\uac1c\ubcc0\uc218 \ud0c0\uc785\uc744 \ucd94\uac00\ud574\uc8fc\uba74 `build()`\uc5d0 \ub9e4\uac1c\ubcc0\uc218 \ucd94\uac00\ud574\uc11c \uc0ac\uc6a9\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n3. `AutoDisposeFamilyNotifier` : 1,2\ubc88\uc744 \ud569\uce5c \uac83.\\n\\n## Error: Unable to find git in your PATH.\\n\\n---\\n\\n\uac04\ud639 flutter\ub97c \ucc98\uc74c\ud560 \ub54c \uc544\ub798\uc640 \uac19\uc740 \uc5d0\ub7ec\uac00 \uad34\ub86d\ud78c\ub2e4.\\n\\n```bash\\nError: Unable to find git in your PATH.\\n```\\n\\n```bash\\ngit config --global --add safe.directory \'*\'\\n```\\n\\n\uc704 \uba85\ub839\uc5b4\ub85c \ud574\uacb0\ud560 \uc218 \uc788\uc74c \uc800\uc7a5\uc18c \uad8c\ud55c \ubb38\uc81c\uc778 \uac83\uac19\ub2e4. \uad00\ub9ac\uc790 powershell\uc740 flutter \ub410\uc5c8\uc74c"},{"id":"flutter-til-1","metadata":{"permalink":"/blog/flutter-til-1","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2023-12-16-til1/index.md","source":"@site/blog/2023-12-16-til1/index.md","title":"Flutter TIL - 1","description":"---","date":"2023-12-16T00:00:00.000Z","formattedDate":"December 16, 2023","tags":[{"label":"TIL","permalink":"/blog/tags/til"},{"label":"\ud50c\ub7ec\ud130","permalink":"/blog/tags/\ud50c\ub7ec\ud130"},{"label":"flutter","permalink":"/blog/tags/flutter"},{"label":"Bloc","permalink":"/blog/tags/bloc"}],"readingTime":2.46,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"flutter-til-1","title":"Flutter TIL - 1","authors":["kihyun"],"tags":["TIL","\ud50c\ub7ec\ud130","flutter","Bloc"]},"prevItem":{"title":"Flutter TIL - 2","permalink":"/blog/flutter-til-2"},"nextItem":{"title":"MVVM \uc544\ud0a4\ud14d\ucc98","permalink":"/blog/mvvm"}},"content":"---\\n\\n\uc77c\ub2e8 vs code \ud655\uc7a5\uc740 `bloc`, `dart data class generator`, `dart-import`, `pubspec assist`\\n\\n`dart data class generator`\uac00 \uc788\uc73c\uba74 \ucf54\ub4dc \uc790\ub3d9 \uc0dd\uc131\uc744 \ud3b8\ud558\uac8c \ud574\uc900\ub2e4. (copyWith, constructor \ub4f1.. )\\n\\n`pubspec assist`\uac00 \uc788\uc73c\uba74 \ud328\ud0a4\uc9c0\ub97c \uc27d\uac8c \ub123\uc744 \uc218 \uc788\uc74c\\n\\n## Bloc\uc5d0 \ub300\ud574\uc11c\\n\\n---\\n\\n\uc601\uc0c1\uc744 \ubcf4\uba70 \ub530\ub77c\ud558\uba74\uc11c \uc800\ubc88\uc8fc\uc5d0 KOSTA\uc5d0\uc11c \ubc30\uc6b4 Bloc \uc0ac\uc6a9\ubc95\uc5d0 \ub300\ud574 \uc775\ud788\uace0 \uc788\uc5c8\ub2e4.\\n\\n\uc601\uc0c1\uc740 \ub2e4\ub978 \ubc29\uc2dd\uc774\ub77c \ud5f7\uac08\ub838\ub294\ub370 VS Code\uc758 Bloc extension\uc744 \uc0ac\uc6a9\ud558\uc5ec New Bloc\uc744 \ud574\uac00\uc9c0\uad6c Bloc\uc744 \ub9cc\ub4e4\uc5c8\ub2e4.\\n\\n3\uac1c\uc758 \ud30c\uc77c\uc774 \ub098\uc628\ub2e4. `bloc`,`event`,`state`\\n\\n### state\\n\\n```dart\\nclass TasksState extends Equatable {\\n  const TasksState({\\n    this.allTasks = const <Task>[],\\n  });\\n\\n  final List<Task> allTasks;\\n\\n  @override\\n  List<Object> get props => [allTasks];\\n}\\n```\\n\\n\ud604\uc7ac state\uc5d0\ub294 `List<Task>` \ud0c0\uc785\uc758 allTasks\ub77c\ub294 \uc0c1\ud0dc\uac00 \ud558\ub098 \uc788\ub2e4.\\n\\n\uc5ec\ub7ec \uac1c \ucd94\uac00\ud558\uba74 \uc5ec\ub7ec \uac1c \ub418\ub294\ub4ef?\\n\\n### event\\n\\n```dart\\nsealed class TasksEvent extends Equatable {\\n  const TasksEvent();\\n\\n  @override\\n  List<Object> get props => [];\\n}\\n\\nclass AddTask extends TasksEvent {\\n  final Task task;\\n  const AddTask({\\n    required this.task,\\n  });\\n\\n  @override\\n  List<Object> get props => [task];\\n}\\n\\nclass UpdateTask extends TasksEvent {\\n  final Task task;\\n  const UpdateTask({\\n    required this.task,\\n  });\\n\\n  @override\\n  List<Object> get props => [task];\\n}\\n\\nclass DeleteTask extends TasksEvent {\\n  final Task task;\\n  const DeleteTask({\\n    required this.task,\\n  });\\n\\n  @override\\n  List<Object> get props => [task];\\n}\\n\\n```\\n\\n\uc774\ub807\uac8c \uc11c\ube44\uc2a4\ub4e4 \ub9cc\ub4e4 \uc218 \uc788\ub2e4. \ud604\uc7ac \uc804\ubd80 \uad6c\ud604\ub41c\uac74 \uc544\ub2cc.. \uac70\uac19\uc740\ub370 \uc77c\ub2e8 \uc774\ub530 \uc218\uc815\\n\\n### bloc\\n\\n\ud558\ub2e4\uac00 \uae68\ub2ec\uc558\ub2e4.\\n\\n```dart\\nclass TasksBloc extends Bloc<TasksEvent, TasksState> {\\n  TasksBloc() : super(const TasksState()) {\\n    on<AddTask>(_onAddTask);\\n  }\\n\\n  void _onAddTask(AddTask event, emit) {\\n    emit(TasksState(\\n      allTasks: [...state.allTasks, event.task],\\n    ));\\n  }\\n}\\n```\\n\\nBloc\uc744 extends \ud560 \ub54c `Bloc<event, state>`\ub85c \ud558\ub77c\uace0 \ubc30\uc6e0\ub2e4. \uadfc\ub370 \ud560 \ub54c state\ub97c `int`\ub098 `bool`\uac19\uc740 \ud0c0\uc785\uc73c\ub85c\ub9cc \uc9c0\uc815\ud574\uc918\uc11c \uadf8\ub0e5 state\ub85c \uc0ac\uc6a9\ud558\uba74 \ub410\uc5c8\ub294\ub370 class\ub85c state \ud0c0\uc785 \uc9c0\uc815\ud574\uc8fc\ub2c8 state.allTasks\ub85c \ud574\uc57c \ud558\ub354\ub77c..\\n\\n### \uae68\ub2ec\uc74c\\n\\nbloc\uc5d0\uc11c \ud070 \uc2e4\uc218\uac00 \uc788\uc5c8\ub2e4. \uc704\ucf54\ub4dc \ucc98\ub7fc \uc791\uc131\ud558\uba74 \ub418\ub294\ub370 \ucf54\ub4dc \uc218\ub97c \uc904\uc5ec\ubcf4\uaca0\ub2e4\uace0\\n\\n```dart\\n  void _onAddTask(AddTask event, emit) {\\n    emit(\\n      [...state.allTasks, event.task],\\n    );\\n  }\\n```\\n\\n\uc704\ucc98\ub7fc \uc791\uc131\ud588\ub2e4\uac00 \uc791\ub3d9\uc744 \uc548\ud574\uc11c \uc0b4\uc9dd \uc5b4\uc9c0\ub7ec\uc6e0\ub2e4.\\n\\nBloc\uc774 `Bloc<TasksEvent,TasksState>`\uc774\ub2c8 TasksState type\uc5d0 \ub9de\ucdb0\uc918\uc57c \ud558\ub098\ubcf4\ub2e4."},{"id":"mvvm","metadata":{"permalink":"/blog/mvvm","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2023-12-15-mvvm/index.md","source":"@site/blog/2023-12-15-mvvm/index.md","title":"MVVM \uc544\ud0a4\ud14d\ucc98","description":"---","date":"2023-12-15T00:00:00.000Z","formattedDate":"December 15, 2023","tags":[{"label":"KOSTA","permalink":"/blog/tags/kosta"},{"label":"\ud50c\ub7ec\ud130","permalink":"/blog/tags/\ud50c\ub7ec\ud130"},{"label":"flutter","permalink":"/blog/tags/flutter"},{"label":"mvvm","permalink":"/blog/tags/mvvm"}],"readingTime":1.42,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"mvvm","title":"MVVM \uc544\ud0a4\ud14d\ucc98","authors":["kihyun"],"tags":["KOSTA","\ud50c\ub7ec\ud130","flutter","mvvm"]},"prevItem":{"title":"Flutter TIL - 1","permalink":"/blog/flutter-til-1"},"nextItem":{"title":"\ud14c\uc2a4\ud2b8 \ucf54\ub4dc","permalink":"/blog/test code"}},"content":"---\\n\\n## \uad00\uc2ec\uc0ac \ubd84\ub9ac\\n---\\n\\n\ubaa8\ub4c8 \ubcc4 \uacbd\uacc4\ub97c \ub098\ub204\uace0 \ubaa8\ub4c8\uac04 \uc57d\uc18d\uc744 \uc815\ud558\ub294 \uac83 like a \uc804\uae30 \ucf58\uc13c\ud2b8\uc640 \ud50c\ub7ec\uadf8\uc758 \uad00\uacc4\ub77c\uace0 \ud55c\ub2e4.\\n\\n\\n## MVVM \uc774\ub860\\n---\\n\\n`View`\uc640 `ViewModel` \uadf8\ub9ac\uace0 `Model`\uc744 \ub098\ub204\uc5b4 View\ub97c \uc27d\uac8c \ubcc0\uacbd\ud560 \uc218 \uc788\ub294 \ubaa9\uc801\uc744 \uac16\uace0 \uc788\ub294 \uc544\ud0a4\ud14d\ucc98 \ud328\ud134\\n\\n:::tip \uc5ed\ud560\\n`View` : UI  \\n`ViewModel`: View \uc0c1\ud0dc \ubc0f \ub85c\uc9c1 \ub2f4\ub2f9  \\n`Model`: \ube44\uc9c0\ub2c8\uc2a4 \ub85c\uc9c1\uacfc \ub370\uc774\ud130 \uc785\ucd9c\ub825 \ub2f4\ub2f9\\n:::\\n\\n\ud575\uc2ec\uc740 `\ub370\uc774\ud130 \ubc14\uc778\ub529`\uc774\ub2e4.\\n\\n`\ub370\uc774\ud130 \ubc14\uc778\ub529`\uc774\ub780 \uac04\ub2e8\ud788 \ub9d0\ud558\uba74 ViewModel\uacfc View\uac00 \uc11c\ub85c\ub97c \uc758\uc874\ud558\uc9c0 \uc54a\ub294 \uac83 `Provider` \ud328\ud0a4\uc9c0\ub97c \uc0ac\uc6a9\ud574\uc11c \ub370\uc774\ud130 \ubc14\uc778\ub529 \uc774\uc6a9\ud55c\ub2e4\ub294\ub370 \ub098\ub294 Bloc\ub97c \uc0ac\uc6a9\ud574\uc11c \ud558\uace0 \uc2f6\ub2e4.. \ub2f9\uc7a5\uc740 Provider\ub85c \uad6c\ud604\ud574\ubcf4\uae30\\n\\n\ud398\uc774\uc9c0 \ub9c8\ub2e4 \ud558\ub098\uc758 ViewModel\uc774 \uc788\uc5b4\uc57c \ud558\uace0 ViewModel\uc740 View\uc758 \uc0c1\ud0dc\uc640 \ub85c\uc9c1\uc744 \uad00\ub9ac\ud55c\ub2e4.\\n\\nModel\uc740 `Service`, `Model`, `Repository`\uac00 \uc788\ub294\ub370 `Service`\ub294 \uc804\uc5ed \uc0c1\ud0dc\uc640 \ube44\uc9c0\ub2c8\uc2a4 \ub85c\uc9c1\uc744 \uad00\ub9ac\ud558\uace0 `Model`\uc740 \ub370\uc774\ud130 `Repository`\ub294 \ub370\uc774\ud130 \uc694\uccad \ub85c\uc9c1\uc744 \ub2f4\ub2f9\ud55c\ub2e4.\\n\\n\uac4d \ubb54\uac00 \uc5b4\ub824\uc6c0 \ub9ce\uc774 \uc5f0\uc2b5\ud574\ubd10\uc57c\uaca0\ub2e4."},{"id":"test code","metadata":{"permalink":"/blog/test code","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2023-12-15-testcode/index.md","source":"@site/blog/2023-12-15-testcode/index.md","title":"\ud14c\uc2a4\ud2b8 \ucf54\ub4dc","description":"---","date":"2023-12-15T00:00:00.000Z","formattedDate":"December 15, 2023","tags":[{"label":"KOSTA","permalink":"/blog/tags/kosta"},{"label":"\ud50c\ub7ec\ud130","permalink":"/blog/tags/\ud50c\ub7ec\ud130"},{"label":"flutter","permalink":"/blog/tags/flutter"},{"label":"\ud14c\uc2a4\ud2b8 \ucf54\ub4dc","permalink":"/blog/tags/\ud14c\uc2a4\ud2b8-\ucf54\ub4dc"},{"label":"test code","permalink":"/blog/tags/test-code"}],"readingTime":4.005,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"test code","title":"\ud14c\uc2a4\ud2b8 \ucf54\ub4dc","authors":["kihyun"],"tags":["KOSTA","\ud50c\ub7ec\ud130","flutter","\ud14c\uc2a4\ud2b8 \ucf54\ub4dc","test code"]},"prevItem":{"title":"MVVM \uc544\ud0a4\ud14d\ucc98","permalink":"/blog/mvvm"},"nextItem":{"title":"\uc640\uc774\uc5b4\uc0e4\ud06c","permalink":"/blog/kosta3"}},"content":"---\\n\\n[\ud14c\uc2a4\ud2b8 \ucf54\ub4dc \uc791\uc131 \uc694\ub839](https://github.com/flutter/flutter/tree/master/packages/flutter/test/material)\\n\\n\ud14c\uc2a4\ud2b8 \ucf54\ub4dc\ub97c \uc791\uc131\ud558\uba74 \uae30\ub2a5\ub4e4\uc758 \uc758\uc874\uc131\ub3c4 \ud655\uc778\ud560 \uc218 \uc788\uace0 \ud14c\uc2a4\ud2b8\ud560 \uae30\ub2a5\uc774 \ub9ce\uc544\uc9c8 \uc218\ub85d \uc790\ub3d9\ud654 \ud574\ub193\uba74 \uc88b\ub2e4.\\n\\n:::tip \ud14c\uc2a4\ud2b8 \uc885\ub958\\n`\ub2e8\uc704 \ud14c\uc2a4\ud2b8 ( Unit Test )`: \ud2b9\uc815 \ud568\uc218 \ubc0f \ud074\ub798\uc2a4 \ud14c\uc2a4\ud2b8  \\n`\uc704\uc82f \ud14c\uc2a4\ud2b8 ( Widget Test )`: \ub2e8\uc77c \uc704\uc82f \ud14c\uc2a4\ud2b8  \\n`\ud1b5\ud569 \ud14c\uc2a4\ud2b8 ( Integration Test )`: \uc571\uc758 \uc804\uccb4\uc801\uc778 \ud14c\uc2a4\ud2b8 \ub3d9\uc791\\n:::\\n\\n## \ub2e8\uc704 \ud14c\uc2a4\ud2b8\\n---\\n\\n\ub0b4\uc7a5 \ud14c\uc2a4\ud2b8\ub85c \ud14c\uc2a4\ud2b8\ub97c \uc9c4\ud589\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n\ud14c\uc2a4\ud2b8 \ud30c\uc77c\uc740 `\ud30c\uc77c\uc774\ub984_test.dart`\uc5ec\uc57c \ud55c\ub2e4. \uc989 `_test.dart`\ub85c \ub05d\ub098\uc57c \ud568\\n\\n:::tip \ud14c\uc2a4\ud2b8 \uad00\ub828 \ud568\uc218\\n`test()`: \ud14c\uc2a4\ud2b8 \uc2dc\uc791\\n`expect()`: \uac12 \uac80\uc99d  \\n`group()`: \ud14c\uc2a4\ud2b8 \uadf8\ub8f9 \ub9cc\ub4e4\uae30  \\n`setUp()`: \ud14c\uc2a4\ud2b8 \uc2dc\uc791 \uc804 \uc2e4\ud589\ud558\ub294 \ud568\uc218(\uacc4\uc18d \ud14c\uc2a4\ud2b8 \uc2dc\uc791\ud560 \ub54c\ub9c8\ub2e4 \uc2e4\ud589)  \\n`setUpAll()`: \ucd5c\ucd08 \ud55c \ubc88\ub9cc \uc2e4\ud589  \\n`tearDown()`: \ud14c\uc2a4\ud2b8 \ud6c4 \uc2e4\ud589  \\n`tearDownAll()`: \ud14c\uc2a4\ud2b8 \uc885\ub8cc \ud6c4 \ub9c8\uc9c0\ub9c9 \ud55c \ubc88 \uc2e4\ud589\\n:::\\n\\n\ud14c\uc2a4\ud2b8\ub97c \ud558\ub2e4\ubcf4\uba74 \uc65c\ud558\ub098 \uc2f6\uc744 \uc218 \uc788\ub294\ub370 \ubcc0\uacbd\uc5d0 \ub300\ucc98\ud558\uae30 \uc704\ud574\uc11c \uc791\uc131\ud558\ub294 \uac83\uc784. \uc644\uc804 \ubcc0\ud55c\ub2e4\uba74 \ub610 \uc758\ubbf8\uac00 \uc5c6\uc5b4\uc9c0\uae34\ud558\ub294\ub370 \ub9ac\ud329\ud1a0\ub9c1 \ud588\uc744 \ub54c \uac80\uc99d\ud558\ub294 \ub290\ub08c\uc774\ub824\ub098 \uc544\uc9c1\uc740 \uc798 \ubaa8\ub974\uaca0\ub2e4.\\n\\n\\n### Mock Object\\n\\napi \ud1b5\uc2e0 \ud14c\uc2a4\ud2b8 \uac19\uc740 \uacbd\uc6b0 \uc678\ubd80 \ubcc0\uc218\uac00 \ub9ce\uc544\uc11c mock object\ub85c \ud55c\ub2e4.\\n\\n\uc65c\ub0d0\ud558\uba74 \uc2e4\uc81c \uc694\uccad \uc751\ub2f5\uc740 \ubcc0\uc218\uac00 \ub9ce\uc544\uc11c... \uc7ac\ud604\uc774 \uc5b4\ub835\ub2e4. \uadf8\ub9ac\uace0 \uc2e4\uc81c\ub85c \uc11c\ubc84 \uc751\ub2f5 \uc2e4\ud328 \ud14c\uc2a4\ud2b8 \uac19\uc740 \uacbd\uc6b0\ub3c4 \uc27d\uc9c0 \uc54a\ub2e4. mock object\ub97c \uc0ac\uc6a9\ud558\uba74 \uc27d\uac8c \ud560 \uc218 \uc788\ub2e4.\\n\\nmockito\ub791 build_runner\ub97c \uc0ac\uc6a9\ud55c\ub2e4\uace0 \ud55c\ub2e4.\\n\\nmockito\ub85c \uc5b4\ub178\ud14c\uc774\uc158 \ub2ec\uace0 build_runner\ub85c \ucf54\ub4dc \uc0dd\uc131\ud558\ub294 \uac70\uc784\\n\\n\\n### DI ( Dependency Injection )\\n\\ndi\ub97c \ud558\ub294\ub370 \uc0dd\uc131\uc790\ub97c \ud1b5\ud574 \uc678\ubd80 \ucf54\ub4dc\ub97c \ubc1b\ub294\ub2e4\uc778 \uac04\ub2e8\ud55c \uac1c\ub150\uc774\ub77c\uace0 \ud55c\ub2e4.\\n\\n  \\n  \\n\\n## \uc704\uc82f \ud14c\uc2a4\ud2b8\\n---\\n\\n\uc0c1\ud638\uc791\uc6a9, \uc0dd\uae40\uc0c8, \uc0c1\ud0dc \ud655\uc778\uc744 \ud14c\uc2a4\ud2b8 \ud55c\ub2e4\uace0 \ud55c\ub2e4.\\n\\n\\n:::tip \uc704\uc82f \ud14c\uc2a4\ud2b8\\n`testWidgets()`: \ud14c\uc2a4\ud2b8 \uc9c4\ud589  \\n`pump()`: \ud654\uba74 \uac31\uc2e0  \\n`find.text()`: \ud2b9\uc815 \ud14c\uc2a4\ud2b8 \uac80\uc0c9  \\n`find.byType()`: \ud2b9\uc815 \ud074\ub798\uc2a4\uc758 \ud0c0\uc785\uacfc \uc77c\uce58\ud558\ub294 \uc704\uc82f \uac80\uc0c9  \\n`tester.widget()`: \ud2b9\uc815 \ud0c0\uc785\uc758 \uc704\uc82f \uac00\uc838\uc634  \\n`tester.element()`: \ud2b9\uc815 \uc704\uc82f\uc758 BuildContext \uac00\uc838\uc634\\n:::\\n\\n[golden test](https://api.flutter.dev/flutter/flutter_test/matchesGoldenFile.html)\ub3c4 \uc788\ub2e4.\\n\\ngolden test\ub294 \uc774\ubbf8\uc9c0 \ud53d\uc140 \ube44\uad50\ud558\ub294 \ud14c\uc2a4\ud2b8\ub2e4 \uc989 \uc2dc\uac01\uc801 \ubaa8\uc2b5\uc744 \ud14c\uc2a4\ud2b8\ud560 \uc218 \uc788\ub2e4.\\n\\n\\n```bash\\nflutter test --update-goldens\\n```\\n\\n\uc774\uac78\ub85c \uace8\ub4e0\ud14c\uc2a4\ud2b8 \uc815\ub2f5 \uc0dd\uc131\ud574\uc90c \uc2e0\uae30\ud558\ub139.\\n\\n\\n## \ud1b5\ud569 \ud14c\uc2a4\ud2b8\\n---\\n\\nGUI\ud14c\uc2a4\ud2b8 EndToEnd\ub77c\uace0 \ud569\ub2c8\ub2e4.\\n\\n\uc2e4\uc81c \uc5d0\ubbac\ub808\uc774\ud130\ub97c \ud1b5\ud574\uc11c \ud14c\uc2a4\ud2b8\ub97c \ud558\uac8c \ub41c\ub2e4.\\n\\n`integration_test`\ub97c \ucd94\uac00\ud574\uc57c \ud55c\ub2e4\uace0 \ud569\ub2c8\ub2e4.\\n\\n```bash\\n\\n  integration_test:\\n    sdk: flutter\\n```\\n\\ndev_dependecies\uc5d0 \ubd99\uc5ec\ub123\uc5b4\uc8fc\uba74 \ub41c\ub2e4.\\n\\n\\nintegration_test\ub77c\ub294 \ud3f4\ub354\ub97c root\uc5d0 \ub9cc\ub4e4\uc5b4\uc8fc\uace0 \ud558\uba74 \ub41c\ub2e4.\\n\uc544\uc8fc \uc2e0\uae30\ud558\ub2e4.\\n\\n## \ud14c\uc2a4\ud2b8 \ucee4\ubc84\ub9ac\uc9c0\\n---\\n\\n[\ud50c\ub7ec\ud130 \ucee4\ubc84\ub9ac\uc9c0](https://marketplace.visualstudio.com/items?itemName=Flutterando.flutter-coverage)\\n\\n\ud14c\uc2a4\ud2b8 \ucf54\ub4dc \uae30\ubc18\uc73c\ub85c \ucee4\ubc84\ub9ac\uc9c0 \uce21\uc815\uc744 \ud55c\ub2e4.\\n\\n[\ucee4\ubc84\ub9ac\uc9c0 \uac70\ud130\uc2a4](https://marketplace.visualstudio.com/items?itemName=ryanluker.vscode-coverage-gutters)\\n\\n\uc774\uac70\ub294 \ud2b9\uc815 \ud30c\uc77c\uc5d0\uc11c \uc88c\uce21 \ud558\ub2e8 watch\ub97c \ub20c\ub7ec\ubcf4\uba74 \uc5b4\ub514\uac00 \ud14c\uc2a4\ud2b8\uac00 \uc548\ub410\ub294\uc9c0\uc640 \ucee4\ubc84\ub9ac\uc9c0 % \uc54c\ub824\uc900\ub2e4.\\n\\n\\nhydrated bloc\uc744 \uc0ac\uc6a9\ud574\ubcf4\uac70\ub098 \ub2e4\ub978 \uc11c\ub4dc\ud30c\ud2f0\ub4e4 \uac80\uc0c9\ud574\uc11c \ucc3e\uc544\ubcf4\uc790"},{"id":"kosta3","metadata":{"permalink":"/blog/kosta3","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2023-11-29-KOSTA3/index.md","source":"@site/blog/2023-11-29-KOSTA3/index.md","title":"\uc640\uc774\uc5b4\uc0e4\ud06c","description":"---","date":"2023-11-29T00:00:00.000Z","formattedDate":"November 29, 2023","tags":[{"label":"KOSTA","permalink":"/blog/tags/kosta"},{"label":"\uc640\uc774\uc5b4\uc0e4\ud06c","permalink":"/blog/tags/\uc640\uc774\uc5b4\uc0e4\ud06c"}],"readingTime":2.065,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"kosta3","title":"\uc640\uc774\uc5b4\uc0e4\ud06c","authors":["kihyun"],"tags":["KOSTA","\uc640\uc774\uc5b4\uc0e4\ud06c"]},"prevItem":{"title":"\ud14c\uc2a4\ud2b8 \ucf54\ub4dc","permalink":"/blog/test code"},"nextItem":{"title":"\uc640\uc774\uc5b4\uc0e4\ud06c","permalink":"/blog/kosta-2"}},"content":"---\\n\\n### \uc774\ub984 \ud480\uc774 \uae30\ub2a5 \ucc38\uc870 \ud30c\uc77c\\n\\n- mac address \uc0ac\uc6a9\uc790 \uc815\uc758 C:\\\\Program Files\\\\Wireshark\\\\ethers\\n- port number \uc815\ubcf4 C:\\\\Program Files\\\\Wireshark\\\\services\\n- \ud638\uc2a4\ud2b8 \uc774\ub984 \uc815\ubcf4 C:\\\\Program Files\\\\Wireshark\\\\hosts\\n\\n### \uc640\uc774\uc5b4\uc0e4\ud06c\ub294 \ud3ec\ud2b8\ubc88\ud638\uac00 \uc778\uc2dd\ub418\uc9c0 \uc54a\uc744\ub54c data\ub85c \ud574\uc11d\ub429\ub2c8\ub2e4. \ube44\ud45c\uc900 \ud3ec\ud2b8 \ubc88\ud638\ub97c \uc0ac\uc6a9\ud558\ub294 FTP \uc11c\ube44\uc2a4\ub97c \uc218\ub3d9\uc73c\ub85c \ubd84\uc11d\uae30\ub97c \uc124\uc815\ud558\ub294 \uba54\ub274\ub294 \uc5b4\ub514\uc778\uac00\uc694?\\n\\nAnalyze>Decode as\\n\\n### WLAN \ud504\ub85c\ud30c\uc77c\uc744 \uc0dd\uc131\uc2dc \ud658\uacbd\uc124\uc815 \uc800\uc7a5 \uacbd\ub85c\ub294 \uc5b4\ub514\uc778\uac00\uc694?\\n\\nC:\\\\Users\\\\user1\\\\AppData\\\\Roaming\\\\Wireshark\\\\Profile\\n\\n### \uc6d0\uaca9\uc9c0 \ud2b8\ub798\ud53d \ucea1\uccd0\ub97c \uc218\ud589\ud558\ub824\uace0 \ud569\ub2c8\ub2e4. \ucea1\uccd0\ud558\uace0\uc790 \ud558\ub294 \ucef4\ud4e8\ud130\uc5d0 winpcap\uc744 \uc124\uce58\ud55c \ud6c4 \uc6d0\uaca9\uc9c0\uc5d0 \uc2e4\ud589\ud574\uc57c\ud558\ub294 \ub370\ubaac \uc2e4\ud589\ud30c\uc77c\uc740 \ubb34\uc5c7\uc778\uac00\uc694?\\n\\nrpcapd.exe\\n\\n### \uae30\uc874 \ucd94\uc801\ud30c\uc77c\uc5d0\ub294 \uc801\uc6a9\ud560 \uc218 \uc5c6\uace0 \uc2e4\uc2dc\uac04 \ucea1\uccd0\ud558\ub294 \uc791\uc5c5\uc5d0\ub9cc \uc801\uc6a9\ub418\ub294 \ud544\ud130\ub85c TCPDUMP \uad6c\ubb38\uc758 BPF\ud615\uc2dd\uc744 \ub530\ub974\ub294 \ud544\ud130\ub294 \ubb34\uc5c7\uc778\uac00\uc694?\\n\\n\ucea1\uccd0\ud544\ud130\\n\\n### \uc2e4\uc2dc\uac04 \ucea1\uccd0 \ud544\ud130\uad6c\ubb38\uc744 \uc791\uc131\ud558\uc138\uc694. \\n\\n- http\uc640 dns \ud328\ud0b7\uc744 \ub3d9\uc2dc \ucea1\uccd0 `tcp port 80 or udp port 53`\\n- \ubaa9\uc801\uc9c0 IP\uc8fc\uc18c\uac00 10.10.10.10 \uc774\uba74\uc11c telnet \ud328\ud0b7\ub9cc \ucea1\uccd0 `ip dst 10.10.10.10 and tcp port 23`\\n- icmp ttl \uc5d0\ub7ec\ub9cc \ucea1\uccd0 `icmp[0]=11 and icmp[1]=0`\\n\\n### \uc804\uc5ed\ud658\uacbd\uc124\uc815 \uc704\uce58\uc5d0 \uc874\uc7ac\ud558\ub294 \ud30c\uc77c\ub85c \uc5c5\uadf8\ub808\uc774\ub4dc\uc2dc \ubcf5\uc0ac\ubcf8\uc744 \ub9cc\ub4e4\uc5b4\uc57c \ud558\ub294 \ud30c\uc77c\uc744 \uc4f0\uc138\uc694.\\n\\n- \uc2e4\uc2dc\uac04 \ucea1\uccd0 \ud544\ud130 cfilters\\n- \ub514\uc2a4\ud50c\ub808\uc774 \ud544\ud130 dfilters\\n- \uceec\ub7ec\ub9c1 \ud544\ud130 colorfilter\\n\\n### \uc2e4\uc2dc\uac04 \ucea1\uccd0\uc2dc \ud30c\uc77c\uc9d1\ud569\uc73c\ub85c \ucd5c\uadfc 10\uac1c \ud30c\uc77c\ub9cc \uc0dd\uc131\uc744 \uc720\uc9c0\ud560 \uc218 \uc788\ub294 \uc124\uc815\uc740 \ubb34\uc5c7\uc778\uac00\uc694?\\n\\n\ub9c1\ubc84\ud37c"},{"id":"kosta-2","metadata":{"permalink":"/blog/kosta-2","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2023-11-28-KOSTA2/index.md","source":"@site/blog/2023-11-28-KOSTA2/index.md","title":"\uc640\uc774\uc5b4\uc0e4\ud06c","description":"---","date":"2023-11-28T00:00:00.000Z","formattedDate":"November 28, 2023","tags":[{"label":"KOSTA","permalink":"/blog/tags/kosta"},{"label":"\uc640\uc774\uc5b4\uc0e4\ud06c","permalink":"/blog/tags/\uc640\uc774\uc5b4\uc0e4\ud06c"}],"readingTime":3.365,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"kosta-2","title":"\uc640\uc774\uc5b4\uc0e4\ud06c","authors":["kihyun"],"tags":["KOSTA","\uc640\uc774\uc5b4\uc0e4\ud06c"]},"prevItem":{"title":"\uc640\uc774\uc5b4\uc0e4\ud06c","permalink":"/blog/kosta3"},"nextItem":{"title":"\uc640\uc774\uc5b4\uc0e4\ud06c","permalink":"/blog/kosta-1"}},"content":"---\\n\\n## \ubb38\uc81c\\n---\\n\\n### PDU\\n\\n- L1> bits\\n- L2> frame\\n- L3> packet\\n- L4> segement\\n- L5~L7> message, data stream\\n\\n### \uce90\uc2dc \ud655\uc778 \ubc0f \uc0ad\uc81c\\n\\n- MAC\\n\\n```bash title=\'\ucd94\uac00\'\\narp -a\\n```\\n\\n```bash title=\'\uc0ad\uc81c\'\\narp -d\\n```\\n\\n- DNS\\n\\n```bash title=\'\ucd94\uac00\'\\nipconfig/displaydns\\n```\\n\\n```bash title=\'\uc0ad\uc81c\'\\nipconfig/flushdns\\n```\\n\\n- NetBIOS\\n\\n```bash title=\'\ucd94\uac00\'\\nnbtstat -c\\n```\\n\\n```bash title=\'\uc0ad\uc81c\'\\nnbtstat -R\\n```\\n\\n### OSI \\n\\nMAC\uc8fc\uc18c \ud3ec\ud568 : L2 - datalink layer\\nIP\uc8fc\uc18c \ud3ec\ud568 : L3 - network layer\\n\\n### \uae30\ubcf8 \ucd5c\ub300 \ud06c\uae30\\nEthernet Frame : 1518 Byte\\nMTU : 1500 byte \ud06c\uae30\ubcc0\uacbd \uac00\ub2a5\\nMSS : 1460 byte\\n\\n\\n## \ubaa9\uc801\uc9c0 IP\uc8fc\uc18c\uc5d0 \ub300\ud55c MAC\uc8fc\uc18c\ub97c \ucc3e\uc544\uc624\ub294 \ud504\ub85c\ud1a0\ucf5c\\n\\narp\\n\\n### TCP \ud5e4\ub354\uc5d0\uc11c Flag 6\uac1c\\n\\nsyn,ack,fin,rst,psh,urg\\n\\n###  TCP/IP\uc5d0\uc11c \uc5f0\uacb0\uc0c1\ud0dc\ub97c \ud655\uc778\ud558\uace0 \uc5d0\ub7ec\uba54\uc138\uc9c0\ub97c \uc804\ub2ec\ud558\ub294 \ud504\ub85c\ud1a0\ucf5c\\n\\nicmp\\n\\n### \uc2a4\uc704\uce58 \uae30\ubcf8 \uae30\ub2a5\\n\\nflooding, learning, fowarding, filtering\\n\\n\\n\\n## \uc640\uc774\uc5b4\uc0e4\ud06c\\n---\\n\\n### \ubcd1\ud569\\n\\n\uc640\uc774\uc5b4\uc0e4\ud06c\uc5d0 \uc77c\uc2dc\uc911\uc9c0 \uae30\ub2a5\uc740 \uc5c6\ub2e4 \uc815\uc9c0 \uc774\ud6c4 \ub2e4\uc2dc \ucea1\uccd0\ud574\uc11c \ubcd1\ud569\ud558\ub294 \ubc29\ubc95\ubc16\uc5d0 \uc5c6\ub2e4.\\n\\n\ubcd1\ud569\uc740 \ud30c\uc77c > \ubcd1\ud569\uc5d0\uc11c \uac00\ub2a5\\n\\n\uc640\uc774\uc5b4\uc0e4\ud06c\ub294 \ub450\uac1c\uc758 \ud30c\uc77c\uc744 \ub3d9\uc2dc\uc5d0 \uc5f4 \uc218 \uc5c6\uc5b4\uc11c \ubcd1\ud569\uc744 \uc0ac\uc6a9\ud55c\ub2e4.\\n\\n\ubcd1\ud569\uc5d0\ub294 3\uac00\uc9c0 \uc635\uc158\uc774 \uc788\ub294\ub370 \uae30\ubcf8\uac12\uc740 \uc2dc\uac04 \uae30\uc900\uc73c\ub85c \ubcd1\ud569\ud558\ub294 \uac83\uc774\uace0 \uc804\uc5d0 \uc774\uc5b4\ubd99\uc774\uae30 \ud6c4\uc5d0 \uc774\uc5b4\ubd99\uc774\uae30\uac00 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n### \ucea1\ucc98 \ud30c\uc77c\\n\\n\uc5f4\uae30 \ud3f4\ub354 \ubc84\ud2bc\uc73c\ub85c \ud30c\uc77c\uc744 \uc5f0\ub2e4\uba74 \ucea1\ucc98 \uc2dc\uac04\uacfc \uc0ac\uc774\uc988 \ub4f1\uc744 \ucd94\uac00\ub85c \ud655\uc778\ud560 \uc218 \uc788\ub2e4.\\n\\n\\n### \uc0c8\ub85c\uace0\uce68 \ubc84\ud2bc\\n\\n\uc640\uc774\uc5b4\uc0e4\ud06c\ub294 time \uce7c\ub7fc\uc758 \uc791\ub3d9\ubc29\uc2dd\uc774 \uc9c0\uc5f0 \uc2dc\uac04 \uc791\ub3d9\ubc29\uc2dd\uc744 \ucc44\ud0dd\ud55c\ub2e4.\\n\\n\\n\uadf8\ub798\uc11c 1\ubc88 \ud328\ud0b7\uc774 0.00\ucd08\uc774\uace0 \uadf8\ub2e4\uc74c \ubd80\ud130\ub294 1\ubc88 \ud328\ud0b7 \uc774\ud6c4 \ucea1\uccd0\ub41c \uc9c0\uc5f0 \uc2dc\uac04\uc774\ub2e4.\\n\\n\uadf8\ub7f0\ub370 10\ubc88 \ud328\ud0b7\uc744 0\ucd08\ub85c \uc124\uc815\ud558\ub294 \ubc29\ubc95\uc774 \uc788\ub294\ub370 `\uc2dc\uac04 \ucc38\uc870 \uc124\uc815`\uc744 \ud558\uba74 \ud560 \uc218 \uc788\ub2e4.\\n\\n`\uc2dc\uac04 \ucc38\uc870 \uc124\uc815`\uc740 \ud558\ub098\uc5d0\ub9cc \ud560 \uc218 \uc788\ub294 \uac83\uc774 \uc544\ub2cc\ub370 \uadf8\ub798\uc11c \ub098\uc911\uc5d0 \ud480\uc5b4\uc8fc\ub824\uace0 \ud558\uba74 \ub108\ubb34 \uc5b4\ub835\ub2e4.\\n\\n\uc774 \ub54c `\ud30c\uc77c \ub2e4\uc2dc \ubd88\ub7ec\uc624\uae30` \ubc84\ud2bc\uc774 \uc774\ub97c \ubaa8\ub450 \ud574\uc81c\ud574\uc900\ub2e4.\\n\\n\uadf8\ub798\uc11c `\ud30c\uc77c \ub2e4\uc2dc \ubd88\ub7ec\uc624\uae30` \ubc84\ud2bc\uc744 \uc790\uc8fc \uc0ac\uc6a9\ud55c\ub2e4\uace0 \ud55c\ub2e4.\\n\\n\\n### \uc774\ub984 \ud574\uc11d\\n\\n\ubcf4\uae30 > \uc774\ub984\ud574\uc11d > \ub124\ud2b8\uc6cc\ud06c \uc8fc\uc18c \ud574\uc11d\uc744 \ud0a4\uba74 \ud328\ud0b7\uc758 IPv4\uc5d0\uc11c dns \uc8fc\uc18c\ub85c \ud655\uc778\ud560 \uc218 \uc788\ub2e4.\\n\\n\uadfc\ub370 \uc774\ub7ec\uba74 \uc4f8\ub370\uc5c6\ub294 UDP \ud328\ud0b7\uc774 \uc0dd\uae30\uae30 \ub54c\ubb38\uc5d0 \uc2e4\uc2dc\uac04 \ud328\ud0b7\uc744 \ucea1\uccd0\ud560 \ub54c \uc774\ub984 \ud574\uc11d\uc744 \ud574\uc81c\ud558\uace0 \ud558\ub294 \uac83\uc774 \uc88b\ub2e4.\\n\\n\ubcf4\uae30 > \uc774\ub984\ud574\uc11d > \uc804\uc1a1\uc8fc\uc18c \ud574\uc11d\uc744 \ud0a4\uba74 \ud3ec\ud2b8 \ubc88\ud638\uc5d0 \uc774\ub984\uc744 \ubd99\uc5ec\uc90c\\n\\n\\n:::tip \uc774\ub984 \ud574\uc11d \ucee4\uc2a4\ud140\\n`MAC addr`  c:\\\\program files\\\\wireshark\\\\ethers\\n`IP addr`   c:\\\\program files\\\\wireshark\\\\hosts\\n`port name` c:\\\\program files\\\\wireshark\\\\services\\n:::"},{"id":"kosta-1","metadata":{"permalink":"/blog/kosta-1","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2023-11-27-KOSTA1/index.md","source":"@site/blog/2023-11-27-KOSTA1/index.md","title":"\uc640\uc774\uc5b4\uc0e4\ud06c","description":"---","date":"2023-11-27T00:00:00.000Z","formattedDate":"November 27, 2023","tags":[{"label":"KOSTA","permalink":"/blog/tags/kosta"},{"label":"\uc640\uc774\uc5b4\uc0e4\ud06c","permalink":"/blog/tags/\uc640\uc774\uc5b4\uc0e4\ud06c"}],"readingTime":5.6,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"kosta-1","title":"\uc640\uc774\uc5b4\uc0e4\ud06c","authors":["kihyun"],"tags":["KOSTA","\uc640\uc774\uc5b4\uc0e4\ud06c"]},"prevItem":{"title":"\uc640\uc774\uc5b4\uc0e4\ud06c","permalink":"/blog/kosta-2"},"nextItem":{"title":"PKI \uac1c\ub150","permalink":"/blog/PKI"}},"content":"---\\n\\n## \uc640\uc774\uc5b4\uc0e4\ud06c \uc124\uce58\\n---\\n\\n[\uc774\uacf3](https://www.wireshark.org/)\uc5d0\uc11c \uc9c4\ud589\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n## \ucef4\ud4e8\ud130 \ub124\ud2b8\uc6cc\ud06c\\n---\\n\\n\ub370\uc774\ud130 \ud1b5\uc2e0\uc740 MAC\uc8fc\uc18c\uac00 \uaf2d \ud544\uc694\ud568. \uc774\uac78 \ub17c\ub9ac\uc801\uc73c\ub85c \ubc14\uafbc \uc8fc\uc18c\uac00 IP\uc8fc\uc18c\\n\\n### \ubb3c\ub9ac\uc8fc\uc18c \ud655\uc778\\n\\n```bash\\narp -a\\n```\\n\\n\uce90\uc2dc \ub370\uc774\ud130\ub2e4. 5\ubd84\ub4a4\uc5d0 \uc9c0\uc5b4\uc9d0 \uadfc\ub370 \uc9c0\uc6b0\ub824\uba74\\n\\n```bash\\napr -d\\n```\\n\\n\uce90\uc2dc\uac00 \ub0a8\ub294\uacbd\uc6b0\ub294 \ub0b4\uac00 \uc0c1\ub300\ubc29\uacfc \uc5f0\uacb0\uc744 \ud560 \ub54c\ub3c4 \uc788\uc9c0\ub9cc \uc0c1\ub300\ubc29\uc774 \ub098\uc640 \uc5f0\uacb0\ud560 \ub54c\ub3c4 \uce90\uc2dc\uac00 \ub0a8\uc74c.\\n\\n\uadf8\ub798\uc11c \ud328\ud0b7 \ubd84\uc11d\ud560 \ub54c \uce90\uc2dc\ub97c \uc9c0\uc6cc\uc57c \ud55c\ub2e4.\\n\\n\\n### dns\uac00 \uc54c\ub824\uc900 ip \uce90\uc2dc \uc815\ubcf4 \ud655\uc778\\n---\\n\\n```bash\\nipconfig/displaydns\\n```\\n\\n\uc9c0\uc6b0\uae30\\n\\n```bash\\nipconfig/flushdns\\n```\\n\\n### \ucef4\ud4e8\ud130 \uc774\ub984\uc73c\ub85c \ud1b5\uc2e0\\n---\\n\\n```bash\\nnbtstat -n\\n```\\n\\n\uce90\uc2dc \ud655\uc778\\n\\n```bash\\nnbtstat -c\\n```\\n\\n\uce90\uc2dc \uc0ad\uc81c\\n\\n```bash\\nnbtstat -R\\n```\\n\\n\ubd84\uc11d\ud560 \ub54c arp, dns, nbtstat \uce90\uc2dc \uc9c0\uc6cc\uc8fc\uace0 \ud558\ub294\uac8c \uc88b\ub2e4.\\n\\n\\n\\n### OSI 7 \uacc4\uce35\\n\\n\uacc4\uce35\uc744 \ud1b5\uacfc\ud560 \ub54c\ub294 \uad00\ub828 \ud5e4\ub354\uac00 \ucd94\uac00\ub41c\ub2e4. PDU\uac00 \uc788\ub2e4.\\n\\nPDU\ub294 \uc544\ub798 \uc815\ub9ac..\\n\\n`Presentation` : Message\\n\\n`Transport` : Segment\\n\\n`Network` : packet\\n\\n`Datalink` : frame\\n\\n---\\n\\n`Application` : \ud1b5\uc2e0 software\\n\\n`Presentation` : \ub370\uc774\ud130 \ud3ec\ub9f7 \uc815\uc758 (jpg,png \ub4f1)\\n\\n`Session` : App \uc5f0\uacb0 \uc720\uc9c0 or \ud574\uc81c\\n\\n`Transport` : \ud328\ud0b7 \ubd84\ub9ac, \uc7ac\uc804\uc1a1, \uc5d0\ub7ec \uac80\ucd9c (Segment\uac00 \uc804\uc1a1 \ucd5c\uc18c\ub2e8\uc704\uc5ec\uc11c)\\n\\n`Network` : Segment\uc55e\uc5d0 \ub17c\ub9ac\uc801 \uc8fc\uc18c(IP)\ub97c \ucd94\uac00\ud574\uc11c \ubaa9\uc801 \uc804\ub2ec \uac00\ub2a5\ud558\uac8c \ud574\uc90c > Packet\\n\\n`Datalink` : \ubb3c\ub9ac \uc8fc\uc18c\ub97c \ucd94\uac00\ud574\uc11c \uc804\ub2ec(MAC,DLCI) > Frame\\n\\n`Pyhsical` : bit\ub97c \uc804\uae30\uc2e0\ud638\ub85c \ubcc0\ud658, \uc804\uae30\uc801, \uae30\ub2a5\uc801 \ud2b9\uc131, \uc808\ucc28\uc801 \ud2b9\uc131, \uae30\uacc4\uc801 \ud2b9\uc131\uc5d0 \ub300\ud55c \uc57d\uc18d\\n\\n\\n### TCP/IP 4 \uacc4\uce35\\n\\n`Application` : osi\uc758 application, presentation, session\uc744 \ud569\uce5c \uacc4\uce35, http, telnet, dns, dhcp \ud504\ub85c\ud1a0\ucf5c\uc774 \uc788\uc74c\\n\\n`Transport` : TCP,UDP \ud504\ub85c\ud1a0\ucf5c\uc774 \uc788\uc74c\\n\\n    + \ud3ec\ud2b8\ubc88\ud638\ub97c \ud1b5\ud574\uc11c Application \uc5b4\ub514\ub85c \ubcf4\ub0bc\uc9c0 \ub2f4\uaca8\uc788\uc74c\\n\\n\\n`Internet` : OSI\uc758 network \uacc4\uce35, ICMP, IP, ARP RARP \uc788\ub2e4. \\n    \\n    + protocol Number \ub97c \ud1b5\ud574\uc11c TCP,UDP.. \ub4f1 \uc5b4\ub514\ub85c \ub118\uae30\uc9c0 \ub2f4\uaca8\uc788\uc74c\\n\\n`network access` : OSI\uc758 datalink, physical \uacc4\uce35 ethernet2(MAC) \\n    \\n    + Type(IPv4, IPv6)\uc774 \uc778\ud130\ub137 \uacc4\uce35 \ud504\ub85c\ud1a0\ucf5c \uc5b4\ub514\ub85c \ubcf4\ub0bc\uc9c0 \uad6c\ubd84\ud574\uc90c \\n\\n![Alt text](image.png)\\n\\n\\n### \ud3ec\ud2b8\ubc88\ud638\\n\\n`0 ~ 1023` : \uc798 \uc54c\ub824\uc9c4 \uc11c\ube44\uc2a4 \uc608\uc57d \ud3ec\ud2b8\\n\\n`1024 ~ 49151` : \ucd94\uac00 \ud45c\uc900 \uc0c1\uc6a9 tool \uc608\uc57d \ud3ec\ud2b8\\n\\n`49152 ~ 65535` : \uac1c\uc778\uc6a9 \ud3ec\ud2b8\\n\\n\\n:::tip\\n[\ub3c4\uc6c0\uc774 \ub418\ub294 \ub2e4\uc591\ud55c \uc815\ubcf4\ub4e4\uc774 \ub2f4\uae34 url 1](https://www.iana.org/assignments/protocol-numbers/protocol-numbers.xhtml)  \\n[\ub3c4\uc6c0\uc774 \ub418\ub294 \ub2e4\uc591\ud55c \uc815\ubcf4\ub4e4\uc774 \ub2f4\uae34 url 2](https://www.iana.org/assignments/service-names-port-numbers/service-names-port-numbers.xhtml)\\n:::\\n\\n\\n### \ub124\ud2b8\uc6cc\ud06c \uc5f0\uacb0 \uc7a5\uce58\\n\\n1. HUB\\n\\n\ud5c8\ube0c\ub294 \ub2e4 \ud655\uc778\ud574\ubcf4\uace0 \ud574\ub2f9 \ubaa9\uc801\uc9c0\uc778\uc9c0 \uac80\uc0ac\ud558\uace0 \uc544\ub2c8\uba74 \ub2e4\uc74c \ubaa9\uc801\uc9c0\ub85c.. \ubc18\ubcf5\\n\\n2. Switch\\n\\n\uc2a4\uc704\uce58\ub294 \ubaa9\uc801\uc9c0 \uc8fc\uc18c\uac00 \ud3ec\ud568\ub418\uc5b4 \uc788\uc5b4\uc11c \ud574\ub2f9 \ubaa9\uc801\uc9c0\uc5d0\ub9cc \ubc29\ubb38 \uadfc\ub370 FFFF\uac00 \ubaa9\uc801\uc9c0 \uc8fc\uc18c\uc774\uba74 \ube0c\ub85c\ub4dc\uce90\uc2a4\ud2b8 \uc778\ub370 \ubaa8\ub4e0 \uc2a4\uc704\uce58\uc5d0 \uc804\ub2ec(Flooding)\ud558\uae30 \ub54c\ubb38\uc5d0 \ub124\ud2b8\uc6cc\ud06c \ubd80\ud558\uac00 \uc634 > \ucc28\ub2e8\uc758 \ud544\uc694\uc131\uc774 \uc788\ub2e4.\\n\\n:::tip \uc2a4\uc704\uce58 \ub3d9\uc791\\n1. Flooding\\n\\n\ub4e4\uc5b4\uc628 \ud3ec\ud2b8\ub97c \uc81c\uc678\ud558\uace0 \ubaa8\ub4e0 \ud3ec\ud2b8\uc5d0 \ubfcc\ub9bc\\n\\n2. Learning\\n\\n\ub9e5\uc8fc\uc18c\ub97c \ud559\uc2b5\ud574\uc11c \ub9e5 \ud14c\uc774\ube14\uc5d0 \uc791\uc131\\n\\n3. Forwarding\\n\\n\ubaa9\uc801\uc9c0 \ub9e5\uc8fc\uc18c\uc5d0 \uadf8\ub300\ub85c \ud504\ub808\uc784 \ubcf4\ub0b4\ub294 \uac83\\n\\n4. Filtering\\n\\n\ubaa9\uc801\uc9c0 \uc8fc\uc18c\ub97c \uc54c\uace0 \uc788\uc744 \ub54c \ud504\ub808\uc784 \uc804\uc1a1\uc744 \ub9c9\ub294 \uac83\\n\\n:::\\n\\n\\n3. Router\\n\\n\ub77c\uc6b0\ud130\ub294 \ub124\ud2b8\uc6cc\ud06c \ubcc4\ub85c \uc804\uc1a1 \ucc28\ub2e8\ud560 \uc218 \uc788\uc74c. \ube0c\ub85c\ub4dc\uce90\uc2a4\ud2b8\ub85c \uc778\ud55c \ub124\ud2b8\uc6cc\ud06c \ubd80\ud558 \ubc29\uc9c0\\n\\n### TCP\uc640 UDP\\n\\n`TCP` : \ud5e4\ub354(20 ~ 60byte)\\n\\nA >> \ud655\uc778\uc2e0\ud638 >> B\\n\\nB >> \uc751\ub2f5 >> A\\n\\nA >> \uc5f0\uacb0 \ud655\uc815 >> B\\n\\nA >> \ub370\uc774\ud130 \uc804\ub2ec >> B\\n\\nB >> \uc751\ub2f5 >> A\\n\\n`UDP` : \ud5e4\ub354 (8byte)\\n\\nA >> \ub370\uc774\ud130 \uc804\ub2ec >> B\\n\\n## wireshark\\n---\\n\\n\uc640\uc774\uc5b4\uc0e4\ud06c\ub294 \ub9c8\uc9c0\ub9c9 \uc0c1\ud0dc \uc124\uc815\uc774 \uc800\uc7a5\ub41c\ub2e4.\\n\\n\\n\\n\ucea1\ucc98 \uc635\uc158\uc5d0\uc11c \ubaa8\ub450 \ubb34\uc791\uc704\ub97c \ub044\uba74 \ub098\ud55c\ud14c \ub4e4\uc5b4\uc624\ub294 \ud328\ud0b7\ub9cc \ud655\uc778\ud560 \uc218 \uc788\ub2e4.\\n\\n### \uc228\uae40\\n\\n\ucea1\ucc98 > \uc635\uc158 > \uc778\ud130\ud398\uc774\uc2a4\uad00\ub9ac\uc5d0\uc11c \ud45c\uc2dc\ub97c \uccb4\ud06c \ud574\uc81c\ud558\uba74 \uc778\ud130\ud398\uc774\uc2a4\ub97c \uc228\uae38 \uc218 \uc788\ub2e4.\\n\\n\uc544\ub2c8\uba74 \ub124\ud2b8\uc6cc\ud06c \uc124\uc815\uc5d0\uc11c \uc5b4\ub311\ud130 \uc0ac\uc6a9\uc548\ud558\uba74 \uc548\ubcf4\uc784\\n\\n\uc544\ub2c8\uba74 \ub77c\uc774\ube0c\ub7ec\ub9ac(npcap)\uac00 \uc0ad\uc81c\ub410\uc744 \uc218\ub3c4 \uc788\uc74c.\\n\\n\uc544\ub2c8\uba74 \uac00\uc0c1 \uc778\ud130\ud398\uc774\uc2a4\ub97c \ucd94\uac00\ud558\uace0 \uc7ac\ubd80\ud305\ud574\uc57c \ubcf4\uc784\\n\\n\\n### \ud1b5\uacc4\\n\\n\ud544\ud130\uc5d0 `tcp.stream == 1` \ub4f1\uc73c\ub85c \ud544\ud130\ub9c1 \ud6c4\\n\\n\ud1b5\uacc4 > \ud50c\ub85c \uadf8\ub798\ud504 > \ud45c\uc2dc \ud544\ud130\ub85c \uc81c\ud55c\\n\\n![Alt text](image-1.png)\\n\\n\\n### \uc2a4\ud2b8\ub9bc \ud655\uc778\\n\\n\ud328\ud0b7\uc5d0 \uc6b0\ud074\ub9ad > \ub530\ub77c\uac00\uae30 > TCP \uc2a4\ud2b8\ub9bc \ub4f1..\\n\\n\ud55c \ub208\uc5d0 \ubcf4\uc778\ub2e4.\\n\\nTCP\ub294 \ucd5c\ub300 \uae38\uc774\uac00 1514\uc5ec\uc11c \uc798\ub824\uc11c \ubd84\uc11d\ud558\uae30 \uc5b4\ub824\uc6b8 \uc218 \uc788\ub294\ub370 \ud55c \ub208\uc5d0 \ud655\uc778 \uac00\ub2a5"},{"id":"PKI","metadata":{"permalink":"/blog/PKI","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2023-10-25-pki/index.md","source":"@site/blog/2023-10-25-pki/index.md","title":"PKI \uac1c\ub150","description":"PKI\ub780 Public Key Infrastructure\uc758 \uc57d\uc790\ub85c \uacf5\uac1c\ud0a4 \uc554\ud638\ud654\uc640 \uc804\uc790\uc11c\uba85\uc744 \uc0ac\uc6a9\ud560 \uc218 \uc788\uac8c \uae30\ubc18\uc744 \ub9c8\ub828\ud574\ub454 \uac83\uc774\ub77c\uace0 \ud569\ub2c8\ub2e4.","date":"2023-10-25T00:00:00.000Z","formattedDate":"October 25, 2023","tags":[{"label":"pki","permalink":"/blog/tags/pki"}],"readingTime":2.46,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"PKI","title":"PKI \uac1c\ub150","authors":["kihyun"],"tags":["pki","PKI"]},"prevItem":{"title":"\uc640\uc774\uc5b4\uc0e4\ud06c","permalink":"/blog/kosta-1"},"nextItem":{"title":"Overloading & Overriding","permalink":"/blog/Overloading and Overriding"}},"content":"PKI\ub780 Public Key Infrastructure\uc758 \uc57d\uc790\ub85c \uacf5\uac1c\ud0a4 \uc554\ud638\ud654\uc640 \uc804\uc790\uc11c\uba85\uc744 \uc0ac\uc6a9\ud560 \uc218 \uc788\uac8c \uae30\ubc18\uc744 \ub9c8\ub828\ud574\ub454 \uac83\uc774\ub77c\uace0 \ud569\ub2c8\ub2e4.\\n\\n\\n\uc2e0\ub8b0\uae30\uac04\uc774 \uacf5\uac1c\ud0a4\ub4e4\uc744 \uc778\uc99d\ud574\uc8fc\uba74 \uadf8 \uacf5\uac1c\ud0a4\uc5d0 \ub300\uc751\ub418\ub294 \uac1c\uc778\ud0a4\ub3c4 \uc778\uc99d\ub418\uae30 \ub54c\ubb38\uc5d0 \uac1c\uc778\ud0a4\ub97c \uac16\uace0 \uc788\ub294 \uac1c\uc778\uc774 \uc778\uc99d\uc744 \ubc1b\uc2b5\ub2c8\ub2e4.\\n\\n\\n## \uc740\ud589\uc5d0\uc11c \uacf5\uc778\uc778\uc99d\uc11c \uc778\uc99d \uacfc\uc815\\n---\\n\\n\uc740\ud589\uc5d0\uc11c \uacf5\uc778\uc778\uc99d\uc11c \uacfc\uc815\ub97c \uc778\uc99d\ud558\ub294 \uacfc\uc815\uc774 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n![Alt text](image.png)\\n\\n### \uc0dd\uc131 \uacfc\uc815\\n\\n1. \uba3c\uc800 \uac1c\uc778\uc774 \uacf5\uc778 \uc778\uc99d\uc11c \ubc1c\uae09\uc744 CA\uc5d0 \uc694\uccad\ud569\ub2c8\ub2e4.\\n\\n2. \uadf8\ub7ec\uba74 CA\uc5d0\uc11c \uac1c\uc778\uc758 \uac1c\uc778\ud0a4, \uacf5\uac1c\ud0a4\ub97c \uc0dd\uc131\ud569\ub2c8\ub2e4.\\n\\n3. \uc0dd\uc131\ud55c \ud0a4\ub4e4\ub85c \ub514\uc9c0\ud138 \uc778\uc99d\uc11c\ub97c \ubc1c\uae09\ud569\ub2c8\ub2e4.\\n\\n:::tip \ub514\uc9c0\ud138 \uc778\uc99d\uc11c\uc5d0 \ub4e4\uc5b4\uac00\ub294 \uac83\\n`\ubc1c\uae09\uc790 \uc815\ubcf4`,  `\uc18c\uc720\uc790 \uc815\ubcf4`, `\uc778\uc99d\uc11c \uad8c\ud55c`, `\uc720\ud6a8\uae30\uac04`, `\ubc1c\uae09\uc790 \uc804\uc790 \uc11c\uba85`, `\uc77c\ub828\ubc88\ud638`, `\uc18c\uc720\uc790 \uacf5\uac1c\ud0a4 \uc815\ubcf4`\\n:::\\n\\n4. \ub514\uc9c0\ud138 \uc11c\uba85 \uc0dd\uc131\uc744 \uc0dd\uc131\ud569\ub2c8\ub2e4.\\n\\n\ub514\uc9c0\ud138 \uc11c\uba85\uc740 \uc804\uc1a1\ud560 \ubb38\uc11c\ub97c \uc778\uc99d\ud574\uc8fc\ub294 \ub3c4\uad6c\uc785\ub2c8\ub2e4.\\n\\n:::tip \ub514\uc9c0\ud138 \uc11c\uba85 \uc0dd\uc131 \uc808\ucc28\\n1. \uba54\uc2dc\uc9c0 or \ubb38\uc11c \uc120\ud0dd\\n2. \uba54\uc2dc\uc9c0 or \ubb38\uc11c\uc5d0 \ud574\uc2dc \ud568\uc218 \uc801\uc6a9 > `\ud574\uc2dc \uac12`\\n3. \uc0ac\uc6a9\uc790\uc758 \uac1c\uc778\ud0a4\ub85c `\ud574\uc2dc \uac12` \uc554\ud638\ud654 > `\ub514\uc9c0\ud138 \uc11c\uba85`\\n:::\\n\\n\\n### \ud655\uc778 \uacfc\uc815\\n\\n1. `\uc6d0\ubcf8 \uba54\uc2dc\uc9c0`\uc640 `\ub514\uc9c0\ud138 \uc11c\uba85`\uc744 \ubc1b\uc2b5\ub2c8\ub2e4.\\n\\n2. \ub514\uc9c0\ud138 \uc778\uc99d\uc11c\uc5d0\uc11c \ucd94\ucd9c\ud55c \uacf5\uac1c\ud0a4\ub85c `\ub514\uc9c0\ud138 \uc11c\uba85`\uc744 \ubcf5\ud638\ud654\ud569\ub2c8\ub2e4. > `\ud574\uc2dc \uac12`\\n\\n3. `\uc6d0\ubcf8 \uba54\uc2dc\uc9c0` \ud574\uc2dc\ud574\ubcf4\uba70 \ubcf5\ud638\ud654\ud55c `\ud574\uc2dc \uac12`\uacfc \ub3d9\uc77c\ud55c\uc9c0 \ud655\uc778\ud558\uc5ec \ubb34\uacb0\uc131 \uac80\uc0ac\ub97c \ud569\ub2c8\ub2e4.\\n\\n4. \ub514\uc9c0\ud138 \uc778\uc99d\uc11c\uc758 \uc720\ud6a8\uae30\uac04\uc744 \ud655\uc778\ud569\ub2c8\ub2e4.\\n\\n\uadf8\ub7ec\uba74 PKI \uc778\uc99d\uc774 \ub429\ub2c8\ub2e4. \uc5ec\uae30\uc11c \uc740\ud589\uacfc \ud1b5\uc2e0\ud558\uace0 \uc2f6\ub2e4\uba74 \uba54\uc2dc\uc9c0 \ub610\ub294 \ubb38\uc11c\uac00 \uc740\ud589\uc758 \uc778\uc99d\uc11c\uac00 \ub418\uaca0\ub124\uc694."},{"id":"Overloading and Overriding","metadata":{"permalink":"/blog/Overloading and Overriding","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2023-09-16-over/index.md","source":"@site/blog/2023-09-16-over/index.md","title":"Overloading & Overriding","description":"\uc624\ubc84\ub85c\ub529\uacfc \uc624\ubc84\ub77c\uc774\ub529\uc5d0 \ub300\ud574\uc11c \uc54c\uc544\ubcf4\uaca0\uc2b5\ub2c8\ub2e4.","date":"2023-09-16T00:00:00.000Z","formattedDate":"September 16, 2023","tags":[{"label":"Overriding","permalink":"/blog/tags/overriding"},{"label":"Overloading","permalink":"/blog/tags/overloading"},{"label":"\uc624\ubc84\ub85c\ub529","permalink":"/blog/tags/\uc624\ubc84\ub85c\ub529"},{"label":"\uc624\ubc84\ub77c\uc774\ub529","permalink":"/blog/tags/\uc624\ubc84\ub77c\uc774\ub529"}],"readingTime":3.87,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"Overloading and Overriding","title":"Overloading & Overriding","authors":["kihyun"],"tags":["Overriding","Overloading","\uc624\ubc84\ub85c\ub529","\uc624\ubc84\ub77c\uc774\ub529"]},"prevItem":{"title":"PKI \uac1c\ub150","permalink":"/blog/PKI"}},"content":"\uc624\ubc84\ub85c\ub529\uacfc \uc624\ubc84\ub77c\uc774\ub529\uc5d0 \ub300\ud574\uc11c \uc54c\uc544\ubcf4\uaca0\uc2b5\ub2c8\ub2e4.\\n\\n## \uc624\ubc84\ub85c\ub529 (Overloading)\\n\\n### \uc815\uc758\\n\\n\ud55c \ud074\ub798\uc2a4 \ub0b4\uc5d0 \uc774\ubbf8 **\uc0ac\uc6a9\ud558\ub824\ub294 \uc774\ub984**\uacfc **\uac19\uc740 \uc774\ub984**\uc744 \uac00\uc9c4 **`\uba54\uc18c\ub4dc`**\uac00 \uc788\uc5b4\ub3c4 \ub9e4\uac1c \ubcc0\uc218\uc758 \uac1c\uc218\uc640 \ud0c0\uc785\uc774 \ub2e4\ub974\uba74 \uac19\uc740 \uc774\ub984\uc744 \uc0ac\uc6a9\ud574\uc11c \uba54\uc18c\ub4dc\ub97c \uc7ac\uc815\uc758 \ud560 \uc218 \uc788\ub2e4.\\n\\n\uc5ec\uae30\uc11c \ud575\uc2ec\uc740 2\uac00\uc9c0\ub85c \uc815\ub9ac\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n1. \uba54\uc18c\ub4dc\uc758 \uc774\ub984\uc774 \uac19\ub2e4.\\n2. \ub9e4\uac1c\ubcc0\uc218\uc758 \uac1c\uc218\ub098 \ud0c0\uc785\uc774 \ub2ec\ub77c\uc57c \ud55c\ub2e4.\\n3. \ub9ac\ud134\uac12\uacfc\ub294 \uc0c1\uad00 \uc5c6\uc2b5\ub2c8\ub2e4.\\n\\n\\n### \uc624\ubc84\ub85c\ub529 \ud568\uc218 \ucf54\ub4dc\\n\\n```java title=\'\uc624\ubc84\ub85c\ub529 \ud568\uc218\'\\npublic class OverringClass {\\n    \\n    // \uc624\ubc84\ub85c\ub529 1\ubc88 \ud568\uc218\\n    public void OverloadMethod(){\\n        System.out.println(\\"============================\\");\\n        System.out.println(\\"\ub9e4\uac1c\ubcc0\uc218 \uc218 : 0\uac1c\\");\\n        System.out.println(\\"\ub9e4\uac1c\ubcc0\uc218 \ud0c0\uc785 : void\\");\\n        System.out.println(\\"\uc624\ubc84\ub77c\uc774\ub529 1\ubc88 \ud568\uc218 \uc785\ub2c8\ub2e4.\\");\\n        System.out.println(\\"============================\\");\\n    }\\n\\n    // \uc624\ubc84\ub85c\ub529 2\ubc88 \ud568\uc218\\n    public int OverloadMethod(int a, int b){\\n        System.out.println(\\"============================\\");\\n        System.out.println(\\"\ub9e4\uac1c\ubcc0\uc218 \uc218 : 2\uac1c\\");\\n        System.out.println(\\"\ub9e4\uac1c\ubcc0\uc218 \ud0c0\uc785 : int\\");\\n        System.out.println(\\"\uc624\ubc84\ub77c\uc774\ub529 2\ubc88 \ud568\uc218 \uc785\ub2c8\ub2e4. \ub367\uc148 \uac12\uc744 \ubc18\ud658\ud569\ub2c8\ub2e4.\\");\\n        System.out.println(\\"============================\\");\\n\\n        return a+b;\\n    }\\n\\n    // \uc624\ubc84\ub85c\ub529 3\ubc88 \ud568\uc218\\n    public int OverloadMethod(int a, int b, int c){\\n        System.out.println(\\"============================\\");\\n        System.out.println(\\"\ub9e4\uac1c\ubcc0\uc218 \uc218 : 3\uac1c\\");\\n        System.out.println(\\"\ub9e4\uac1c\ubcc0\uc218 \ud0c0\uc785 : int\\");\\n        System.out.println(\\"\uc624\ubc84\ub77c\uc774\ub529 3\ubc88 \ud568\uc218 \uc785\ub2c8\ub2e4. \uacf1\uc148\uc744 \ubc18\ud658\ud569\ub2c8\ub2e4.\\");\\n        System.out.println(\\"============================\\");\\n\\n        return a*b*c;\\n    }\\n\\n\\n    // \uc624\ubc84\ub85c\ub529 4\ubc88 \ud568\uc218\\n    public boolean OverloadMethod(String str){\\n        System.out.println(\\"============================\\");\\n        System.out.println(\\"\ub9e4\uac1c\ubcc0\uc218 \uc218 : 1\uac1c\\");\\n        System.out.println(\\"\ub9e4\uac1c\ubcc0\uc218 \ud0c0\uc785 : String\\");\\n        System.out.println(\\"\uc624\ubc84\ub77c\uc774\ub529 4\ubc88 \ud568\uc218 \uc785\ub2c8\ub2e4. \uc774\ub984\uc774 park\uc774\uba74 true\ub97c \ubc18\ud658\ud569\ub2c8\ub2e4.\\");\\n        System.out.println(\\"============================\\");\\n\\n        if(str.equals(\\"park\\")){\\n            return true;\\n        }else{\\n            return false;\\n        }\\n    }\\n}\\n\\n```\\n\\n\uc704 \ud568\uc218\ub4e4\uc744 \ubcf4\uc2dc\uba74 `OverloadMethod`\ub85c \uc774\ub984\ub4e4\uc774 \uac19\uc9c0\ub9cc \ud0c0\uc785\uacfc \ub9e4\uac1c\ubcc0\uc218\uc758 \uc218\uac00 \ub2e4\ub978 \uac83\ub4e4\uc744 \ubcf4\uc2e4 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \ud568\uc218\ub4e4\uc5d0 \ub300\ud55c \uc124\uba85\uc740 \ucf54\ub4dc\uc5d0 \uc791\uc131\ub3fc \uc788\uc73c\ub2c8 \ucc38\uace0\ud574\uc8fc\uc138\uc694~ \ud83d\ude0e\\n\\n\ucf54\ub4dc\ub97c \uc2e4\ud589\ud558\ub294 \ucf54\ub4dc\uc640 \uacb0\uacfc\ub97c \ud655\uc778\ud574\ubcf4\uaca0\uc2b5\ub2c8\ub2e4.\\n\\n``` java title=\'\uacb0\uacfc \ud655\uc778 \ucf54\ub4dc\'\\npublic class Main {\\n    public static void main(String[] args) {\\n        OverringClass oc = new OverringClass();\\n        \\n        // \uc624\ubc84\ub85c\ub529 1\ubc88 \ud568\uc218\\n        oc.OverloadMethod();\\n\\n        // \uc624\ubc84\ub85c\ub529 2\ubc88 \ud568\uc218\\n        int a = oc.OverloadMethod(1,2);\\n        System.out.println(\\"\uc624\ubc84\ub85c\ub529 2\ubc88 \ud568\uc218 \ubc18\ud658\uac12 : \\"+a);\\n\\n        // \uc624\ubc84\ub85c\ub529 3\ubc88 \ud568\uc218\\n        int b = oc.OverloadMethod(4,5,6);\\n        System.out.println(\\"\uc624\ubc84\ub85c\ub529 3\ubc88 \ud568\uc218 \ubc18\ud658\uac12 : \\"+b);\\n\\n        // \uc624\ubc84\ub85c\ub529 4\ubc88 \ud568\uc218\\n        boolean c = oc.OverloadMethod(\\"park\\");\\n        System.out.println(\\"\uc624\ubc84\ub85c\ub529 4\ubc88 \ud568\uc218 \ubc18\ud658\uac12 : \\"+c);\\n    }\\n}\\n```\\n\\n```text title=\'\uacb0\uacfc\'\\n============================\\n\ub9e4\uac1c\ubcc0\uc218 \uc218 : 0\uac1c\\n\ub9e4\uac1c\ubcc0\uc218 \ud0c0\uc785 : void\\n\uc624\ubc84\ub77c\uc774\ub529 1\ubc88 \ud568\uc218 \uc785\ub2c8\ub2e4.\\n============================\\n============================\\n\ub9e4\uac1c\ubcc0\uc218 \uc218 : 2\uac1c\\n\ub9e4\uac1c\ubcc0\uc218 \ud0c0\uc785 : int\\n\uc624\ubc84\ub77c\uc774\ub529 2\ubc88 \ud568\uc218 \uc785\ub2c8\ub2e4. \ub367\uc148 \uac12\uc744 \ubc18\ud658\ud569\ub2c8\ub2e4.\\n============================\\n\uc624\ubc84\ub85c\ub529 2\ubc88 \ud568\uc218 \ubc18\ud658\uac12 : 3\\n============================\\n\ub9e4\uac1c\ubcc0\uc218 \uc218 : 3\uac1c\\n\ub9e4\uac1c\ubcc0\uc218 \ud0c0\uc785 : int\\n\uc624\ubc84\ub77c\uc774\ub529 3\ubc88 \ud568\uc218 \uc785\ub2c8\ub2e4. \uacf1\uc148\uc744 \ubc18\ud658\ud569\ub2c8\ub2e4.\\n============================\\n\uc624\ubc84\ub85c\ub529 3\ubc88 \ud568\uc218 \ubc18\ud658\uac12 : 120\\n============================\\n\ub9e4\uac1c\ubcc0\uc218 \uc218 : 1\uac1c\\n\ub9e4\uac1c\ubcc0\uc218 \ud0c0\uc785 : String\\n\uc624\ubc84\ub77c\uc774\ub529 4\ubc88 \ud568\uc218 \uc785\ub2c8\ub2e4. \uc774\ub984\uc774 park\uc774\uba74 true\ub97c \ubc18\ud658\ud569\ub2c8\ub2e4.\\n============================\\n\uc624\ubc84\ub85c\ub529 4\ubc88 \ud568\uc218 \ubc18\ud658\uac12 : true\\n```"}]}')}}]);